var book = {
	"name": "မၫကၧၭ",
	"numChapters": 16,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> ယွၩအဖိၪခွၫယ့ၫၡုၬဎရံၬ အဆၧၥၭထိၬအပရၧၫ့ အခၪ့ထံၭနီၪ, ဘဲၫဆၧကွ့ၭအၥၭလၧမီၪစအဲၫစ့ယၫ",
			"2": "<sup>2</sup> အၥိၭ,- ယိခွါ, ယ အၪ့ မၧၫ့ ဝဲၩ ယ ၥီၫ့ လ ဂၩ လၧ အ မိ လ့ၩ တဲၩ့ ဝဲၩ န ဖၧၩ့ ၥၭ လၧ န မ့ၬ ယၫ",
			"3": "<sup>3</sup> လီၫ.- ဆၧ အ လူ ၥီၫ လၧ မံၩ့ လၬ ကျၩ စံၭ ဝ့ၫ, တဲၩ့ ဝဲၩ  က ဆါ အ ဖၧၩ့ ၥၭ နီၪ ဆံၭ. မၩ လီၩ့",
			"4": "<sup>4</sup> အ ဖၧၩ့ မု လဖၪနီၪဆံၭ.- စယီဟၫ့ဘၭတံၫဇၫ့ ဆၧ လၧမံၩ့လၬကျၩတၭ, လီၩလၩ့လၬလၩ့ဆၧဘၭတံၫဇၫ့ ဘၪဆဲၫ့လၧဆၧနီၫ့ယါလၩ့ထဲၩ့ၥၭ လၧဆၧကွဲၪဖျါ",
			"5": "<sup>5</sup> ဆၧဒဲၩဘၭအဂဲးလီၫ.- ၦယုဒၫဖိၪထၧၫ့ခးယၫ ဒဲၦယရုစလံၫ့ၥံၪထီးအလူၬ ဂဲၫလၧအအီၪတၭ,လီၩ လၩ့အဆၧဒဲၩဘၭတၭ, ဒိၭဘၭတံၫဇၫ့အၥၭလၧအ ဝ့ၫဒၪအစူၪဖၧၩ့ ထီးထံၫယီၫဒၫ့အချိၬဖၧၩ့လီၫ.",
			"6": "<sup>6</sup> စယီဟၫ့ကီၩ့ၥိၭကလအူၭအဆီၪ့, ခဲးထူၬအယးဒံၩ့ လၧခၧၩ့ယးဆၧဖံၭတၭ, အၪ့ထွ့ဒဲန့ၫမံၩ့အစၩ့လီၫ.",
			"7": "<sup>7</sup> လီၩလၩ့လၬလၩ့ဆၧတၭ,စံၭဝ့ၫဒၪ,ၦဂဲၫဝ့ၫလၧယလး ခဲၫ့လဂၩနီၪၥ့ၪနဲၪ့ယၧၩဒံၭလီၫ. န့ၫယကူၭလၩ့ယ ၥၭတၭ, ကွဲၪလၩ့ခွံၬအခၪ့ဖံၭဖျံၩနီၪ ယကြၨၭအ့ၬ.",
			"8": "<sup>8</sup> ယဝ့ၫဒၪယီၩ ယဘၭတံၫဇၫ့နၥံၪ လၧထံၫကျၩလီၫ. အ့ၪမွဲအဝ့ၫဒၪနီၪမိဘၭတံၫဇၫ့နၥံၪ လၧၥၭမုဆံၫ့ဎံၪ အဖၧၩ့လီၫ.",
			"9": "<sup>9</sup> ဆၧလၧမုနံၩလဖၪနီၪ ဆၧမၩအၥၭလၧယ့ၫၡုၬဂဲၫ စဲၪ့ထၪ့ ခွံၬလၧဎဒိၩ့ၭနၭဇရ့ၭအီၪ လၧဎခးၭဂၫလလံၫ အဖၧၩ့နီၪ ဒိၭဘၭတံၫဇၫ့အၥၭလၧစယီဟၫ့အစူၪ",
			"10": "<sup>10</sup> ဖၧၩ့ထီးယီၫဒၫ့အဖၧၩ့နီၪလီၫ.- မွဲအဂဲထုၪ့ထဲၩ့လၧ ထံၫကျၩချဲၫ့မၬတၭ, ဒၪဘၪမူၭခိၪဝဲထၪ့အၥၭတၭ, ၥၭမုဘဲၫထိၪလွံ အၥိၭနီၪဂဲၫဆီးလၩ့လၧအလီၩ့",
			"11": "<sup>11</sup> လီၫ.- ဆၧၥီၫလၩ့လၧမူၭခိၪစံၭဝ့ၫဒၪ, နဝ့ၫဒၪယီၩ,န မွဲယဖိၪခွၫၥၭဘီၩ့တၭ, မုၬယၥၭလၧနၧၩလီၫ.",
			"12": "<sup>12</sup> ၥၭမုနီၪဒုၭလ့ၩအဝ့ၫဒၪ လၧမံၩ့လၬကျၩချဲၫ့မၬလီၫ.",
			"13": "<sup>13</sup> အီၪဝ့ၫလၧမံၩ့လၬကျၩအနံၩလံဆံၫတၭ, ဘၪဆၧ ကျဲၩ့ဖစီၩ့လၧမုၪခီၩလဲးတၭ, အီၪဝ့ၫလၧဆၧဖိၪဆၧဎါ အမံၩ့ၥံၪအကျၩတၭ, အၥီၫ့ၥံၪလုအၪ့လုအီၩဝ့ၫလီၫ.",
			"14": "<sup>14</sup> စယီဟၫ့ဘၪဆၧဖ့ၪလၫ့ခွံၬဝ့ၫအလးခဲၫ့နီၪ, ယ့ၫၡုၬ ဂဲၫလၧဂၫလလံၫအဖၧၩ့တၭ, လီၩလၩ့လၬလၩ့ယွၩ",
			"15": "<sup>15</sup> အဘၩ့အမုးအဆၧၥၭထိၬ အပရၧၫ့စံၭဝ့ၫဒၪ,-အ ဆၧၫ့အထီ ဎွ့ၩထၪ့ယူၭတၭ, ယွၩအဘၩ့အမုးနီၪ ဘူၭထၪ့ယူၭ, နီၫ့ယါလၩ့ထဲၩ့နၥံၪအၥၭဒဲနဲၩထဲၩ့ ဆၧၥၭထိၬအပရၧၫ့နီၪဆံၭ.",
			"16": "<sup>16</sup> အဝ့ၫဒၪစဲၪ့ဝ့ၫလၧကွံၩဂၫလလံၫအနဲၩ့ထံၭအ ဘိၩ့ဘၭနီၪ, ဒၪဘၪဝ့ၫလၧၦထၧၫ့ဖုဝဲနံၫဂၩစစဲမၧၫ့ဒဲ စအၫ့ဒူၫခွံၬၡၬ လၧကွံၩဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩမွဲၦ",
			"17": "<sup>17</sup> မၩယၪလီၫ.- ယ့ၫၡုၬစံၭအဝ့ၫၥံၪ ဖိၬယခဲၫ့ဆံၭ. ယမိ",
			"18": "<sup>18</sup> ဒုၭကဲၪထၪ့နၥံၪၦခွံၬၡၬလၧအန့ၦၡၩလီၫ.- အဝ့ၫၥံၪ စဲၪ့ဒၪခွံၬအၡၬချဲၫ့မၬတၭ, ဖိၬထၪ့အခဲၫ့လီၫ.",
			"19": "<sup>19</sup> အဝ့ၫဒၪလ့ၩဖီၩ့ခွံၬ ထီးနီၪလဆံၭတၭ, ဒၪဘၪဝ့ၫလၧ စဇ့ၭဘဒံၫအဖိၪခွၫစယ့မံၭ, ဒဲအထၧၫ့ဖုဝဲစယီဟၫ့လ",
			"20": "<sup>20</sup> ဖၪဆၭထဲၩ့အၡၬလၧချံၫဖၧၩ့လီၫ.- မွဲအကိၭန့အဝ့ၫ ၥံၪချဲၫ့မၬတၭ, အဝ့ၫၥံၪစဲၪ့ဒၪခွံၬအဖါ စဇ့ၭဘဒံၫဒဲၦ လၧအအၪ့လံၩ့ဝ့ၫလဖၪလၧအအီၪထး လၧချံၫဖၧၩ့နီၪ, ဖိၬထၪ့အခဲၫ့လီၫ.",
			"21": "<sup>21</sup> အဝ့ၫၥံၪလ့ၩနုၬဝ့ၫလၧကပၧနအၫ့ အဖၧၩ့နီၪလၧ မးၥံၫအနံၩ, လ့ၩနုၬဝ့ၫလၧၥရိၬဖၧၩ့နီၪ ချဲၫ့မၬတၭ,",
			"22": "<sup>22</sup> ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဆၧလီၫ.- အဝ့ၫၥံၪထီၫမံၫထီၫမၪလၧ အၥီၪ့ဆၧၥၫ့ဆၧအကၠီၩ့လီၫ. အဂဲးဘဲၫယီၩ မွဲအလ ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဘၪဆၧဘဲၫၦကွ့ၭလံၬ အၥိၭတၭ, မွဲ ဘဲၫၦအီၪလၧအစီၩ့အမၩ့အၥိၭနီၪလီၫ.",
			"23": "<sup>23</sup> ၦလၧဆၧနၪအီၪလၧအလီၩ့လဂၩအီၪဝ့ၫလၧအ",
			"24": "<sup>24</sup> ဝ့ၫၥံၪအၥရိၬဖၧၩ့နီၪ,ကိၭၡၭထၪ့ဆၧတၭ,- စံၭဝ့ၫဒၪ, အၩလါ,ၦနၭဇရ့ၭဖိၪ ယ့ၫၡုၬဧ့, ဆၧဘၪဆဲၫ့ လၧ ပၧၩဒဲနၧၩမွဲဆၧနီၪလဲၪ. မွဲနဂဲၫမၩဂၭဂီၩ့ပၧၩဆ့ဧၪ. နဝ့ၫဒၪယီၩနမွဲပလၫလဂၩလဲၪနီၪယၥ့ၪယၫယဝ့ၫလီၫ.",
			"25": "<sup>25</sup> နမွဲယွၩအဆၧဆံၫ့ဎံၪလဂၩနီၪလီၫ.- ယ့ၫၡုၬအၪ့လၬ အဝ့ၫနီၪတၭ,စံၭဝ့ၫဒၪ,အီၪလၩ့မါပံၭတၭ, စဲၪ့ထၪ့ခွံၬ",
			"26": "<sup>26</sup> လၧအလီၩ့ဆံၭ.- ဆၧနၪနီၪ ဒုၭကဲၩ့ထၪ့ဝ့ၫနၭနၭလ့ၬ တၭ,ကိၭၡၭထၪ့ဆၧလၧအလူၥီၫဖၭဒိၪတၭ, စဲၪ့ထၪ့",
			"27": "<sup>27</sup> ခွံၬဝ့ၫလီၫ.- တၭအဝ့ၫၥံၪကိၭဂၩဒ့ၭထီၫမံၫထီၫမၪဝ့ၫ နီၪ,ထီးအဝ့ၫၥံၪအၪ့စၪ့လိၬအၥၭ, စံၭဝ့ၫဒၪ, အယီၩမွဲ ဆၧနီၪလဲၪ, ဆၧၥီၪ့ဆၧၥၫ့ယီၩမွဲဘဲၫၥ့ၪလဲၪ. အဂဲး ဘဲၫယီၩအဝ့ၫမၪလူၬ ဆၧနၪလဖၪ လၧဆၧအစီၩ့အ မၩ့တၭ, အဝ့ၫၥံၪခိၭနၪအလူမၬကၨ.",
			"28": "<sup>28</sup> အမံၩ့ဂၧၫ့ထၪ့ၥၩလၩ့ လၧဂၫလလံၫနီၪ ထၧၫ့ခး ယၫချဲၫ့မၬလီၫ.",
			"29": "<sup>29</sup> စဲၪ့ထၪ့ခွံၬလၧၥရိၬဖၧၩ့ချဲၫ့မၬတၭ, အဝ့ၫၥံၪ လ့ၩနုၬဝ့ၫလၧစယ့မံၭ ဒဲစယီဟၫ့အၥိၭ လၧစစဲမၧၫ့",
			"30": "<sup>30</sup> ဒဲစအၫ့ဒူၫ အဂံၪ့ဖၧၩ့လီၫ.- စစဲမၧၫ့အမံၩ့ၡါမုၪလ ဂၩဆူၪဂိၬနီၪမံၫနၩ့ဝ့ၫဒၪတၭ, အဝ့ၫၥံၪလီၩဘၪယ့ၫၡုၬ",
			"31": "<sup>31</sup> လၧအဂဲးချဲၫ့မၬလီၫ.- အဝ့ၫဒၪလ့ၩဖီၪ့အစူၪဘိၭထၪ့ ဝ့ၫတၭ,အဆၧဆူၪဂိၬနီၪ စဲၪ့ထၪ့ခွံၬလၧအလီၩ့ချဲၫ့မၬ လီၫ.တၭၦမုၪနီၪ မၩအခ့ၫအၡၩအဆၧမၩ လၧအဝ့ၫ ၥံၪအဂးလီၫ.",
			"32": "<sup>32</sup> မုဂၪလၩ့ထီးမုမ့ၬလၩ့နုၬတၭ, ၦဂဲၫဆိၬကယဲၦလၧ အဘၪစူၭဘၪဆၫ, ဒဲၦလၧဆၧနၪအီၪလၧအလီၩ့လဖၪ",
			"33": "<sup>33</sup> နီၪလီၫ.- ၦဒိၩ့ဖိၪထၧၫ့ဒိၩ့ယၫ အီၪကီၪ့ဝ့ၫလၧအဂံၪ့တ",
			"34": "<sup>34</sup> ရၫ့ထံၭနီၪလီၫ.- အဝ့ၫဒၪမၩဘျၪထဲၩ့ၦလၧအဆၫလၧ ဆၧစူၭ ဆၧဆၫလမံၩ့မံၩ့အၪဂၩတၭ, နၫ့ထၪ့ခွံၬဆၧနၪ အၪဒုၩတၭ, မွဲလၧဆၧနၪၥ့ၪယၫအဝ့ၫအကၠီၩ့နီၪ, ဖ့ၪ လၫ့အဝ့ၫၥံၪချဲၩ့ဆၧအ့ၬ.",
			"35": "<sup>35</sup> မုဆဲၪ့ထၪ့လၧဆၧခံၭဒံၭနီၪ, အဝ့ၫဒၪဂဲထုၪ့ဝ့ၫတၭ, စဲၪ့ထၪ့လၧမံၩ့လၬကျၩ ဘၩဆိၪဖၪဆၧထီးနီၪလီၫ.",
			"36": "<sup>36</sup> စစဲမၧၫ့ဒဲၦအီၪလၧအၥိၭလဖၪနီၪ လီၩ့ဆီးဝ့ၫလီၫ.",
			"37": "<sup>37</sup> ထီးအဒၪဘၪဝ့ၫတၭ, စံၭအဝ့ၫဒၪ, ၦထီးအလူၬအၪ့ဎၬ",
			"38": "<sup>38</sup> နၧၩလီၫ.- အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, မွဲၦလ့ၩၡီၩ့လၧဒိၩ့အ ဘူၭလဖၪ ဘဲၫၥိၭယမိလီၩ့လၩ့လၬလၩ့ဆၧ ထီးနီၪဆ့ ဆံၭ. အဂဲးဘဲၫယီၩ ယဂဲၫယဝ့ၫလၧဆၧနီၪအကၠီၩ့",
			"39": "<sup>39</sup> လီၫ.-အဝ့ၫဒၪလီၩလၩ့လၬလၩ့ဆၧ လၧအဝ့ၫၥံၪအ ၥရိၬဖၧၩ့ လၧဂၫလလံၫထၧၫ့ခးယၫတၭ နၫ့ထၪ့ခွံၬဆၧ နၪလဖၪလီၫ.",
			"40": "<sup>40</sup> ၦအခံၫထူၬဆၫအၧၩ့လဂၩ ဂဲၫလၧအအီၪတၭ, ချံၭလၩ့အခၪ့လၧအခၪ့ထံၭး အၪ့ကံၩ့အၪ့ယၫဝ့ၫ,စံၭ ဝ့ၫဒၪ,နၥၭအ့ၪအီၪလၧ နမိမၩဆံၫ့ထၪ့ထဲၩ့ယၧၩတၭ,",
			"41": "<sup>41</sup> နမၩနဝ့ၫၥ့ၪလီၫ.- ယ့ၫၡုၬယၫ့ၥၭဝ့ၫတၭ, ယူၬထၪ့အ စူၪထိၭဘၪဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ယၥၭအီၪ,မွဲနဆံၫ့ထၪ့",
			"42": "<sup>42</sup> ထဲၩ့ဆံၭ.- တၭအဆၧခံၫထူၬဆၫအၧၩ့ စဲၪ့ထၪ့ခွံၬ လၧ",
			"43": "<sup>43</sup> အလီၩ့ချဲၫ့မၬတၭ,ဆံၫ့ထၪ့ထဲၩ့ဝ့ၫလီၫ.- အဆၧမၪ",
			"44": "<sup>44</sup> လူၬဝ့ၫဆီၪ့ဆီၪ့ဂီၩ့,ကွဲၪဖျါဝ့ၫဒၪချဲၫ့မၬတၭ,- စံၭအဝ့ၫ နီၪထီးလၩ့နၥၭဘဲၫၥိၭနထီးလီၩဘၪ ၦနးဂၩလၧဆၧ နးမံၩ့လဂ့ၩး မွဲလါနၫ့ဘိၩလ့ၩဒုၭနဲၪနၥၭလၧၦလုဆၧ တၭ,မၩဘိၪ့ဆၧလၧစမိစ့ၭမၪလူၬဝဲၩဝ့ၫနီၪ လၧနဆံၫ့ ထၪ့အကၠီၩ့လၧဆၧထိးအၥၭလၧအဝ့ၫၥံၪအဂး",
			"45": "<sup>45</sup> ဆံၭ.- မွဲလါနၫ့ဘိၩ အဝ့ၫဒၪစဲၪ့ထၪ့ခွံၬလီၩဘၪၥၫ့ဆၧ အၪအၪလ့ၬတၭ,မၩဂၧၫ့ထၪ့ၥၩလၩ့ဆၧနီၪ ထီးယ့ၫ ၡုၬလ့ၩနုၬအီၪဖျီၪဝ့ၫ လၧဒိၩ့ဖၧၩ့ၥ့ၪလၧၩ့အ့ၬ. အ့ၪ မွဲအီၪဝ့ၫလၧမံၩ့လၬကျၩတၭ, ၦၡၩဂဲၫထၪ့လၧအလး ကိၭစီၪ့ဒ့ၭတၭ, ထီၩ့လၧအအီၪနီၪလီၫ."
		},
		"2": {
			"1": "<sup>1</sup> မုနံၩလနၩ့နၩ့ဖီၩ့ခွံၬဝ့ၫနီၪ ယ့ၫၡုၬလ့ၩနုၬဒီၭလၧက ပၧနအၫ့အဖၧၩ့တၭ, ၦနါဂၧၫ့ဘၪလၧအအီၪ လၧဂံၪ့",
			"2": "<sup>2</sup> ဖၧၩ့လီၫ.- ၦအၪဂၩဂဲၫအီၪကိၩ့အီၪကီၪ့ဝ့ၫ ချဲၫ့မၬထီး အလးလအီၪလၧၩ့ဘၪလၧတရၫ့ထံၭဒၪလ့ၬနီၪ အီၪဝ့ၫ ဆ့အ့ၬ. အဝ့ၫဒၪလီၩလၩ့လၬလၩ့ ဆၧအလူအထၫလၧ အဝ့ၫၥံၪလီၫ.",
			"3": "<sup>3</sup> ၦလဖၪဂဲၫလၧအအီၪတၭ, ၦလံဂၩဂဲၫယိၭၦၥံၫ",
			"4": "<sup>4</sup> လခီၫဖၩလဂၩနီၪ,- လၧၦခမျၧးအကၠီၩ့တၭ,လ့ၩဆိၬ စိၩဝ့ၫလၧအဂၩ့ထံၭလၥ့ၪဘၪ အဝ့ၫၥံၪမၩဖိးဆၧလၧ အအီၪဝ့ၫအလးအဖၫ့ခိၪနီၪမၩခွံၬဝ့ၫတၭ, ဆဲၩလၩ့ လးမံၫလၧၦၥံၫလခီၫဖၩလဂၩနီၪ မံၫနၩ့လၧအဖၧၩ့",
			"5": "<sup>5</sup> လီၫ.- ထီးယ့ၫၡုၬဒၪ ဘၪအဝ့ၫၥံၪအဆၧနဲၩတၭ, စံၭၦၥံၫလခီၫဖၩနီၪ ဖိၪခွၫဧ့,နဆၧဒဲၩဘၭဖျါယူၭ.",
			"6": "<sup>6</sup> ၦကွ့ၭလံၬလနၩ့နၩ့ဆၧၫ့နၩ့ထီးနီၪတၭ, ဆီၫ့မီၪ့ဆၧ",
			"7": "<sup>7</sup> လၧအၥၭဖၧၩ့,- အယီၩလဂၩချဲၩ့မၪယွၩဘဲၫယီၩမွဲ ဘၪလဲၪ.အ့ၪလမွဲဘၪ ယွၩလဂၩဎးနီၪမွဲပလၫကွဲၪဖျါ",
			"8": "<sup>8</sup> ဆၧဒဲၩဘၭၥ့ၪလဂၩလဲၪ.- ယ့ၫၡုၬၥ့ၪယၫဆၧလၧအ ၥၭဖၧၩ့ချဲၫ့မၬ လၧၦလဖၪနီၪဆီၫ့မီၪ့ဆၧလၧအၥၭခံ ဖၧၩ့ဘဲၫနီၪတၭ, စံၭအဝ့ၫၥံၪ, မွဲဘၪနီၫနၥံၪဆီၫ့မီၪ့ဆၧ",
			"9": "<sup>9</sup> လဖၪနီၪလၧနၥံၪအၥၭခံဖၧၩ့လဲၪ.- မွဲအယီၫထံၪထံၪ လဲၪ,ၦစံၭၦၥံၫလခီၫဖၩ, နဆၧဒဲၩဘၭဖျါယူၭနီၪ မွဲအ ယီၫလဆံၭဧၪ, ၦစံၭဂဲထုၪ့ဆိၬထၪ့နလးမံၫတၭ,စဲၪ့ထၪ့",
			"10": "<sup>10</sup> ဆံၭနီၪ,မွဲအယီၫလဆံၭဧၪ,- မွဲလါနၫ့ဘိၩဘဲၫၥိၭနၥံၪ မိၥ့ၪယၫလၧၦၡၩအဖိၪခွၫလဂၩယီၩ အီၪလၧအစီၩ့အ မၩ့လၧအကွဲၪဖျါ ဆၧဒဲၩဘၭၥ့ၪဝ့ၫတၭ, (စံၭၦၥံၫလ",
			"11": "<sup>11</sup> ခီၫဖၩလဂၩနီၪ,)- ယစံၭနၧၩ, ဂဲထုၪ့တၭ, ဆိၬထၪ့န",
			"12": "<sup>12</sup> လးမံၫ,ထဲၩ့ထဲၩ့လၧနဂံၪ့ဆံၭ.- အဝ့ၫနီၪဂဲထုၪ့ဝ့ၫချဲၫ့ မၬတၭ,ဆိၬထၪ့အလးမံၫ, စဲၪ့ထၪ့ဝ့ၫလၧၦထီးအလူၬ အမ့ၬယၫ,ထီးၦၡၩထီၫမံၫထီၫမၪ ထီးအလူၬတၭ,စံၭ ထၪ့အၪ့အူၭယွၩ, စံၭဝ့ၫဒၪ, ဆၧဘဲၫယီၩၦဒၪဘၪနး ဆိၭအ့ၬ.",
			"13": "<sup>13</sup> အဝ့ၫဒၪစဲၪ့ထၪ့ဒီၭ ထီၩ့လၧကွံၩအနဲၩ့ထံၭတၭ, ၦ ခမျၧးထီးအလူၬ ဂဲၫလၧအအီၪ မွဲအၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့အ ဝ့ၫၥံၪလီၫ.",
			"14": "<sup>14</sup> အဝ့ၫဒၪစဲၪ့ထၪ့ဝ့ၫတၭ, ဒၪဘၪစအၫလဖံအၧၭအ ဖိၪခွၫစလံဝဲၫလဂၩဆၧၫ့နၩ့ လၧၦအၪ့ကံၩ့အခီၫ့ အ လးတၭ, စံၭအဝ့ၫနီၪဖိၬယခဲၫ့ဆံၭ. အဝ့ၫဂဲထုၪ့တၭ,",
			"15": "<sup>15</sup> ဖိၬထၪ့အခဲၫ့လီၫ.- ဆၧမၩအၥၭလၧယ့ၫၡုၬဆၧၫ့နၩ့ ဒံၩ့ခံၫ့လၧစပွဲထံၭလၧဂံၪ့ဖၧၩ့အဘိၩ့ဘၭတၭ, ၦအၪ့ ကံၩ့အခီၫ့ ဒဲၦဆၧဒဲၩဘၭဖိၪအၪဂၩဆၧၫ့နၩ့ဒံၩ့ခံၫ့ ဎုၬဆ့လၧယ့ၫၡုၬ, ဒဲလၧအထံၩအဖျဲၥံၪအၥိၭလီၫ. အဂဲးဘဲၫယီၩအီၪဝ့ၫအၪဂၩတၭ, ဖိၬထၪ့အခဲၫ့လီၫ.",
			"16": "<sup>16</sup> ၦကွ့ၭလံၬဒဲၦဖၫရစံၫၥံၪဒၪဘၪ လၧအအၪ့ဎုၬဆၧလၧ ၦအၪ့ကံၩ့အခီၫ့, ဒဲလၧၦဆၧဒဲၩဘၭဖိၪလဖၪ အၥိၭ တၭ,စံၭအထံၩအဖျဲၥံၪ, မွဲဘၪနီၫလၧအဝ့ၫဒၪအၪ့ဎုၬ ဆၧဒဲအီၩဎုၬဆၧ လၧၦအၪ့ကံၩ့အခီၫ့ ဒဲၦဆၧဒဲၩဘၭ",
			"17": "<sup>17</sup> ဖိၪလဖၪအၥိၭလဲၪ.- ယ့ၫၡုၬနါဂၧၫ့ဝ့ၫတၭ, စံၭအဝ့ၫ ၥံၪ,ၦလၧအအီၪဆီၪ့အီၪချဲၫ့လဖၪမၩၥံၪ ဎၥံၪ့ဎွံၭ ဆရၫအလးအီၪအ့ၬ. မၩဝ့ၫအလးအီၪ န့ၫၦလၧအ ဆၫလဖၪလီၫ. ယဂဲၫကိၭထဲၩ့ၦအတီၩအလီၩ့အ့ၬ. အ့ၪမွဲၦဆၧဒဲၩဘၭဖိၪ ဎလၧဆၧနီၫ့ယါလၩ့ထဲၩ့ၥၭအဂဲးၭလီၫ.",
			"18": "<sup>18</sup> စယီဟၫ့,ဒဲၦဖၫရစံၫအထံၩအဖျဲၥံၪ ဒုၪဆၧအၪ့ဆၧ အီၩတၭ, ဂဲၫဝ့ၫလၧအအီၪ, စံၭဝ့ၫဒၪ, မွဲဘၪနီၫလၧစယီ ဟၫ့, ဒဲၦဖၫရစံၫအထံၩအဖျဲၥံၪ ဒုၪဆၧအၪ့ဆၧအီၩ",
			"19": "<sup>19</sup> တၭ,နထံၩနဖျဲၥံၪလဒုၪဘၪဆၧအၪ့ဆၧအီၩလဲၪ.- ယ့ၫ ၡုၬလီၩဘၪအဝ့ၫၥံၪ, ထီးတလၭမူၭအခွၫအီၪလၧအ ၥိၭအဘိၩ့ဘၭနီၪ, တလၭမူၭအဖျဲၥံၪ ဒုၪဆၧအၪ့ ဆၧအီၩမိၥ့ၪဧၪ. တလၭမူၭအခွၫအီၪလၧအၥိၭ အ ဘိၩ့အဘၭတၭ, အဝ့ၫၥံၪဒုၪဆၧအၪ့ဆၧအီၩၥ့ၪအ့ၬ.",
			"20": "<sup>20</sup> မွဲလါနၫ့ဘိၩအနံၩအၥၫ့မိဘၪလၧဆၧမိထုၭဖၭတလၭ မူၭအခွၫလၧအအီၪလီၫ. ထီးနီၪလဖၧၫ့မွဲအမိဒုၪဆၧ",
			"21": "<sup>21</sup> အၪ့ဆၧအီၩလၧမုနံၩနီၪလီၫ.- ဆၧအကီၩ့အၥိၭအ လံၩနီၪၦဆၭဘုၭထၬဝ့ၫလၧဆၧအၥၫ့နးဂၩအ့ၬ. အ့ၪ မၩဝ့ၫဘဲၫနီၪတၭ, ဆၧအၥၫ့လၧအမၩဎွ့ၩဝ့ၫနီၪ,မိၡၫ့ ယၬခွံၬဆၧအလံၩတၭ, အဖၧၩ့လးနီၪယၬလဲထၪ့ဝ့ၫ",
			"22": "<sup>22</sup> လီၫ.- ဆၧလၧထိၪ့ဆၧဖံၭအလံၩအဖၧၩ့နီၪ, ၦလူၫနုၬ ဝ့ၫစဘံၭထံၫအၥၫ့အ့ၬ. အ့ၪမၩဝ့ၫဘဲၫနီၪတၭ, စဘံၭ ထံၫအၥၫ့ မိမၩဖီးဖၭထိၪ့ဆၧဖံၭနီၪတၭ, စဘံၭထံၫ ယွၩလၩ့ခွံၬဝ့ၫတၭ, ထိၪ့ဆၧဖံၭ မိဂၭဂီၩ့ဝ့ၫလီၫ. အ့ၪမွဲစဘံၭထံၫအၥၫ့နီၪ ၦလူၫနုၬဝ့ၫလၧထိၪ့ဆၧဖံၭ အၥၫ့အဖၧၩ့လီၫ.",
			"23": "<sup>23</sup> ဆၧမၩအၥၭ လၧယ့ၫၡုၬလ့ၩဆၧ လၧဆံၬဖၧၩ့လၧ မးၥံၫအနံၩတၭ, အထံၩအဖျဲလဖၪလ့ၩလၧယၫ",
			"24": "<sup>24</sup> အဘိၩ့ဘၭနီၪ, ဒ့ၭန့ဘုၪအဆဲၩၥံၪလီၫ.- ၦဖၫရစံၫ ၥံၪစံၭအဝ့ၫနီၪ, ယိခွါ, ဆၧလဂ့ၩမၩဘၪလၧမးၥံၫအ",
			"25": "<sup>25</sup> နံၩယီၩမွဲဘၪနီၫနထံၩနဖျဲၥံၪမၩလဲၪ.- အဝ့ၫဒၪစံၭအ ဝ့ၫၥံၪ,စဒၫဝံၭ ဒဲၦအီၪဝ့ၫလၧအၥိၭလဖၪ ဆၧၥၭဝံအ ၥၭတၭ,ထီးအလးနီၪ, မၩဆၧဘဲၫအံၩဘဲၫအိၩတၭ,",
			"26": "<sup>26</sup> မွဲနၥံၪလဖီဘၪဧၪ.- အဝ့ၫဒၪလ့ၩနုၬ လၧယွၩအဂံၪ့ ဖၧၩ့,လၧၦလုဆၧအခိၪ စအဘဲအၥၫ အမုနံၩလဖၪ တၭ,အၪ့ဆၧမ့ၬယၫအကိၪလၧၦလဂ့ၩအၪ့ဘၪး ဂ့ၩအၪ့န့ၫၦလုဆၧလဖၪ, ဖ့ၪလၫ့အၥိၭဆ့,ဘဲၫၥ့ၪလဲၪ",
			"27": "<sup>27</sup> ဘဲၫၥ့ၪလဲၪနီၪ, မွဲနၥံၪဖီဘၪအ့ၬဧၪ.- အဝ့ၫဒၪစံၭအဝ့ၫ ၥံၪ,ဆၧလၧမးၥံၫအနံၩနီၪ အီၪဝ့ၫလၧၦၡၩအဂး",
			"28": "<sup>28</sup> တၭ,ၦၡၩအီၪဝ့ၫလၧမးၥံၫအနံၩအဂးအ့ၬ.- အနီၪ တၭဆၧလၧၦၡၩအဖိၪခွၫယီၩ မွဲမးၥံၫနံၩအက ဆါဆ့လီၫ."
		},
		"3": {
			"1": "<sup>1</sup> အဝ့ၫဒၪလ့ၩနုၬဒီၭဝ့ၫလၧၥရိၬဖၧၩ့နီၪ, ၦအစူၪၥံၫ",
			"2": "<sup>2</sup> လခီၫအီၪဝ့ၫထီးနီၪလဂၩလီၫ.- လၧမးၥံၫအနံၩနီၪ,မွဲ အမိမၩဘျၪထဲၩ့ဆၧ, လမၩဘျၪထဲၩ့ဘၪဆၧလဲၪနီၪ, ၦယိၥူၪဝ့ၫ ဘဲၫၥိၭအမိအီၪက့ၪဆၧမၪ လၧအလီၩ့",
			"3": "<sup>3</sup> လီၫ.- အဝ့ၫဒၪစံၭၦလၧ အစူၪၥံၫလဂၩနီၪ, ဂဲထုၪ့ထၪ့",
			"4": "<sup>4</sup> လၧဆၧၥၭကျၩဆံၭ.- တၭစံၭၦလဖၪနီၪဆၧလၧမးၥံၫ အနံၩနီၪမွဲအကြၨၭမၩဆၧဂ့ၩ, မၩဆၧအၧၩ့လဲၪ. မွဲအ ကြၨၭထိးထဲၩ့တၩ့ထဲၩ့ၥၭမၧၫ့နီၪ မၩၥံၫၥၭမၧၫ့လဲၪ.",
			"5": "<sup>5</sup> အဝ့ၫၥံၪအီၪလၩ့မါပံၭလီၫ.- မွဲအၥုၪ့အုၭ အၥၭအုၭ လၧအဝ့ၫၥံၪအၥၭနီၩ့အကၠီၩ့တၭ, ယိဆၧဝၬဝၬ လၧအ ၥၭခိထၪ့တၭ, စံၭၦလဂၩနီၪယူၬထၪ့နစူၪဆံၭ. အဝ့ၫ ဒၪယူၬထၪ့ဝ့ၫတၭ, အစူၪအီၪဆီၪ့ထၪ့ထဲၩ့ဝ့ၫဒၪ လီၫ.",
			"6": "<sup>6</sup> ၦဖၫရစံၫၥံၪစဲၪ့ထၪ့ခွံၬဝ့ၫချဲၫ့မၬတၭ, ဘဲၫၥိၭအမိ မၩဂၭဂီၩ့ဝ့ၫ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, ကၩ့ကၩလိၬအ ၥၭလၧၦဟရိဒအၫ့ဖိၪလဖၪလီၫ.",
			"7": "<sup>7</sup> ယ့ၫၡုၬဒဲအထံၩအဖျဲလဖၪ စဲၪ့ထၪ့ဝ့ၫလၧကွံၩနဲၩ့ ထံၭတၭ, ၦခမျၧးဖၭဒိၪလၧဂၫလလံၫ ဒဲလၧယုဒၫ,",
			"8": "<sup>8</sup> ဒဲလၧယရုစလံၫ့, ဒဲလၧအံၫဒုၫမံအၫ,ဒဲလၧထံၫယီၫဒၫ့ ဝါလခီၫၥံၪဖိၬထၪ့အခဲၫ့လီၫ. ၦခမျၧးဖၭဒိၪလၧတဲအၫ, ဒဲလၧစဲဒၧၫ့အနဲၩ့ထံၭ လဖၪ ထီးအနါဂၧၫ့အမၩဆၧ",
			"9": "<sup>9</sup> လၩ့လၭလဖၪတၭ, ဂဲၫဝ့ၫလၧအအီၪလီၫ.- အဝ့ၫဒၪ မၪလူၬအထံၩအဖျဲၥံၪဘဲၫၥိၭ ချံၫဖိၪနးဖျိၪ့မိဖိၬအခဲၫ့ လၧၦခမျၧးအကၠီၩ့, ဘဲၫၥိၭအဝ့ၫၥံၪထီးဘၪထံၭလၧ",
			"10": "<sup>10</sup> အဝ့ၫဒၪလဂ့ၩနီၪလီၫ.- အဂဲးဘဲၫယီၩအဝ့ၫဒၪမၩဘျၪ ထဲၩ့ယူၭ ၦအၪဂၩထီးဒၪၦလၧအဘၪဆၧစူၭဆၧဆၫ",
			"11": "<sup>11</sup> လဖၪဂဲၫနုၬဆီၪ့ဘဲၫအမိထိၭဘၪအဝ့ၫအၥိၭလီၫ.- ဆၧ နၪလဖၪထီးအဒၪဘၪဝ့ၫတၭ, ထွံၩလၩ့လၧအခၪ့ထံၭ, ကိၭၡၭ ထၪ့ဆၧတၭ, စံၭဝ့ၫဒၪ, နဝ့ၫဒၪယီၩနမွဲယွၩအ",
			"12": "<sup>12</sup> ဖိၪခွၫလီၫ.- အဝ့ၫဒၪမၪလူၬအဝ့ၫၥံၪလၩ့ထံးလၩ့ဆ့ၭ ဘဲၫၥိၭအထီးမၩဖျီၪထၪ့ဝ့ၫလဂ့ၩလီၫ.",
			"13": "<sup>13</sup> မွဲအလ့ၩထၪ့လၧခိၪလီၩ့အလီၩ့တၭ, ကိၭန့ၦလၧ အဘၪအၥၭလဖၪနီၪ, အဝ့ၫၥံၪဂဲၫလၧအအီၪလီၫ.",
			"14": "<sup>14</sup> အဝ့ၫဒၪအီၪက့ၪလၩ့ၦလဆံၫနံၫဂၩ ဘဲၫအမိအီၪလၧ အၥိၭတၭ, ဘဲၫၥိၭအမိအၪ့မၧၫ့ အလ့ၩလီၩလၩ့လၬ",
			"15": "<sup>15</sup> လၩ့ဆၧ,- ဒဲအီၪဝ့ၫ လၧအစီၩ့အမၩ့ ဘဲၫၥိၭအမိမၩ ဘျၪထဲၩ့ဆၧစူၭဆၧဆၫ, ဒဲနၫ့ထၪ့ခွံၬဆၧနၪလဖၪလီၫ. စစဲမၧၫ့ကိၭဝ့ၫအမံၩ့အၥၫ့လၧစပံတၧၫ,",
			"16": "<sup>16</sup> ဒဲစဇ့ၭ ဘဒံၫအဖိၪခွၫ စယ့မံၭအထၧၫ့ဖုဝဲစယီဟၫ့ကိၭဝ့ၫ အမံၩ့အၥၫ့စဘိအနၧက့ၭ, ဘဲၫၦစံၭဆၧအၥိၭ, ၦလၫ့",
			"18": "<sup>18</sup> အဖိၪခွၫၥံၪလီၫ.- ဒဲစအၫ့ဒူၫ,ဒဲစဖံလံၭ, ဒဲစဘၫၥီ လမုၫ,ဒဲစမၭၥုၫဒဲစထီမၭ, ဒဲစအၫလဖံအၧၭ အဖိၪ ခွၫစယ့မံၭ, ဒဲစၥၭဒံအၧၭ, ဒဲၦကၫနအၫ့ဖိၪ စစဲမၧၫ့,",
			"19": "<sup>19</sup> ဒဲၦလၧအဖ့ၪလၫ့ခွံၬအဝ့ၫ စယုဒၫအံၭစကၫရအၧၭနီၪ လီၫ.",
			"20": "<sup>20</sup> အဝ့ၫၥံၪလ့ၩနုၬဝ့ၫလၧအဂံၪ့ဖၧၩ့တၭ, ၦခမျၧးအီၪ ကိၩ့အီၪကီၪ့ဒီၭတၭ, န့ၫအအၪ့ဆၧနီၪချႃၭအ့ၬ.",
			"21": "<sup>21</sup> ထီးယ့ၫၡုၬ အဘူၭအထံးနါဂၧၫ့ဝ့ၫတၭ, လ့ၩထၪ့ ဘဲၫၥိၭအမိဖီၪ့ထၬအဝ့ၫဒၪလီၫ. အဂဲးဘဲၫယီၩအဝ့ၫ ၥံၪစံၭဝ့ၫ,မွဲအဖျႃထၪ့လီၫ.",
			"22": "<sup>22</sup> ၦကွ့ၭလံၬလဖၪ လၧအဂဲၫလၩ့လၧယရုစလံၫ့စံၭဝ့ၫ ဒၪ, မွဲဘၫအလၭစဘၧၭအီၪဝ့ၫလၧအလီၩ့တၭ, နၫ့",
			"23": "<sup>23</sup> ထၪ့ခွံၬဆၧနၪလၧဆၧနၪအခိၪအကၠီၩ့လီၫ.- အဝ့ၫဒၪ ကိၭန့အဝ့ၫၥံၪလၧအအီၪတၭ, လီၩဘၪဝ့ၫလၧဆၧချဲၩ့ အဒီၩ့ မုၪခီၩလဲးနၫ့ထၪ့ခွံၬ မုၪခီၩလဲးနီၪမိၥ့ၪဘဲၫၥ့ၪ",
			"24": "<sup>24</sup> လဲၪ.- ဆၧအဘၩ့အမုးအ့ၪလၩ့ဖၭလိၬအၥၭတၭ, ဆၧ",
			"25": "<sup>25</sup> လၧအဘၩ့အမုးနီၪအီၪဂုးခၧၫ့ဝ့ၫၥ့ၪအ့ၬ.- ဂံၪ့ၥံၪဎၫ့ ၥံၪအ့ၪလၩ့ဖၭလိၬအၥၭတၭ, ဆၧလၧဂံၪ့နီၪအီၪဂုးခၧၫ့",
			"26": "<sup>26</sup> ဝ့ၫၥ့ၪအ့ၬ.- မုၪခီၩလဲးအ့ၪထၫ့ဒုၪဒၩမုၪခီၩလဲးတၭ, လၩ့မုလၩ့ဖၭဝ့ၫတၭ,အီၪဂုးခၧၫ့ဝ့ၫလၥ့ၪဘၪတၭ, မိ",
			"27": "<sup>27</sup> ထုၬဝ့ၫဒၪလီၫ.- ၦအ့ၪလစၧၩ့ထၬဆိၫဒၪခလူၬဘၪၦ အဂဲးဆီၪ့နီၪ, မွဲအနုၬအၪ့ဂူၬန့အဆၧလၧအဂံၪ့ဖၧၩ့မိ ၥ့ၪဘဲၫၥ့ၪလဲၪ, အ့ၪမၩဘဲၫနီၪဂီၩ့တၭ, အၪ့ဂူၬန့အဆၧ",
			"28": "<sup>28</sup> ၥ့ၪလီၫ.- ယလီၩဘၪနၥံၪတီၩတီၩယီၩ,ကယဲဆၧဒဲၩ ဘၭထီးအလူၬ, ဒဲထီးဒၪဆၧဒုၪဒွ့ၪလၧၦဒုၪဒွ့ၪဝ့ၫနီၪ,",
			"29": "<sup>29</sup> ဆၧမိမၩဖီၩ့မၩဖျ့ၭန့ၦၡၩအဖိၪခွၫၥံၪလီၫ.- အ့ၪမွဲထီး ဒၪၦလဂၩဂၩ လၧအဒုၪဒွ့ၪဘၪၥၭမုဆံၫ့ဎံၪနီၪဆၧ မၩဖီၩ့မၩဖျ့ၭ အဆၧဒဲၩဘၭနးဆိၭအ့ၬ. မွဲအကြၨၭ",
			"30": "<sup>30</sup> ဘၪဆၧစ့ၩရၫ့စၪ အဆိၩဆိၩအကၠၪကၠၪလီၫ.- အဂဲး ဘဲၫယီၩ အဝ့ၫၥံၪစံၭဝ့ၫ, ဆၧနၪအီၪလၧအလီၩ့လီၫ.",
			"31": "<sup>31</sup> ထီးနီၪလဖၧၫ့ အမိဒဲအထၧၫ့ဖုဝဲၥံၪဂဲၫထီၩ့ဝ့ၫနီၪဆၧၫ့ ထုၪ့လၧခီၫ့တၭ, အၪ့မၧၫ့အလ့ၩကိၭန့အဝ့ၫလီၫ.",
			"32": "<sup>32</sup> ၦခမျၧးဆၧၫ့နၩ့ဝၬဖီၩ့ဝ့ၫတၭ, အဝ့ၫၥံၪစံၭဝ့ၫဒၪ,ယိခွါ, နမိဒဲနထၧၫ့ဖုဝဲၥံၪအီၪလၧခီၫ့တၭ, အၪ့ဎၬနၧၩလီၫ.",
			"33": "<sup>33</sup> အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဝ့ၫတၭ,စံၭဝ့ၫဒၪ, ယမိမွဲဂ့ၩ,ယထၧၫ့",
			"34": "<sup>34</sup> ဖုဝဲလဖၪမွဲဂ့ၩ,မွဲပလၫလဖၪလဲၪ.- ယိဝၬဝၬၦဆၧၫ့နၩ့ ဝၬဖီၩ့ဝ့ၫလဖၪတၭ,စံၭဝ့ၫဒၪ, ယိခွါ,ယမိဒဲယထၧၫ့ဖု",
			"35": "<sup>35</sup> ဝဲလဖၪလီၫ.- အဂဲးဘဲၫယီၩထီးဒၪၦလၧအမၩဝ့ၫ ထီး ဒၪယွၩအၥၭလဂၩဂၩနီၪ, အဝ့ၫဒၪမွဲယထၧၫ့ဖုဝဲမုၪ, ဒဲယထၧၫ့ဖုဝဲခွၫ, ဒဲယမိလီၫ."
		},
		"4": {
			"1": "<sup>1</sup> အဝ့ၫဒၪၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဒီၭဝ့ၫလၧကွံၩနဲၩ့တၭ, ၦ ခမျၧးဖၭဒိၪအီၪကီၪ့ လၧအအီၪထီးအထၪ့ဝ့ၫ လၧချံၫ ဖၧၩ့ဘဲၫၥိၭအမိဆၧၫ့နၩ့လၧကွံၩဖၧၩ့တၭ, ၦခမျၧးအီၪ",
			"2": "<sup>2</sup> ဝ့ၫလၧကွံၩနဲၩ့လၧခီၫ့ထီးအလူၬလီၫ.- အဝ့ၫဒၪၥီၪ့ထဲၩ့ ၥၫ့ထဲၩ့အဝ့ၫၥံၪ လၧဆၧအၪမံၩ့ လၧဆၧချဲၩ့အဒီၩ့ တၭ,လီၩဘၪဝ့ၫလၧဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့လီၫ.",
			"3": "<sup>3</sup> ခိၭနၪဘီၪ,ယိခွါ, ၦလၧအဎွံၪဆၧလဂၩလ့ၩဎွံၪဆၧ",
			"4": "<sup>4</sup> လီၫ.- လၧအဎွံၪဆၧနီၪလနၩ့နၩ့ လၩ့ဘၪဝ့ၫလၧဖၧၩ့ ၥၭအနဲၩ့ထံၭတၭ, ထိၪၥံၪလံၪၥံၪဂဲၫအၪ့ခွံၬဝ့ၫလီၫ.",
			"5": "<sup>5</sup> အဂူၫဂၩလနၩ့နၩ့လၩ့ဘၪဝ့ၫလၧလိးကျၩထီးဂၪ့ခိၪ အီၪလအၪဘၪ, မွဲဂၪ့ခိၪလယိၬဘၪနီၪ မဲၪထၪ့ဝ့ၫချဲၫ့မၬ",
			"6": "<sup>6</sup> လီၫ.- ထီးမုမ့ၬထၪ့ဘၪခိဎီၩဝ့ၫတၭ, အဝံလအီၪဘၪ",
			"7": "<sup>7</sup> နီၪဎဲၫ့ထၪ့ခွံၬဝ့ၫလီၫ.- အဂူၫဂၩလနၩ့နၩ့လၩ့ဘၪ ဝ့ၫလၧဆၧဆူၪဆၧမဲၪအကျၩတၭ, ဆၧဆူၪဆၧမဲၪ",
			"8": "<sup>8</sup> မဲၪထၪ့ဝ့ၫတၭ,ခဲၪဘံၭခွံၬဝ့ၫနီၪၥၪထၪ့ဝ့ၫအ့ၬ.- အဂူၫ ဂၩလနၩ့နၩ့လၩ့ဘၪဝ့ၫလၧဂၪ့ခိၪဂ့ၩတၭ, မဲၪထၪ့ဝ့ၫ နီၪ,အၪထၪ့ဝ့ၫလနၩ့နၩ့ အၪနဲၪ့ထဲၩ့ အလးၥၧၫ့ဆံၫ,",
			"9": "<sup>9</sup> လနၩ့နၩ့ဎူၫဆံၫ,လနၩ့နၩ့လယၩလီၫ.- အဝ့ၫဒၪစံၭဝ့ၫ, ၦအီၪလၧအနါ လၧအနါဂၧၫ့ဆၧနီၪ မွဲအနါဂၧၫ့ဒၪဝ့ၫ ဆံၭ.",
			"10": "<sup>10</sup> ဆၧမၩအၥၭထီးအအီၪဝ့ၫလဂၩဎးနီၪ, ၦအီၪဝၬ ဖီၩ့ဝ့ၫဒဲ ၦလဆံၫနံၫဂၩ အၪ့စၪ့ဝ့ၫ လၧဆၧချဲၩ့အဒီၩ့ အဂဲးလီၫ.",
			"11": "<sup>11</sup> အဝ့ၫဒၪစံၭၦလဖၪနီၪ, ယွၩအဘၩ့အမုးအဆၧအီၪ ၥူၪနီၪဆၧဖ့ၪၥ့ၪယၫနၥံၪလီၫ. အ့ၪမွဲၦအီၪလၧခီၫ့ လဖၪနီၪ,ဆၧထီးအလူၬယီၩကဲၪထၪ့ဝ့ၫ အဒီၩ့အထ့ၬ",
			"12": "<sup>12</sup> လၧအမ့ၬယၫ,- ဘဲၫၥိၭအယိဆၧနီၪမိယိဆၧတၭ, ဒၪဘၪဆၧအ့ၬး နါဂၧၫ့ဆၧနီၪနါဂၧၫ့ဝ့ၫတၭ, နၪဝ့ၫၥ့ၪ အ့ၬ.ဘၪလဘၪမိကၠၪလီၩ့အၥၭတၭ, ဆၧမိမၩဖီၩ့ခွံၬ အဆၧဒဲၩဘၭလီၫ.",
			"13": "<sup>13</sup> အဝ့ၫဒၪစံၭၦလဖၪနီၪ, ဆၧချဲၩ့အဒီၩ့ယီၩမွဲနၥံၪ နၪလၥ့ၪဘၪဧၪ. အ့ၪမွဲဘဲၫနီၪတၭ, မွဲနၥံၪၥ့ၪဆၧချဲၩ့ အဒီၩ့ထီးအလူၬ မိၥ့ၪဘဲၫၥ့ၪလဲၪ.",
			"14": "<sup>14</sup> ၦလၧအဎွံၪဆၧနီၪ မွဲအဎွံၪဆၧအလူအထၫလီၫ.",
			"15": "<sup>15</sup> ၦအီၪလၧဖၧၩ့ၥၭအနဲၩ့ထံၭ ထီးဆၧအလူအထၫဘၪ ဆၧဎွံၪအၥၭလဖၪနီၪ,မွဲအယီၩ, ထီးအနါဂၧၫ့ဆၧ တၭ,မုၪခီၩလဲးဂဲၫမၩန့ထၪ့ခွံၬဆၧအလူအထၫလၧအ",
			"16": "<sup>16</sup> ဘၪဆၧဎွံၪအၥၭ လၧအဖၧၩ့ချဲၫ့မၬလီၫ.- ဘဲၫနီၪအၥိၭ, ၦလၧအဘၪဆၧဎွံၪအၥၭလၧလိးကျၩလဖၪနီၪ, မွဲအ ယီၩ,ထီးအနါဂၧၫ့ဆၧအလူအထၫတၭ, မၩန့ဝ့ၫလၧ",
			"17": "<sup>17</sup> အၥုၪ့ထိၬၥၭထိၬချဲၫ့မၬတၭ,- အဝံလအီၪဘၪလၧ အနၫ့ဆါဒၪဝ့ၫအဖၧၩ့တၭ,အီၪဝ့ၫလဆိလလးလီၫ. လၧခဲၫ့ထဲၩ့ဆၧၡၪ့ဆၧနၭမွဲဂ့ၩ, ဆၧမၩအၧၩ့မၩနၭ မွဲဂ့ၩ, ထီးအအီၪထၪ့ဝ့ၫလၧဆၧအလူအထၫအကၠီၩ့",
			"18": "<sup>18</sup> တၭအၥုၪ့အၥၭဂၭဂီၩ့ခွံၬဝ့ၫချဲၫ့မၬလီၫ.- ၦလၧအ ဘၪဆၧဎွံၪအၥၭလၧဆၧဆူၪဆၧမဲၪအကျၩလဖၪနီၪ,",
			"19": "<sup>19</sup> မွဲအယီၩ,ၦလၧအနါဂၧၫ့ဆၧအလူအထၫတၭ,- အၪ့ ယိၪဆၧဘၪဆဲၫ့လၧအယီၩလကၠၪတၭ, ဆၧအၪ့ လံၬအၪ့လီၫဘၪဆဲၫ့ လၧအစူၪလးခၪ့ခိၪအၪနီၪ, ၥၭ ကွံၩဆၧလၧအဂူၫဂၩလဖၪဂဲၫနုၬဝ့ၫတၭ, ခဲၪဘံၭ",
			"20": "<sup>20</sup> ခွံၬဆၧအလူအထၫတၭ,ၥၪထၪ့ဝ့ၫအ့ၬ.- ၦလၧအ ဘၪဎွံၪအၥၭလၧဂၪ့ခိၪအဂ့ၩလဖၪနီၪ, မွဲအယီၩ,ၦလၧ အနါဂၧၫ့ဆၧအလူ, ဒဲဒိၭန့ဝ့ၫနီၪၥၪထၪ့ဝ့ၫလနၩ့နၩ့ ၥၧၫ့ဆံၫ,လနၩ့နၩ့ဎူၫဆံၫ, လနၩ့နၩ့လယၩလီၫ.",
			"21": "<sup>21</sup> အဝ့ၫဒၪစံၭၦလဖၪနီၪ, ၦဂဲၫဆိၬမ့ၪဒိၩ့တၭ, အီၪ က့ၪလၩ့လၧဒၩ့မွဲဂ့ၩ,ခၬမွဲဂ့ၩ, အဖၫ့လၬဆ့ဧၪ,ၦအီၪ",
			"22": "<sup>22</sup> က့ၪထၪ့ဝ့ၫလၧမ့ၪဒိၩ့အလးမွဲအ့ၬဧၪ.- အဂဲးဘဲၫယီၩ ဆၧအီၪလၧဆၧကဒုၩနီၪ, လမိဖျီၪထၪ့ဘၪဝ့ၫတၭ,အီၪ ဝ့ၫနးမံၩ့အ့ၬ. ဆၧလၧအအီၪၥူၪနီၪ, လဂဲၫအီၪဖျီၪ",
			"23": "<sup>23</sup> ထၪ့ဘၪဝ့ၫတၭ,အီၪဝ့ၫနးမံၩ့အ့ၬ.- ၦလဂၩဂၩအ့ၪ အီၪလၧအနါ လၧအနါဂၧၫ့ဆၧနီၪ, မွဲအနါဂၧၫ့ဒၪဝ့ၫ ဆံၭ.",
			"24": "<sup>24</sup> အဝ့ၫဒၪစံၭၦလဖၪနီၪ, နၥံၪနါဂၧၫ့ဆၧဘဲၫၥ့ၪလဲၪ ဘဲၫၥ့ၪလဲၪနီၪ, ထီးလၩ့နၥံၪအၥၭဆံၭ.နၥံၪမိဘၪ ဆၧတိၪ့န့နၥံၪဘဲၫနၥံၪတိၪ့န့ဆၧအၥိၭနီၪတၭး ဆၧ",
			"25": "<sup>25</sup> မိဖ့ၪလၫ့အၪထၪ့ဒံၭလၧနၥံၪအဂးဒံၭလီၫ.- အဂဲးဘဲၫ ယီၩထီးဒၪၦလၧအန့ဘၪဝ့ၫလဂၩဂၩနီၪ, ဆၧမိဖ့ၪလၫ့ အဝ့ၫနီၪလီၫ. ၦလၧအလန့ဘၪဆၧ ထီးဒၪအဆၧ အီၪဒၪလ့ၬနီၪ, ဆၧမိမၩန့ထဲၩ့ဝ့ၫလၧအအီၪလီၫ.",
			"26": "<sup>26</sup> အဝ့ၫဒၪစံၭဝ့ၫ, ယွၩအဘၩ့အမုးယီၩ, မၩအၥၭဘဲၫ",
			"27": "<sup>27</sup> ၦၡၩဎွံၪလၩ့ဆၧချံၫလၧဂၪ့ခိၪတၭ,- မံၫဝ့ၫတၭဂဲထုၪ့ ဝ့ၫလၧမုနၩဒဲလၧမုဆၫနီၪ, ဆၧချံၫမဲၪထၪ့ထီၫထၪ့ဝ့ၫ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, မွဲအဝ့ၫလၥ့ၪယၫဘၪလီၫ.",
			"28": "<sup>28</sup> အဂဲးဘဲၫယီၩဂၪ့ခိၪဒုၭမဲၪထၪ့ဒၪအဆၧ, လၧအဆိၫ မွဲအထံၭ, လၧခဲၫ့ထဲၩ့အၥၪဆဲၩ, လၧခဲၫ့ထဲၩ့တၭ,",
			"29": "<sup>29</sup> အၥၪဆၭဎွ့ၩထၪ့လၧအဆဲၩအလီၩ့လီၫ.- ထီးအၥၪ အီၪတၭ, ဆၧကူၭဝ့ၫလၧထၭဂ့ၬချဲၫ့မၬလီၫ. အဂဲး ဘဲၫယီၩကူၭဆၧအထီဘၪ ယူၭဝ့ၫယူၭ.",
			"30": "<sup>30</sup> အဝ့ၫဒၪစံၭဝ့ၫ, မွဲပမိမၩဎီၩ့ယွၩအဘၩ့အမုးလၧဆၧ နီၪလမံၩ့လဲၪး မွဲပမိဒီၩ့လၩ့ဝ့ၫလၧဆၧနီၪလမံၩ့လဲၪ.",
			"31": "<sup>31</sup> မၩအၥၭဘဲၫဘၪအချံၫ လၧအဘၪဎွံၪလၩ့ဝ့ၫလၧ ဂၪ့ခိၪအဖၧၩ့, အထီနီၪဆံၭနဲၪ့ဆၧဂူၫဆၧဂၩအချံၫလၧ",
			"32": "<sup>32</sup> ဂၪ့ခိၪချိၫ့ဒံၭလီၫ.- ထီးအဘၪဆၧဎွံၪလၩ့ဝ့ၫဂီၩ့နီၪ, မဲၪထၪ့ဝ့ၫတၭ, ဒိၪထၪ့ဒိၪနဲၪ့နၪ့ၥံၪမံၩ့ၥံၪထီးအလူၬ တၭ,ထိၪၥံၪလံၪၥံၪလၧမူၭဖိၭဖၫ့လဖၪနီၪ, အီၪဝ့ၫလၧ အလၩၡုၪၥ့ၪလီၫ.",
			"33": "<sup>33</sup> ဘဲၫနီၪအၥိၭ, အဝ့ၫဒၪချဲၩ့ဒီၩ့လၩ့ဆၧအၪမံၩ့တၭ, လီၩလၩ့လၬလၩ့ဆၧအလူအထၫဘဲၫ ၦခိၭနၪဝ့ၫၥ့ၪ",
			"34": "<sup>34</sup> အၥိၭနီၪလီၫ.-အ့ၪလမွဲဘၪဆၧချဲၩ့အဒီၩ့တၭ, လီၩ ဘၪဆၧလၧအဝ့ၫၥံၪအ့ၬ. ထီးအအီၪလၧဆၧကဒုၩအ လးတၭ,လီၩဖျီၪထၪ့အထံၩအဖျဲၥံၪ လၧအခီၫပယီၫ ထီးအလူၬလီၫ.",
			"35": "<sup>35</sup> လၧမုနံၩနီၪ ထီးမုဂၪလၩ့တၭ,အဝ့ၫဒၪစံၭၦလဖၪ",
			"36": "<sup>36</sup> နီၪ, မွဲပခၫ့ဂၬၡီၩ့လၧဝါလခီၫ့ဆံၭ.- ထီးအကွဲၪဖျါခွံၬ ၦခမျၧးဂီၩ့တၭ, အဝ့ၫၥံၪမၩန့အဝ့ၫ ဘဲၫနီၪၥိၭလၧချံၫ ဖၧၩ့တၭ,ချံၫလၧအဂူၫဂၩလဖၪ လ့ၩလၧအၥိၭဆ့",
			"37": "<sup>37</sup> လီၫ.- လံၩလဖုၬဖၭဒိၪဘၪဝ့ၪတၭ, လပီၩထၪ့နုၬ",
			"38": "<sup>38</sup> လၧချံၫဖၧၩ့ထီးအဎွ့ၩချံၫလီၫ.- အဝ့ၫဒၪလဂၩမံၫဝ့ၫ လၧခိၪခုၪ့ ခိၪနီၪအီၪဝ့ၫလၧ ချံၫခဲၫ့တၭ, အဝ့ၫၥံၪထိၪဂဲ ထုၪ့ဝ့ၫဒၪတၭ,စံၭဝ့ၫ,ဆရၫဧ့ ပမိဂၭဂီၩ့ဖီၩၬ မွဲနအီၪ",
			"39": "<sup>39</sup> က့ၪလၧဆၧနးမံၩ့အ့ၬဧၪ.- အဝ့ၫဒၪဂဲထုၪ့ဝ့ၫတၭ, အၪ့လၬလံၩတၭ, စံၭကွံၩနီၪ,အီၪလၩ့မါပံၭတၭ, အီၪ ဂုးဖုးဆံၭ, လံၩထုၬဝ့ၫတၭ, ထံၫအီၪဂုးဖုးမၬလီၫ.",
			"40": "<sup>40</sup> အဝ့ၫဒၪစံၭၦလဖၪနီၪ, မွဲဘၪနီၫနၥံၪၥၭမဲၪဆၧနီၪ",
			"41": "<sup>41</sup> လဲၪ,နၥံၪအဆၧနဲၩလအီၪဘၪနီၪမွဲဘၪလဲၪ.-အဝ့ၫ ၥံၪၥၭမဲၪၥၭဖျဲၩ့ဆၧဖၭဒိၪတၭ, စံၭလိၬအၥံၪအၥၭ, အဝ့ၫယီၩမွဲၦလဂၩလဲၪၬ လံၩဒဲကွံၩဒၪလ့ၬခိၭနၪ မၬအလူကၨ."
		},
		"5": {
			"1": "<sup>1</sup> အဝ့ၫၥံၪလ့ၩထီၩ့ဝ့ၫလၧကွံၩဝါလခီၫ လၧၦဂၧဂစံၫ့",
			"2": "<sup>2</sup> ဖိၪအခးလီၫ.- ထီးအစဲၪ့ထၪ့ခွံၬဝ့ၫလၧချံၫဖၧၩ့တၭ, ၦလၧဆၧနၪအီၪ လၧအလီၩ့လဂၩ ဂဲၫထၪ့ချဲၫ့မၬလၧ",
			"3": "<sup>3</sup> လီၫ့ဖၧၩ့အၪ့ဂၬအဝ့ၫဒၪလီၫ.- အဝ့ၫနီၪမွဲအအီၪဝ့ၫလၧ လီၫ့ဖၧၩ့တၭ, ၦစၧၩ့ထၬဝ့ၫ လၧၥွ့ၫထၭဒၪလ့ၬၥ့ၪနး",
			"4": "<sup>4</sup> ဂၩအ့ၬ.- ၦဖျၪ့ထၬယူၭဝ့ၫအခၪ့လၧၥံၫ့ဖၧၩ့, ဒဲစၧၩ့ထၬ ယူၭဝ့ၫ လၧၥွ့ၫထၭ အၪဘျၩ့တၭ, မွဲအထုၭထ့ၬၥွ့ၫ တၭ,ဘိၭခါအၥံၫ့နီၪတၭ, ၦမၩနဲၩဝ့ၫၥ့ၪနးဂၩအ့ၬ.",
			"5": "<sup>5</sup> မွဲအကိၭၡၭထၪ့ဆၧလၧလီၫ့ဖၧၩ့, ဒဲလၧခိၪလီၩ့အလီၩ့ ကိၭမုနံၩမုနၩဒ့ၭတၭ, ဂ့ၬနုၬလၩ့အၥၭလၧလိးလီၫ.",
			"6": "<sup>6</sup> ဒၪစိၩယ့ၫၡုၬလၧအယဲၩ့တၭ, လ့ၩစဲၪ့တလဲးဝ့ၫလၧ",
			"7": "<sup>7</sup> အအီၪနီၪထွံၩလၩ့အၥၭတၭ,- ကိၭၡၭထၪ့ဆၧလၧ အလူဖၭဒိၪ, စံၭဝ့ၫဒၪ, ဆၧထီၫထုၬယွၩအဖိၪခွၫယ့ၫ ၡုၬဧ့,နၧၩဒဲယၧၩယီၩ, မွဲပဘၪဆဲၫ့လိၬပၥၭလၧဆၧ နီၪလမံၩ့လဲၪ. ယဒုၭဆိၪလၩ့နၥၭလၧယွၩအမ့ၬယၫ",
			"8": "<sup>8</sup> ဘဲၫၥိၭနထီးမၩၡၪ့မၩနၭယၧၩလဂ့ၩ.- အဂဲးဘဲၫယီၩ မွဲအစံၭယူၭအဝ့ၫ, ဆၧနၪဧ့, စဲၪ့ထၪ့ခွံၬလၧၦလဂၩ",
			"9": "<sup>9</sup> နီၪအလီၩ့ဆံၭ.- အဝ့ၫဒၪအၪ့စၪ့ဝ့ၫ,နမံၩ့မွဲဘဲၫၥ့ၪလဲၪ. အဝ့ၫဒၪလီၩဘၪဝ့ၫ, ယမံၩ့မွဲလံဇၧၫ့လီၫ. အဂဲးဘဲၫ",
			"10": "<sup>10</sup> ယီၩပမွဲအၪဒုၩလီၫ.- အဝ့ၫအၪ့ကံၩ့အၪ့ယၫ ဆၧဆီၪ့ ဆီၪ့လ့ၬ ဘဲၫၥိၭအထီးနၫ့ထၪ့ခွံၬဝ့ၫ လၧခးဖၧၩ့နီၪလ",
			"11": "<sup>11</sup> ဂ့ၩလီၫ.- ထိၭအဒီၪ့ဖၭဒိၪလဒီၪ့အၪ့ဆၧလၧခိၪလီၩ့",
			"12": "<sup>12</sup> အလီၩ့တၭ,- ဆၧနၪထီးအလူၬအၪ့ယၫဝ့ၫ, စံၭဝ့ၫဒၪ, အၪ့မၧၫ့ပလ့ၩလၧထိၭလဖၪအအီၪ ဘဲၫၥိၭပမိနုၬလၧ",
			"13": "<sup>13</sup> အဖၧၩ့ဆံၭ.- ယ့ၫၡုၬဒုၭလ့ၩအဝ့ၫၥံၪချဲၫ့မၬလီၫ. ဆၧနၪလဖၪစဲၪ့ထၪ့ခွံၬတၭ, လ့ၩနုၬဝ့ၫလၧထိၭအဖၧၩ့ တၭ,ထိၭလဒီၪ့နီၪစဲၪ့ဖုၫလၩ့ဝ့ၫ လၧၡၭမ့ၬထုးဖၭထီၫ လၧကွံၩဖၧၩ့ အီၪဝ့ၫဖိၭဘိၭနံၫထီၫ့တၭ, လၩ့အုၭၥံၫ",
			"14": "<sup>14</sup> ခွံၬဝ့ၫလၧကွံၩဖၧၩ့လီၫ.- ၦယူၬဝ့ၫလဖၪထဲၩ့စဲၪ့တၭ, လီၩဘၪဆၧလၧဒိၩ့ဖၧၩ့, ဒဲလၧခီၫ့ဆ့လီၫ. ဆၧမၩအ ၥၭဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, ၦလဖၪဂဲၫယိဝ့ၫလီၫ.",
			"15": "<sup>15</sup> အဝ့ၫၥံၪဂဲၫထီၩ့ လၧယ့ၫၡုၬအအီၪတၭ, ဒၪဘၪၦ လၧဆၧနၪလံဇၧၫ့ အီၪယူၭဝ့ၫ လၧအလီၩ့လဂၩနီၪ ဆၧၫ့နၩ့ဝ့ၫတၭ, ကီၩ့ဆၧၥိၭဆၧဒဲအၥၭ လၩ့ထံးလၩ့ ဆ့ၭအီၪထၪ့ထဲၩ့တၭး အဝ့ၫၥံၪ ၥၭမဲၪၥၭဖျဲၩ့ဝ့ၫဒၪ",
			"16": "<sup>16</sup> လီၫ.- ဆၧမၩအၥၭဘၪဆဲၫ့လၧၦလၧဆၧနၪအီၪလၧ အလီၩ့, ဒဲထိၭလဖၪအဂဲးအကၠီၪ့နီၪ,ၦလၧအဒၪဘၪ",
			"17": "<sup>17</sup> ဝ့ၫလဖၪ လီၩဘၪအဝ့ၫၥံၪလီၫ.- အဝ့ၫၥံၪအၪ့ကံၩ့အၪ့ ယၫဝ့ၫ, ဘဲၫၥိၭအမိစဲၪ့ထၪ့ခွံၬဝ့ၫလၧအဝ့ၫၥံၪအ",
			"18": "<sup>18</sup> ထံၫအခးလီၫ.- ထီးအလ့ၩနုၬလၧချံၫဖၧၩ့တၭ,ၦလၧ ဆၧနၪအီၪယူၭဝ့ၫ လၧအလီၩ့လဂၩနီၪ, အၪ့ကံၩ့အၪ့",
			"19": "<sup>19</sup> ယၫအဝ့ၫဘဲၫအမိအီၪလၧအၥိၭလီၫ.- အဝ့ၫဒၪလဖ့ၪ လၫ့ဘၪတၭ, လီၩဘၪဝ့ၫ,ထဲၩ့လၧနဂံၪ့တၭ, ထီးဒၪ ကဆါမၩနၧၩ, ဒဲယၫ့ၥၭနၧၩနီၪလီၩဘၪနဘူၭနထံး",
			"20": "<sup>20</sup> ဆံၭ.- အဝ့ၫနီၪထဲၩ့ဝ့ၫတၭ,ထီးဒၪယ့ၫၡုၬမၩဝ့ၫဆံၭ ဒိၪလဲၪနီၪတၭ, မွဲအလီၩဘၪဝ့ၫ လၧဒကၭပိၫလံၭအ ဖၧၩ့တၭ,ၦထီးအလူၬထီၫမံၫထီၫမၪဝ့ၫလီၫ.",
			"21": "<sup>21</sup> ထီးယ့ၫၡုၬခၫ့စိၩထဲၩ့ဒီၭ လၧချံၫထီၩ့လၧဝါလခီၫ တၭ,ၦခမျၧးဖၭဒိၪ ဂဲၫအီၪကိၩ့အီၪကီၪ့ လၧအအီၪ",
			"22": "<sup>22</sup> တၭ,အီၪဝ့ၫလၧကွံၩနဲၩ့နီၪလီၫ.- ယိခွါ,ၦၥရိၬခိၪ အမံၩ့စယၫအရၧၭလဂၩဂဲၫဒၪဘၪဝ့ၫတၭ, ထွံၩလၩ့",
			"23": "<sup>23</sup> ဝ့ၫလၧအခၪ့ထံၭ.- အၪ့ကံၩ့အၪ့ယၫဝ့ၫဆီၪ့ဆီၪ့လ့ၬ တၭ,စံၭဝ့ၫဒၪ, ယဖိၪမုၪလၧအဆံၭလဂၩမိၥံၫဖီၩၬဘဲၫ ၥိၭအမိဘျၪထဲၩ့ဒဲမၧၫ့ဝ့ၫနီၪ, ဂဲၫအီၪက့ၪလါနစူၪလၧ",
			"24": "<sup>24</sup> အလီၩ့ဆံၭ.- အဝ့ၫဒၪလ့ၩလၧအၥိၭတၭ,ၦခမျၧးဖၭ ဒိၪလ့ၩဖိၬအခဲၫ့နီၪကထံၬကထူၬဝ့ၫလီၫ.",
			"25": "<sup>25</sup> ၦမုၪလဂၩလၧအဆၫ အၥွံၪလၩ့ယူၭလဆံၫနံၫ",
			"26": "<sup>26</sup> နံၪ့တၭ,- ဘၪဆၧနၭနၭလ့ၬလၧၥံၪ ဎၥံၪ့ဎွံၭ ဆရၫအၪ ဂၩအစူၪဖၧၩ့တၭ, လူၬအစူၪလးအခၪ့ခိၪထီးအလူၬ တၭ,လဘျၪဘၪနီၪလကၭလၧၩ့, နၭထၪ့ကဒၩလ",
			"27": "<sup>27</sup> ခီၫတၭ,- ထီးအနါဂၧၫ့လၧယ့ၫၡုၬအဂဲးနီၪ ဂဲၫလၧၦ ခမျၧးအကျၩလၧအချိၫ့တၭ, ထိၭဘၪအကီၩ့အၥိၭ",
			"28": "<sup>28</sup> လီၫ.- အဂဲးဘဲၫယီၩစံၭဝ့ၫဒၪ, ယအ့ၪထိၭဘၪန့ၫအ",
			"29": "<sup>29</sup> ကီၩ့အၥိၭတၭ,ယမိဘျၪထဲၩ့ယဝ့ၫလီၫ.- အၥွံၪလၩ့ နီၪထုၬဝ့ၫချဲၫ့မၬတၭ, အနၫ့ဆါၥ့ၪယၫလၧအဆၧဆၫ",
			"30": "<sup>30</sup> နီၪဘျၪထဲၩ့ဝ့ၫလီၫ.- ယ့ၫၡုၬၥ့ၪယၫဒၪဝ့ၫချဲၫ့မၬလၧအ စီၩ့အမၩ့စဲၪ့ထၪ့လၧအလီၩ့တၭ, ကၠၪစိၩအၥၭလၧ ၦခမျၧးအအီၪနီၪ, စံၭဝ့ၫဒၪ,မွဲပလၫထိၭဘၪယကီၩ့ယ",
			"31": "<sup>31</sup> ၥိၭလဂၩလဲၪ.- အထံၩအဖျဲၥံၪ စံၭဆၧၫ့ဝ့ၫ,နဒၪဘၪ ၦခမျၧးဘၪထံၭနၧၩတၭ, နစံၭ,မွဲပလၫထိၭဘၪယၧၩ",
			"32": "<sup>32</sup> လဂၩလဲၪနီၪဆ့ဧၪ.- ဘဲၫၥိၭအမိဒၪဘၪၦလၧအမၩ",
			"33": "<sup>33</sup> ဆၧနီၪ ယိဆၧဝၬဝၬလီၫ.- ၦမုၪနီၪၥ့ၪယၫဝ့ၫလၧဆၧ မၩအၥၭ လၧအလီၩ့တၭ, ၥၭမဲၪ ဆၧဝၭထိၬဝ့ၫတၭ, လ့ၩစိၩလၧအအီၪ, ထွံၩလၩ့ဝ့ၫတၭ, လီၩဘၪဝ့ၫလၧ",
			"34": "<sup>34</sup> ဆၧအမွဲအတီၩထီးအလူၬလီၫ.- အဝ့ၫဒၪစံၭ, ဖိၪမုၪဧ့, နနဲၩဆၧနီၪမၩဘျၪထဲၩ့ယူၭနၧၩယူၭ, ထဲၩ့မုၬမုၬတၭ, အီၪဘျၪထဲၩ့လၧနဆၧဆၫဆံၭ.",
			"35": "<sup>35</sup> အဝ့ၫဒၪချဲၩ့ဆၧနီၪအဘိၩ့ဘၭ, ၦဂဲၫလၧၦၥရိၬခိၪ လဂၩအဂံၪ့တၭ, စံၭဝ့ၫဒၪနဖိၪမုၪၥံၫယူၭ, မွဲဘၪနီၫ",
			"36": "<sup>36</sup> လၧနမၩထံၬထၬဒံၭဆရၫလဲၪ.- ယ့ၫၡုၬနါဂၧၫ့အ လူလၧၦလီၩဘၪဝ့ၫနီၪ,စံၭၦၥရိၬခိၪလဂၩချဲၫ့မၬ,ထီး",
			"37": "<sup>37</sup> ၥၭမဲၪလဂ့ၩနဲၩကဒၪဘီၪ.- အ့ၪလမွဲဘၪစပံတၧၫ, ဒဲစယ့မံၭ,ဒဲစယ့မံၭအထၧၫ့ဖုဝဲစယီဟၫ့ၥံၪ,ဒုၭဖိၬ",
			"38": "<sup>38</sup> ဝ့ၫအခဲၫ့နးဂၩအ့ၬ.- အဝ့ၫၥံၪလ့ၩထီၩ့လၧၦၥရိၬခိၪအ ဂံၪ့တၭ,ဒၪဘၪဆၧထုၪ့ထိၭပူၭပူၭ, ဒဲၦဂၪ့ဆၧယၧၩ့",
			"39": "<sup>39</sup> ဆၧၥီၫအၪအၪလ့ၬတၭ,- လ့ၩနုၬဝ့ၫတၭ,အဝ့ၫဒၪစံၭ အဝ့ၫၥံၪ, မွဲဘၪနီၫလၧနၥံၪထုၪ့ထိၭပူၭပူၭတၭ, နၥံၪ ဂၪ့ဆၧဘဲၫယီၩလဲၪ, ဖိၪၥၪမုၪယီၩၥံၫအ့ၬး မံၫဒၪအ",
			"40": "<sup>40</sup> ဆၧလီၫ.- အဝ့ၫၥံၪနီၪနံဘၪဒုၪဒွ့ၪအဝ့ၫလီၫ.အဝ့ၫဒၪ ဒုၭစဲၪ့ထၪ့ခွံၬၦထီးအလူၬတၭ,ကိၭထဲၩ့ဖိၪၥၪအမိ,ဒဲ အဖါ,ဒဲၦအီၪဝ့ၫလၧအၥိၭလဖၪတၭ, လ့ၩနုၬဝ့ၫထီး",
			"41": "<sup>41</sup> ၦဖိၪၥၪမုၪအီၪဝ့ၫအလးလီၫ.- ဖီၪ့ဝ့ၫအစူၪတၭ,စံၭဝ့ၫ ဒၪ,တၫလၥကုမံၫ, ဘဲၫပစံၭဆၧအၥိၭ,ၦဖိၪၥၪမုၪဧ့,",
			"42": "<sup>42</sup> ယစံၭနၧၩ,ဂဲထုၪ့ဆံၭ.- ၦဖိၪၥၪမုၪဂဲထုၪ့စဲၪ့ဝ့ၫချဲၫ့ မၬလီၫ.အဂဲးဘဲၫယီၩအနံၪ့အီၪယူၭဝ့ၫ လဆံၫနံၫနံၪ့",
			"43": "<sup>43</sup> လီၫ.အဝ့ၫၥံၪထီၫမံၫထီၫမၪဝ့ၫဒိၪမၬလီၫ.- အဝ့ၫဒၪ မၪလူၬအဝ့ၫၥံၪလၩ့ထံးလၩ့ဆ့ၭ ဘဲၫၥိၭၦၡၩထီး ၥ့ၪယၫလၧဆၧမၩအၥၭနီၪနးဂၩလဂ့ၩ, ဒဲအၪ့မၧၫ့ၦဖ့ၪ လၫ့အအၪ့ဆၧလီၫ."
		},
		"6": {
			"1": "<sup>1</sup> တၭအဝ့ၫဒၪစဲၪ့ထၪ့ခွံၬထီးနီၪ, လ့ၩဝ့ၫထီၩ့လၧအ",
			"2": "<sup>2</sup> ခးဒၪဝ့ၫတၭ,အထံၩအဖျဲၥံၪဖိၬအခဲၫ့လီၫ.- ထီးဘၪမး ၥံၫအနံၩနီၪ အဝ့ၫဒၪၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဆိၫဆၧလၧၥရိၬ ဖၧၩ့လီၫ.ၦနါဂၧၫ့ဆၧအၪဂၩ, ထီၫမံၫထီၫမၪတၭ, စံၭ ဝ့ၫဒၪ,အဝ့ၫလဂၩယီၩ, မွဲအန့ဘၪဆၧလဖၪယီၩခီၫ ခီၫလဲၪ.ဆၧကိၪ့ၥ့ၪကိၪ့ဘၪလၧဆၧဖ့ၪလၫ့ဝ့ၫနီၪ, မွဲ ဆၧနီၪလဲၪ. ဆၧလၩ့လၭလၧအမၩအၥၭ လၧအစူၪ",
			"3": "<sup>3</sup> ဖၧၩ့ယီၩမွဲအဆံၭဒိၪလဲၪ.- ၦယီၩမွဲၦလဲၬၥမါ,နးမၫ ရံၫအဖိၪခွၫမွဲအ့ၬဧၪ. အထၧၫ့ဖုဝဲခွၫမွဲစယ့မံၭ,ဒဲစ ယိစ့ၭ,ဒဲစယုဒၭ,ဒဲစစဲမၧၫ့မွဲအ့ၬဧၪ. အထၧၫ့ဖုဝဲမုၪ လဖၪအီၪလၧပၥိၭထီးယီၩမွဲအ့ၬဧၪ. တၭအဝ့ၫၥံၪအ",
			"4": "<sup>4</sup> ၥၭဂၭဂီၩ့လၧအကၠီၩ့လီၫ.- ယ့ၫၡုၬစံၭၦလဖၪနီၪ, မီၪ နီၪ,အ့ၪလမွဲဘၪလၧအထံၫအခးဒၪဝ့ၫ, ဒဲလၧအဘူၭ အထံးအကျၩ, ဒဲလၧအဂံၪ့ဖၧၩ့ဒၪဝ့ၫနီၪ,အလၩအဖၩ့",
			"5": "<sup>5</sup> အီၪဝ့ၫလီၫ.- အ့ၪလမွဲဘၪလၧအအီၪက့ၪလၩ့အစူၪ လၧၦဘၪဆၧစူၭဆၧဆၫၡၩခိၬဂၩ အလီၩ့တၭ, မၩ ဘျၪထဲၩ့ဝ့ၫနီၪ, အဝ့ၫဒၪမၩလၩ့လၭဆၧထီးနီၪၥ့ၪနး",
			"6": "<sup>6</sup> မံၩ့အ့ၬ.- အဝ့ၫဒၪထီၫမံၫထီၫမၪဝ့ၫလၧၦလနဲၩဘၪ အကၠီၩ့လီၫ. တၭမွဲအစဲၪ့ဝံၩ့ဝၩ့ ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဆၧ လၧတဝၫ့လဖၪအဖၧၩ့လီၫ.",
			"7": "<sup>7</sup> အဝ့ၫဒၪကိၭန့ၦလဆံၫနံၫဂၩတၭ, အၪ့မၧၫ့အလ့ၩ ဆၧနံၫဂၩလစီၪ့, နံၫဂၩလစီၪ့လီၫ. ဖ့ၪလၫ့ဝ့ၫလၧဆၧ",
			"8": "<sup>8</sup> အစီၩ့အမၩ့လၧဆၧနၪအဖၫ့ခိၪလီၫ.- မၪလူၬဝ့ၫဘဲၫ ယီၩ,လၧနိၪထိၭလဘီၩ့အမ့ၬယၫနီၪး ထိၪ့မွဲဂ့ၩ,ကိၪ မွဲဂ့ၩ,ထီးလၧခၧၩ့ယးအဖၧၩ့မွဲဂ့ၩ, ဆိၬဆၧလၧနၥံၪ",
			"9": "<sup>9</sup> လ့ၩလၧဖၧၩ့ၥၭအဂးနီၪနးမံၩ့လဂ့ၩ.- မၪလူၬဝ့ၫဘဲၫ",
			"10": "<sup>10</sup> ၥိၭအမိၥိၭခၪ့ဖံၭတၭ, ထီးၥိၭဆဲၫ့နံၫဘံၪ့လဂ့ၩ.- အ ဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, ထီးဒၪဂံၪ့ လၧနၥံၪ, လ့ၩနုၬလဖျိၪ့ ဖျိၪ့တၭ,အီၪထီးနီၪထီးနၥံၪစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧအလး",
			"11": "<sup>11</sup> နီၪဆံၭ.- ထီးဒၪအလးလၧအလထိးဆၧၫ့ဘၪနၥံၪတၭ, လခိၭနၪဘၪနၥံၪအလူလဖၪနီၪ, ထီးနၥံၪစဲၪ့ထၪ့ခွံၬဝ့ၫ ထီးနီၪတၭ, ဘဲၫၥိၭအမိကဲၪဆၧထိးအၥၭလၧအဂဲး တၭ,တရူၩလၩ့ခွံၬဂၪ့ခိၪမုၬလၧနၥံၪအခၪ့ယၫၥၭ ဆံၭ.ဎယစံၭနၥံၪတီၩတီၩယီၩ, ဆၧလၧဒိၩ့နီၪ, မိဘၪ ဆၧနၭနဲၪ့စီဒၧၫ့, ဒဲဂမီရၫလၧဆၧစ့ၩရၫ့အမုနံၩနီၪလီၫ.ၭ",
			"12": "<sup>12</sup> အဝ့ၫၥံၪစဲၪ့ထၪ့ဝ့ၫတၭ, လီၩလၩ့လၬလၩ့ဝ့ၫလၧၦ",
			"13": "<sup>13</sup> ဘၪနီၫ့ယါလၩ့ထဲၩ့အၥၭလီၫ.- အဝ့ၫၥံၪနၫ့ထၪ့ခွံၬ ဆၧနၪအၪဒုၩတၭ, ဂုၪၦအစူၭအဆၫလၧၥိၪအၪ ဂၩတၭ,မၩဘျၪထဲၩ့အဝ့ၫၥံၪလီၫ.",
			"14": "<sup>14</sup> စဎွၩဟ့ရၧၭနါဂၧၫ့ဆၧ, အဂဲးဘဲၫယီၩအမံၩ့ဂၧၫ့ ထၪ့ၥၩလၩ့ဝ့ၫတၭ, စံၭဝ့ၫလၧၦဘၭတံၫဇၫ့ဆၧ စယီ ဟၫ့ဂဲထုၪ့ထဲၩ့လၧဆၧၥံၫအဖၧၩ့လီၫ. မၩအၥၭဘဲၫနီၪ",
			"15": "<sup>15</sup> တၭ,ဆၧလၩ့လၭမၩအၥၭလၧအဖၧၩ့လီၫ.-ၦဂူၫဂၩ စံၭဝ့ၫ,လၧအမွဲစအံၫလဲယၫလီၫ. ၦဂူၫဂၩစံၭဒံၭဝ့ၫ, လၧအမွဲမီၪ, အ့ၪလမွဲဘၪမွဲဘဲၫမီၪလဂၩဂၩအၥိၭနီၪ",
			"16": "<sup>16</sup> လီၫ.- အ့ၪမွဲထီးစဟ့ရၧၭနါဂၧၫ့နီၪ,စံၭဝ့ၫ,အယီၩမွဲစ ယီဟၫ့လၧယဖ့ၬခွံၬယူၭအခိၬတၭ, ဂဲထုၪ့ထဲၩ့ဝ့ၫလၧ",
			"17": "<sup>17</sup> ဆၧၥံၫအဖၧၩ့ယူၭလီၫ.- အဂဲးဘဲၫယီၩမွဲလၧအထၧၫ့ ဖုဝဲစဖံလံၭအမၫနးဟရိဒအၭ လၧအအီၪဎုၬလိၬအ ၥၭလၧအဝ့ၫနီၪအကၠီၩ့တၭ, စဟ့ရၧၭအၪ့မၧၫ့ၦလ့ၩ ဖီၪ့ထၬစယီဟၫ့တၭ, စၧၩ့ထၬဝ့ၫလၧထီၫ့ဖၧၩ့လီၫ.",
			"18": "<sup>18</sup> အဂဲးဘဲၫယီၩစယီဟၫ့စံၭစဟ့ရၧၭ, မွဲနအီၪဎုၬလၧန",
			"19": "<sup>19</sup> ထၧၫ့ဖုဝဲအမၫနီၪတီၩအ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, နးဟရိဒအၭၥၭထၪ့စယီဟၫ့တၭ, မိမၩၥံၫဘၪအၥၭ",
			"20": "<sup>20</sup> နီၪမၩဝ့ၫၥ့ၪအ့ၬ.- အဂဲးဘဲၫယီၩစဟ့ရၧၭၥ့ၪယၫဝ့ၫ လၧစယီဟၫ့မွဲၦအတီၩအလီၩ့, ဒဲၦအဆံၫ့အဎံၪနီၪ, ၥၭမဲၪဝ့ၫတၭ,ယိထံၫယိဆၭဝ့ၫ, ထီးအနါဂၧၫ့အလူ နီၪမၩဝ့ၫအၪမံၩ့တၭ, နါဂၧၫ့ဝ့ၫအလူၡုၪၡုၪ မုၬမုၬလီၫ.",
			"21": "<sup>21</sup> ထီးဘၪအမုနံၩအထီဂ့ၩ, စဟ့ရၧၭအီၪဖျဲၪဝ့ၫအ နံၩဆၧၫ့ထဲၩ့အလးတၭ, မၩဘိၪ့ဆၧလုအၪ့လုအီၩအ ၦဒိၪၦၡါ, ဒဲၦၥုၭဖိၪလထီၫ့အခိၪလဖၪဒဲၦကဲၪဝ့ၫလၧ",
			"22": "<sup>22</sup> အခိၪလၧဂၫလလံၫၥံၪတၭ,- နးဟရိဒအၭအဖိၪမုၪလ ဂၩဂဲၫနုၬဝ့ၫနီၪ, ဂဲထုၪ့လံတၭ, ဘၪစဟ့ရၧၭအၥၭ ဒဲၦဆၧၫ့နၩ့ဒံၩ့ခံၫ့ လၧစပွဲထံၭလၧအၥိၭလဖၪနီၪအ ၥၭလီၫ.စဎွၩစံၭဖိၪၥၪမုၪနီၪ, ထီးဒၪနမိအၪ့ကံၩ့ဘၪန",
			"23": "<sup>23</sup> ၥၭလၧဆၧလမံၩ့မံၩ့တၭ,ယမိဖ့ၪလၫ့နၧၩလီၫ.- ဆိၪ လၩ့အၥၭလၧအဝ့ၫဒၪတၭ, စံၭဝ့ၫ, ထီးဒၪနအၪ့ကံၩ့ ဆၧလမံၩ့မံၩ့လၧယၧၩတၭ, ယမိဖ့ၪလၫ့နၧၩ လၧယ",
			"24": "<sup>24</sup> ဘၩ့ယမုးယီၩထီးအဖိၭဖၫ့လီၫ.- ၦဖိၪၥၪမုၪနီၪစဲၪ့ထၪ့ ဝ့ၫတၭ,အၪ့စၪ့အမိ, မွဲယမိဘၪအၪ့ကံၩ့ဆၧနီၪလမံၩ့ လဲၪ.အဝ့ၫဒၪလီၩဘၪဝ့ၫ, ၦဘၭတံၫဇၫ့ဆၧစယီဟၫ့အ",
			"25": "<sup>25</sup> ခိၪဎွံၪလီၫ.- အဝ့ၫဒၪထဲၩ့ဝ့ၫ ချဲၫ့ချဲၫ့လ့ၬ လၧစဎွၩအ အီၪတၭ,အၪ့ကံၩ့ဆၧစံၭဝ့ၫ, ယၥၭအီၪလၧနမိဖ့ၪလၫ့ ယၧၩၦဘၭတံၫဇၫ့ဆၧ စယီဟၫ့အခိၪဎွံၪလၧတဲၪလဲၪ",
			"26": "<sup>26</sup> အဖၧၩ့ချဲၫ့ချံၭလီၫ.- စဎွၩအၥုၪ့အုၭအၥၭအုၭ ဒိၪမၬ လါနၫ့တၭ, မွဲလၧအဆၧဆိၪလၩ့အၥၭ, ဒဲလၧၦဆၧၫ့ နၩ့ဒံၩ့ခံၫ့လၧအၥိၭလဖၪအကၠီၩ့တၭ, ဆၧမိဂဲးလိၬ",
			"27": "<sup>27</sup> ဘၪအၥၭလၧအဝ့ၫနီၪအ့ၬ.- စဎွၩအၪ့မၧၫ့ၦခိၭဆၧလ ဂၩချဲၫ့မၬတၭ, မၪလူၬဝ့ၫလၧအဘၪဂဲၫထဲၩ့ဆိၬန့အ ခိၪဎွံၪလီၫ.အဝ့ၫဒၪလ့ၩဖ့ၬထ့ၬအခိၪလၧထီၫ့ဖၧၩ့.",
			"28": "<sup>28</sup> တၭဂဲၫထဲၩ့ဆိၬဝ့ၫ အခိၪဎွံၪလၧတဲၪလဲၪအဖၧၩ့တၭ, ဖ့ၪလၫ့ဖိၪၥၪမုၪ, ဒဲဖိၪၥၪမုၪနီၪဖ့ၪလၫ့ဝ့ၫလၧအမိလီၫ.",
			"29": "<sup>29</sup> အထံၩအဖျဲၥံၪနါဂၧၫ့တၭ, ဂဲၫမၩန့ထဲၩ့ဝ့ၫအစွၪ တၭ,ထဲၩ့ခုၪ့လၩ့ဘၧၩ့ဝ့ၫလၧ ဆၧၥွၪခိၪအဖၧၩ့လီၫ.",
			"30": "<sup>30</sup> ၦဆၧအၪ့မၧၫ့ဖိၪလဖၪ ဂဲၫအီၪကီၪ့လၧယ့ၫၡုၬအ အီၪတၭ, ထီးဒၪအမၩဆၧလဖၪမွဲဂ့ၩ,ထီးဒၪအၥီၪ့ ထဲၩ့ၥၫ့ထဲၩ့ဆၧလဖၪမွဲဂ့ၩ, လီၩဘၪဝ့ၫထီးအလူၬ",
			"31": "<sup>31</sup> လီၫ.- အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, ဂဲၫနၥံၪဝ့ၫလၧဆၧကဒုၩ အလးလၧမံၩ့လၬကျၩတၭ,အီၪပွံၭနးဆိဖိၪဘီၪ. အဂဲး ဘဲၫယီၩ မွဲၦဂဲၫဂဲၫထဲၩ့ထဲၩ့အၪဂၩတၭ, ထီးအဝ့ၫၥံၪ",
			"32": "<sup>32</sup> အၪ့ဆၧလချႃၭဘၪလီၫ.- အဝ့ၫၥံၪလ့ၩလၧချံၫဖၧၩ့",
			"33": "<sup>33</sup> ထီၩ့လၧမံၩ့လၬကျၩလၧဆၧကဒုၩအလးလီၫ.- ၦလ ဖၪနီၪဒၪဘၪဝ့ၫလၧအစဲၪ့ထၪ့တၭ, ၦအၪဂၩၥ့ၪယၫဝ့ၫ တၭ,စဲၪ့ထၪ့ဝ့ၫလၧကယဲအဒိၩ့ထီးအလူၬတၭ, လ့ၩ စဲၪ့ဝဲၩဝ့ၫလၧအခၪ့ထီးနီၪ, လ့ၩထီၩ့ဆိၫဝ့ၫတၭ, အီၪ",
			"34": "<sup>34</sup> ကိၩ့အီၪကီၪ့ဝ့ၫလၧအအီၪလီၫ.- ယ့ၫၡုၬစဲၪ့ထၪ့ဝ့ၫနီၪ, ဒၪဘၪၦခမျၧးဖၭဒိၪတၭ,အၥၭအီၪဝ့ၫလီၫ.အဂဲးဘဲၫ ယီၩမွဲအမၩအၥၭဘဲၫၥိၪလဖၪ လၧဆၧလအီၪယူၬ ဘၪဝ့ၫအၥိၭနီၪ, တၭအဝ့ၫဒၪၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ ဆိၫဝ့ၫ အၪမံၩ့လီၫ.",
			"35": "<sup>35</sup> ဘိၩ့နဲၪ့ယီၩ,တဘျႃၭနၩရံၩဖီၩ့ခွံၬတၭ, အထံၩ အဖျဲၥံၪလ့ၩ လၧအအီၪစံၭဝ့ၫဒၪ, ဆၧအလးထီးယီၩ မွဲမံၩ့လၬကျၩတၭ, ဘိၩ့နဲၪ့ယီၩဖီၩ့ခွံၬ တဘျႃၭနၩရံၩ",
			"36": "<sup>36</sup> ယူၭ.- ဘဲၫၥိၭအဝ့ၫၥံၪမိလ့ၩဎွ့ၩအၪ့ဆၧလၧအနၫ့ဆါ ဒၪဝ့ၫအဂးလၧတဝၫ့လဖၪ အီၪဝၬဖီၩ့ပၧၩအဖၧၩ့တၭ, ကွဲၪဖျါအဝ့ၫၥံၪဆံၭ. အဂဲးဘဲၫယီၩအဆၧအၪ့ဆၧအီၩ",
			"37": "<sup>37</sup> အီၪနးမံၩ့အ့ၬ.- အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအ ဝ့ၫၥံၪ,ဖ့ၪဒုၭအၪ့နၥံၪဝ့ၫဆံၭ. အဝ့ၫၥံၪ စံၭဆၧၫ့ဝ့ၫ, မွဲပမိဘၪလ့ၩဎွ့ၩဆၧအၪ့ လၧစ့ၩဒန့ရံၫနံၫယၩတၭ,",
			"38": "<sup>38</sup> ဖ့ၪဒုၭအၪ့ဝ့ၫဆ့ဧၪ.- အဝ့ၫဒၪစံၭဒီၭဝ့ၫ, နၥံၪအကိၪ အီၪဎွ့လီၪ့လဲၪ, ထဲၩ့ယိခွါဆံၭ. ထီးအဝ့ၫၥံၪၥ့ၪယၫဝ့ၫ",
			"39": "<sup>39</sup> တၭ,စံၭဝ့ၫ, ယဲလီၪ့,ဒဲယၪနံၫဘံၪ့ဆ့လီၫ.- တၭအဝ့ၫ ဒၪစံၭအဝ့ၫၥံၪ, အၪ့မၧၫ့ၦထီးအလူၬဆၧၫ့နၩ့ဒံၩ့ခံၫ့",
			"40": "<sup>40</sup> လၧနၪ့ၥံၫ့ဆ့ၬအဖၫ့ခိၪလဂဲးလဂဲးဘီၪ.- အဝ့ၫၥံၪဆၧၫ့ နၩ့ဒံၩ့ခံၫ့ဝ့ၫ လဂဲးလဂဲးနီၪ လဂဲးဂဲးလယၩ, လဂဲးဂဲး",
			"41": "<sup>41</sup> ယဲဆံၫလီၫ.- ထီးအမၩန့စိၩကိၪယဲလီၪ့, ဒဲယၪနံၫဘံၪ့ တၭ, ယိထၪ့ဆၧလၧမူၭခိၪတၭ, ဆိၪဂ့ၩဆၧတၭ, ကံၪ့ဘျ့ၭကိၪနီၪ, ဖ့ၪလၫ့အထံၩအဖျဲၥံၪဘဲၫၥိၭ အမိအီၪ က့ၪလၩ့ဝ့ၫလၧအဝ့ၫၥံၪအမ့ၬယၫလီၫ. ယၪနံၫဘံၪ့နီၪ,",
			"42": "<sup>42</sup> မွဲအအၪ့နၩ့ဖၭဝ့ၫလၧၦထီးအလူၬအဂးလီၫ.- ၦထီး",
			"43": "<sup>43</sup> အလူၬအၪ့ဝ့ၫတၭ,ဘျဲၩအၪ့ဝ့ၫလီၫ.- ကိၪဒဲယၪနီၪ မွဲအအၪ့ထုၫ့ထဲၩ့ဝ့ၫအဘျဲၪအဆဲဎွ့ၩဒၩ့ လဆံၫနံၫဖျိၪ့",
			"44": "<sup>44</sup> လီၫ.- ၦခွၫလၧအအၪ့ဆၧလဖၪနီၪ,အီၪဝ့ၫဖိၭဘိၭယဲ ထီၫ့လီၫ.",
			"45": "<sup>45</sup> အဝ့ၫဒၪအၪ့မၧၫ့အထံၩအဖျဲၥံၪ လ့ၩနုၬလၧချံၫ ဖၧၩ့ချဲၫ့မၬတၭ, ခၫ့စိၩဝ့ၫလၧဝါလခီၫ လၧဘ့ၫၥစ့ဒၫ",
			"46": "<sup>46</sup> နီၪ,ဘိၩ့အကွဲၪဖျါခွံၬၦခမျၧးလီၫ.- ကွဲၪဖျါဝ့ၫဂီၩ့တၭ, လ့ၩထၪ့ဘၩဆိၪဖၪဆၧလၧခိၪလီၩ့လဖျိၪ့အလီၩ့လီၫ.",
			"47": "<sup>47</sup> ထီးမုဂၪလၩ့တၭ, ချံၫနီၪအီၪလၧကွံၩအၥၭကျၩတၭ,",
			"48": "<sup>48</sup> အဝ့ၫနီၪအီၪဝ့ၫလၧခီၫ့လဂၩဎးလီၫ.- ဒၪဘၪအဝ့ၫၥံၪ ကၧးတငၨၭဆီၪ့နီၪ, ဆၧပွံၭအၥၭလီၫ. အဂဲးဘဲၫ ယီၩမွဲလံၩဘၪလၧအဂးအ့ၬ. လၧၦခိၭဆၧမုနၩလံဆၫ့ လဆၫ့နီၪအဝ့ၫဒၪလ့ၩလၧအဝ့ၫၥံၪအအီၪတၭ, စဲၪ့ဝ့ၫ လၧကွံၩဖၧၩ့လၧ ထံၫဖံၭခိၪနီၪ, မၩအၥၭဘဲၫအမိလ့ၩ",
			"49": "<sup>49</sup> ဖီၩ့ခွံၬဝ့ၫအၥိၭလီၫ.- ထီးအဝ့ၫၥံၪဒၪဘၪအလ့ၩ လၧကွံၩဖၧၩ့လၧထံၫဖံၭခိၪနီၪ, ဆီၫ့မီၪ့ဝ့ၫလၧအမွဲၦစၪ",
			"50": "<sup>50</sup> တၭ,ကိၭၡၭထၪ့ဝ့ၫလီၫ.- အဂဲးဘဲၫယီၩၦထီးအလူၬ နီၪဒၪဘၪဝ့ၫတၭ, ဝၭထိၬဝၭတ့ၭဒိၪမၬလီၫ. အဝ့ၫဒၪ ချဲၩ့ထၪ့ဝ့ၫချဲၫ့မၬတၭ, စံၭဝ့ၫ, မွဲနၥံၪအၥၭဎွံၫထၪ့",
			"51": "<sup>51</sup> ဘီၪ.မွဲယၧၩတၭထီးၥၭမဲၪလဂ့ၩ.- လ့ၩနုၬဝ့ၫလၧ ချံၫဖၧၩ့တၭ, လံၩပထုၬဝ့ၫဒၪလီၫ. ဆၧလၩ့လၭလၧ အဝ့ၫၥံၪအမ့ၬဖၭဒိၪတၭ, ထီၫမံၫထီၫမၪဝ့ၫဒၪလီၫ.",
			"52": "<sup>52</sup> အဂဲးဘဲၫယီၩအဝ့ၫၥံၪအၥၭနီၩ့တၭ, လဆီၫ့မီၪ့ ဘၪကိၪလဖၪ အဂဲးအကၠီၪ့လီၫ.",
			"53": "<sup>53</sup> ထီးအခၫ့ဂၬဝ့ၫထီၩ့လၧခးဂန့ၭဇရ့ၭတၭ, စိၭ",
			"54": "<sup>54</sup> ထၪ့ဝ့ၫထီးနီၪလီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬလၧချံၫဖၧၩ့ တၭ,ၦၡၩဒၪဘၪၥ့ၪယၫဝ့ၫချဲၫ့မၬ လၧအမွဲယ့ၫၡုၬ",
			"55": "<sup>55</sup> တၭ.- လ့ၩစဲၪ့တလဲးဝံၩ့ဝၩ့ လၧခးထၧၫ့ခးယၫတၭ, ဂဲၫထဲၩ့ဆိၬၦလၧအဆၫအီၪဝ့ၫ လၧအလးမံၫခိၪလဖၪ",
			"56": "<sup>56</sup> ထီးဒၪအနါဂၧၫ့လၧအအီၪဝ့ၫအလးလီၫ.- ထီးဒၪအ လ့ၩနုၬလၧဒိၩ့ဖၧၩ့မွဲဂ့ၩ, တဝၫ့ဖၧၩ့မွဲဂ့ၩ, မံၩ့လၬကျၩ မွဲဂ့ၩ,ၦအီၪက့ၪလၩ့ၦအစူၭ အဆၫလဖၪလၧဖၧၩ့ၥၭ တၭ,အၪ့ကံၩ့အၪ့ယၫဝ့ၫ ဘဲၫၥိၭအဝ့ၫၥံၪမိထိၭဘၪ ဝ့ၫန့ၫအကီၩ့အၥိၭအနွံၫလီၫ. ထီးဒၪၦလၧအထိၭ ဘၪဝ့ၫလဖၪနီၪ ဘျၪထဲၩ့ဝ့ၫဒၪလီၫ."
		},
		"7": {
			"1": "<sup>1</sup> ၦဖၫရစံၫၥံၪ, ဒဲၦကွ့ၭလံၬလနၩ့နၩ့လၧအဂဲၫဝ့ၫလၧ",
			"2": "<sup>2</sup> ယရုစလံၫ့နီၪ,အီၪကိၩ့အီၪကီၪ့လၧအအီၪတၭ,- ထီး အဒၪဘၪအထံၩအဖျဲလနၩ့နၩ့ အၪ့ကိၪလၧအစူၪလ ဆံၫ့ဘၪ, ဘဲၫၦစံၭဆၧအၥိၭ,အစူၪလၧအလၥူၫဝၭခွံၬ",
			"3": "<sup>3</sup> ဘၪဝ့ၫနီၪ,မွဲအအီၪက့ၪဆၧမၪလၧအလီၩ့လီၫ.- အဂဲး ဘဲၫယီၩၦဖၫရစံၫၥံၪးဒဲၦယုဒၫဖိၪထီးအလူၬနီၪ, မွဲအ ထီးန့ၦမွံၩၦၡါလီၩဆိၩလၬဆိၩဆၧတၭ, အ့ၪလၥူၫ",
			"4": "<sup>4</sup> ဝၭခွံၬဘၪအစူၪဂ့ၩဘၪစဲၪနီၪ, အၪ့ဆၧအ့ၬ.- အဝ့ၫၥံၪ ဂဲၫထဲၩ့လၧဖၠၫဖၧၩ့နီၪ, အ့ၪလဘၧၩ့လၩ့ဘၪ အၥၭ တၭ,အၪ့ဘၪဆၧအ့ၬ. လၧနီၪအမ့ၬယၫ, အဆၧဂူၫ ဂၩလၧအထီးန့ဝ့ၫအီၪအၪမံၩ့ဘဲၫယီၩ, မွဲအဘၧၩ့လၩ့",
			"5": "<sup>5</sup> လိၫ့ၥံၪ, ဒဲဖၧၩ့ၥံၪ,ဒဲလိၫ့ထီးဘၩ့ဒဲခၬၥံၪလီၫ.- ထီးနီၪ လဖၧၫ့ၦဖၫရစံၫ, ဒဲၦကွ့ၭလံၬၥံၪအၪ့စၪ့အဝ့ၫ, နထံၩ နဖျဲလဖၪနီၪ,မွဲဘၪနီၫလၧအလလ့ၩဘၪဝ့ၫ ဘဲၫၦမွံၩ ၦၡါလီၩဆိၩလၬဆိၩဆၧအၥိၭတၭ, အစူၪလၥူၫဝၭခွံၬ",
			"6": "<sup>6</sup> ဘၪဝ့ၫတၭ,အၪ့ဆၧမၬကၨ.- အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ,မီၪ စအဲၫစ့ယၫစံၭဝ့ၫလၧမီၪအချိၬ လၧၦအၪ့လီၫဆၧလၧ နၥံၪဝ့ၫလဖၪအဂဲးနီၪ ဂ့ၩမၬလီၫ. ဆၧကွ့ၭအၥၭဘဲၫ ယီၩ, ၦလဆၨၩယီၩယူၭယၪ့ယၧၩလၧအနိၭဖျံၩ, အ့ၪမွဲအၥၭနီၪယဲၩ့မၬဝ့ၫလၧယၧၩလီၫ.",
			"7": "<sup>7</sup> အဝ့ၫၥံၪၥီၪ့လိၪဆၧလၧၦၡၩအဆၧမၪလူၬ, လၧဆၧၥီၪ့ဆၧၥၫ့အလးတၭ, ဘိၪ့ထၪ့ဘၩထၪ့ပျီၩပျီၩယၧၩလီၫ.",
			"8": "<sup>8</sup> အဂဲးဘဲၫယီၩနၥံၪခွံၬၡိၭခွံၬယွၩ အဆၧမၪလူၬနီၪ, နၥံၪထီးန့ၦၡၩ လီၩဆိၩလၬဆိၩဆၧတၭ, နၥံၪဘၧၩ့ လၩ့ဖၧၩ့ၥံၪ, လိၫ့ၥံၪ, ဒဲဆၧဂူၫဆၧဂၩဘဲၫနီၪအၥိၭ",
			"9": "<sup>9</sup> နၥံၪမၩအၪမံၩ့လီၫ.- အဝ့ၫဒၪစံၭၦလဖၪနီၪ,မွဲတၡါ နၥံၪခွံၬၡိၭခွံၬ ယွၩအဆၧမၪလူၬဘဲၫၥိၭ နၥံၪမိထီးန့",
			"10": "<sup>10</sup> နၥံၪလီၩဆိၩလၬဆိၩဆၧလီၫ.- အဂဲးဘဲၫယီၩစမိစ့ၭ စံၭဝ့ၫဒၪ, ယူၭ ယၪ့ န မိ န ဖါ ဆံၭ. အ မိ မွဲ ဂ့ၩ, အ ဖါ မွဲ ဂ့ၩ, ၦ လၧ အ စံၭ အၧၩ့ ဝ့ၫ နီၪ, မွဲ အ",
			"11": "<sup>11</sup> ၥံၫ ဒၪ ဝ့ၫ ဆံၭ.- အ့ၪမွဲနၥံၪဝ့ၫဒၪယီၩနၥံၪစံၭ, ၦအ့ၪ စံၭအမိမွဲဂ့ၩ, အဖါမွဲဂ့ၩ, ထီးဒၪဆၧလၧနဂ့ၩန့ဘၪ လၧယၧၩနီၪ, မွဲအကဲၪကီၫဘၪ့ (ဘဲၫၦစံၭဆၧအၥိၭ",
			"12": "<sup>12</sup> ဆၧဘိၪ့ဆၧထးဆံၭ.)- နၥံၪဒုၭမၩဆၧၩ့လၧၩ့အမိမွဲ",
			"13": "<sup>13</sup> ဂ့ၩ,အဖါမွဲဂ့ၩ,နးမံၩ့အ့ၬ.- အနီၪတၭ, နၥံၪမၩဂၭဂီၩ့ ယွၩအလူအထၫလၧနၥံၪအဆၧလီၩဆိၩလၬဆိၩလၧ နၥံၪလီၩထဲၩ့တၭ, ဆၧဂူၫဆၧဂၩဘဲၫနီၪအၥိၭ နၥံၪမၩ အၪမံၩ့လီၫ.",
			"14": "<sup>14</sup> အဝ့ၫဒၪကိၭန့ ၦခမျၧးထီးအလူၬလၧအအီၪတၭ, စံၭအဝ့ၫၥံၪ, ခိၭနၪယလူတၭ,နၪၥ့ၪနၥံၪဝ့ၫကိၭဂၩဒ့ၭ",
			"15": "<sup>15</sup> ဆံၭ.- ဆၧအီၪလၧခီၫ့တၭ,လ့ၩနုၬဝ့ၫလၧၦၡၩအဖၧၩ့ နီၪ,မၩစံၪစၪဝ့ၫၥ့ၪနးမံၩ့အ့ၬ. အ့ၪမွဲဆၧလၧအဂဲၫထၪ့",
			"16": "<sup>16</sup> လၧအဖၧၩ့နီၪ,မၩစံၪစၪၦၡၩလီၫ.- ၦအ့ၪအီၪလၧအနါ လၧအနါဂၧၫ့ဆၧလဂၩဂၩနီၪ မွဲအနါဂၧၫ့ဒၪဝ့ၫဆံၭ.",
			"17": "<sup>17</sup> ထီးအစဲၪ့ထၪ့ခွံၬဝ့ၫလၧၦခမျၧး အအီၪလ့ၩနုၬဝ့ၫ လၧဂံၪ့ဖၧၩ့နီၪ, အထံၩအဖျဲၥံၪအၪ့စၪ့အဝ့ၫ လၧဆၧ",
			"18": "<sup>18</sup> ချဲၩ့ဒီၩ့လၩ့အဂဲးလီၫ.- အဝ့ၫဒၪစံၭၦလဖၪနီၪ,ဆၧန့ၫ နီၪမွဲနၥံၪနၪလၥ့ၪဒံၭဘၪဧၪ. လၧကယဲဆၧအီၪလၧခီၫ့ တၭ,လ့ၩနုၬဝ့ၫလၧၦၡၩအဖၧၩ့, မၩစံၪစၪဝ့ၫလၥ့ၪ",
			"19": "<sup>19</sup> ဘၪနီၪ,မွဲနၥံၪလၥ့ၪယၫဘၪဧၪ.- အဂဲးဘဲၫယီၩ,မွဲအ လ့ၩနုၬဝ့ၫလၧအၥၭခံဖၧၩ့အ့ၬ. မွဲလၧအဂူၭဖိၫ့ဖၧၩ့ တၭ,လၩ့ခွံၬဝ့ၫလၧဆၧလ့ၩဂၭလိၫအလးနီၪ, မၩဆံၫ့",
			"20": "<sup>20</sup> ထၪ့ကယဲဆၧအၪ့ဆၧအီၩထီးအလူၬလီၫ.- အဝ့ၫဒၪ စံၭဝ့ၫ, ဆၧလၧအဂဲၫထၪ့လၧၦၡၩအဖၧၩ့နီၪ, မွဲအမၩ",
			"21": "<sup>21</sup> စံၪစၪၦၡၩလီၫ.- အဂဲးဘဲၫယီၩဆၧကိၪ့ဆၧဖၭ လၧ အအၧၩ့, ဆၧအဲၪဘိၩ့အဲၪဖၬ,ဆၧမၩမၪမုၪမၩမၪခွၫ,",
			"22": "<sup>22</sup> ဆၧမၩၥံၫၦၡၩ,- ဒဲဆၧအၪ့ဂူၪဆၧ, ဆၧလီၫ့ကီၩ့ၥၭ ကွံၩဆၧ,ဆၧအၧၩ့ဆၧၥၫ့ဆၧအၪ့လံၬအၪ့လီၫ, ဆၧ လၨၪဖၬ,ဆၧအမ့ၬအၧၩ့, ဆၧဒုၪဒွ့ၪ, ဆၧအီၪက့ၪထၪ့ ထီၫအၥၭ,ဆၧကိၪ့လၥ့ၪဘၪလဖၪနီၪ, ဂဲၫထၪ့ဝ့ၫလၧ",
			"23": "<sup>23</sup> ၦၡၩအၥၭခံဖၧၩ့လီၫ.- ကယဲဆၧအအၧၩ့လဖၪထီး အလူၬယီၩ, ဂဲၫထၪ့လၧအၥၭခံဖၧၩ့တၭ, မၩစံၪစၪ ၦၡၩလီၫ.",
			"24": "<sup>24</sup> အဝ့ၫဒၪဂဲထုၪ့ထီးနီၪတၭ, လ့ၩထီၩ့ဝ့ၫလၧတဲအၫ, ဒဲစဲဒၧၫ့အနဲၩ့ထံၭတၭ, လ့ၩနုၬဝ့ၫလၧဂံၪ့လဖျိၪ့အဖၧၩ့ နီၪ,အၥၭအီၪလၧၦၡၩ ထီးၥ့ၪယၫနးဂၩလဂ့ၩလါနၫ့",
			"25": "<sup>25</sup> တၭ,အီၪၥူၪဝ့ၫၥ့ၪအ့ၬ.- အဂဲးဘဲၫယီၩ ၦမုၪလၧ ဆၧနၪအီၪလၧအဖိၪမုၪအလီၩ့လဂၩနီၪ, နါဂၧၫ့ဆၧ လၧယ့ၫၡုၬအဂဲး, လ့ၩထီၩ့လၧအအီၪနီၪ, ထွံၩလၩ့ဝ့ၫ",
			"26": "<sup>26</sup> လၧအခၪ့ထံၭတၭ,- ၦမုၪနီၪမွဲၦဂြံစၭအဆၨၩ,ခးစဲရိၫ ဖနံၡၫဖိၪလီၫ. အၪ့ကံၩ့ အၪ့ယၫဝ့ၫဘဲၫၥိၭအမိနၫ့ထၪ့",
			"27": "<sup>27</sup> ခွံၬဆၧနၪလၧအဖိၪမုၪအလီၩ့လီၫ.- ယ့ၫၡုၬစံၭအဝ့ၫ ဒၪ,မွဲဖိၪၥၪလဖၪအၪ့ဘျဲၩအၪ့ဆိၫဒၪခလူၬဆံၭ. အဂဲး ဘဲၫယီၩ,ဖိၪၥၪအဆၧအၪ့နီၪ, ဂ့ၩဖ့ၪလၫ့ခွံၬဝ့ၫလၧ",
			"28": "<sup>28</sup> ထွံၪအ့ၬ.- ၦမုၪချဲၩ့ထၪ့စံၭဝ့ၫဒၪ, မွဲယူၭ, ကဆါဧ့, မွဲလါနၫ့ဘိၩ,ဆၧလၧထွံၪၥံၪအီၪလၧစပွဲအဖၫ့လၬနီၪ",
			"29": "<sup>29</sup> အၪ့ဖိၪၥၪအဆၧအီၪဘျဲၪအီၪဆဲလီၫ.- အဝ့ၫဒၪစံၭဆၧၫ့ ဝ့ၫ,မွဲလၧနဆၧချဲၩ့လထံၪနီၪ အကၠီၩ့တၭ, ထဲၩ့ဆံၭ. ဆၧနၪစဲၪ့ထၪ့ခွံၬယူၭ လၧနဖိၪမုၪအလီၩ့ယူၭလီၫ.",
			"30": "<sup>30</sup> မွဲအထဲၩ့ဝ့ၫလၧအဂံၪ့တၭ, ဒၪဘၪဝ့ၫလၧဆၧနၪစဲၪ့ထၪ့ ခွံၬယူၭတၭ, အဖိၪမုၪမံၫနၩ့ လၧအလးမံၫခိၪလီၫ.",
			"31": "<sup>31</sup> မၩဒီၭလဖၧၫ့ အဝ့ၫဒၪစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧတဲအၫ, ဒဲစဲဒၧၫ့အနဲၩ့တၭ, လ့ၩဝ့ၫထီၩ့လၧကွံၩဂၫလလံၫလၧ",
			"32": "<sup>32</sup> ဒကၭပိၫလံၭအခးအၥၭကျၩလီၫ.- ၦဂဲၫဆိၬၦလၧအ နါအၧၩ့, ဒဲချဲၩ့လၥ့ၪဘၪလဂၩလၧအအီၪတၭ, အၪ့ ကံၩ့အၪ့ယၫဝ့ၫဘဲၫၥိၭအမိအီၪက့ၪထၪ့အစူၪ လၧအ",
			"33": "<sup>33</sup> လီၩ့လီၫ.- အဝ့ၫဒၪကိၭန့အဝ့ၫနီၪလၧဆၧကဒုၩအလး တၭ,အီၩ့နုၬအစူၪနိၩ့လၧအနါဖၧၩ့တၭ, ထိၪဖျံၭဝ့ၫ",
			"34": "<sup>34</sup> တၭ,ထိၭဘၪအဖျ့ၩလီၫ.- ယိထၪ့ဆၧလၧမူၭခိၪ, ဂၪ့အုၩဂၪ့ထိၬဝ့ၫတၭ, စံၭဝ့ၫ, အ့ၭဖၥၫ, ဘဲၫၦစံၭ",
			"35": "<sup>35</sup> ဆၧအၥိၭ,ဝဲထၪ့ဆံၭ.- အနါဖိးထၪ့ချဲၫ့မၬတၭ, ဖျ့ၩအထီၪ့လၩ့ပၠၪထဲၩ့ဝ့ၫတၭ, ချဲၩ့ထၪ့ဆၧဂ့ၩဘၪစဲၪ",
			"36": "<sup>36</sup> လီၫ.- အဝ့ၫဒၪမၪလူၬအဝ့ၫၥံၪ ဘဲၫၥိၭအထီးလီၩဘၪ ၦနးဂၩလဂ့ၩလီၫ. မွဲလါနၫ့, ဒံၩ့မၪလူၬဝ့ၫနီၪ,အဝ့ၫၥံၪ",
			"37": "<sup>37</sup> ဒံၩ့လီၩဘၪ အၪနဲၪ့အလးဒံၭး- ဒဲထီၫမံၫထီၫမၪဒိၪဒိၪ လ့ၬတၭ,စံၭဝ့ၫ ကယဲအမၩဆၧ ကိၭအမံၩ့ဒ့ၭလဖၪ နီၪ,မၩဝ့ၫဂ့ၩဘၪစဲၪမၬကၨ. ၦလၧအနါအၧၩ့လဖၪနီၪ, မွဲအမၩနါဂၧၫ့ထၪ့ဝ့ၫတၭ, ၦလၧအချဲၩ့လၥ့ၪဘၪလဖၪ နီၪ, မၩချဲၩ့ထၪ့ဝ့ၫလီၫ."
		},
		"8": {
			"1": "<sup>1</sup> လၧမုနံၩလဖၪနီၪၦခမျၧးအီၪအၪမၬတၭ, ဆၧအၪ့ ဆၧအီၩ လအီၪဘၪနးမံၩ့တၭ, ယ့ၫၡုၬကိၭန့ အထံၩအ",
			"2": "<sup>2</sup> ဖျဲၥံၪလၧအအီၪ,စံၭဝ့ၫဒၪ,- ယယၫ့ၥၭၦခမျၧးလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪအီၪယူၭဝ့ၫ လၧယၥိၭၥၧၫ့ၥၫ့",
			"3": "<sup>3</sup> တၭ,အဆၧအၪ့ဆၧအီၩအီၪနးမံၩ့အ့ၬ.- ဒုၪအၪ့ဒုၪ အီၩဆၧနီၪ,ယအ့ၪကွဲၪဖျါထဲၩ့အဝ့ၫၥံၪ လၧအဂံၪ့တၭ, မိလၩ့ဒိၩဝ့ၫလၧဖၧၩ့ၥၭလီၫ. အဂဲးဘဲၫယီၩလနၩ့နၩ့",
			"4": "<sup>4</sup> ဂဲၫဝ့ၫလၧအယဲၩ့လီၫ.- အထံၩအဖျဲၥံၪ ချဲၩ့ဆၧၫ့ဝ့ၫ, ဘဲၫၥိၭၦလဂၩဂၩမိဒုၭဘျဲၩအၪ့ ၦလဖၪနီၪလၧကိၪ တၭ,မွဲအမိဒၪန့ဝ့ၫ လၧမံၩ့လၬကျၩယီၩခီၫခီၫလဲၪ.",
			"5": "<sup>5</sup> အဝ့ၫဒၪအၪ့စၪ့ဝ့ၫ, နၥံၪအကိၪအီၪဎွ့လီၪ့လဲၪ.အဝ့ၫ",
			"6": "<sup>6</sup> ၥံၪစံၭဝ့ၫဒၪ,နွ့ၫလီၪ့လီၫ.- တၭအဝ့ၫဒၪအၪ့မၧၫ့ၦခမျၧး ဆၧၫ့နၩ့ဒံၩ့ခံၫ့လၧဂၪ့ခိၪတၭ, မၩန့စိၩကိၪနွ့ၫလီၪ့နီၪ, စံၭထၪ့အၪ့အူၭဆၧအခိးအတၩတၭ, ကံၪ့ဘျ့ၭဝ့ၫ, ဖ့ၪ လၫ့အထံၩအဖျဲၥံၪ ဘဲၫၥိၭအဝ့ၫၥံၪမိအီၪက့ၪလၩ့လၧ အမ့ၬယၫတၭ,အဝ့ၫၥံၪအီၪက့ၪလၩ့ဝ့ၫ လၧၦခမျၧးအ",
			"7": "<sup>7</sup> မ့ၬယၫလီၫ.- အဝ့ၫၥံၪအယၪဖိၪ အီၪၡၩခိၬဘံၪ့တၭ, အဝ့ၫဒၪဆိၪဂ့ၩဝ့ၫတၭ, အၪ့မၧၫ့ၦအီၪက့ၪလၩ့ဝ့ၫလၧ",
			"8": "<sup>8</sup> အဝ့ၫၥံၪအမ့ၬယၫဆ့လီၫ.- အဝ့ၫၥံၪအၪ့ဝ့ၫတၭ,ဘျဲၩ အၪ့ဝ့ၫဂီၩ့နီၪ, ပအၪ့ထုၫ့ကီၪ့ထဲၩ့ဝ့ၫအဘျဲၪအဆဲနီၪ",
			"9": "<sup>9</sup> ဎွ့ၩဒၩ့နွ့ၫဖျိၪ့လီၫ.- ၦအၪ့ဆၧလဖၪနီၪ အီၪဖိၭဘိၭလံ ထီၫ့လီၫ.တၭမွဲအကွဲၪဖျါခွံၬၦလဖၪနီၪလီၫ.",
			"10": "<sup>10</sup> အဝ့ၫဒၪလ့ၩနုၬဝ့ၫလၧချံၫဖၧၩ့ လၧအထံၩအဖျဲၥံၪအ ၥိၭချဲၫ့မၬတၭ, လ့ၩဝ့ၫထီၩ့လၧခးဒၫလမနုၥၫလီၫ.",
			"11": "<sup>11</sup> ၦဖၫရစံၫၥံၪစဲၪ့ထၪ့လ့ၩဝ့ၫလၧအအီၪတၭ, ကျဲၩ့ဖစီၩ့ အၪ့စၪ့ဝ့ၫတၭ, အၪ့ကံၩ့ဆၧလၩ့လၭလမံၩ့ လၧမူၭခိၪ",
			"12": "<sup>12</sup> လခီၫလီၫ.- အဝ့ၫဒၪဂၪ့အုၩဂၪ့ထိၬဝ့ၫလၧအၥၭခံဖၧၩ့ တၭ,စံၭဝ့ၫ, ၦလဆိၩယီၩ,မွဲဘၪနီၫလၧအအၪ့ကံၩ့ဆၧ လၩ့လၭလဲၪ, ယလီၩဘၪနၥံၪတီၩတီၩယီၩ,ဆၧဖ့ၪလၫ့",
			"13": "<sup>13</sup> ဆၧလၩ့လၭလၧၦလဆိၩယီၩနးမံၩ့အ့ၬ.- တၭအဝ့ၫ ဒၪစဲၪ့ထၪ့ခွံၬဝ့ၫလၧ အဝ့ၫၥံၪအအီၪနီၪ, လ့ၩနုၬဒီၭဝ့ၫ လၧချံၫဖၧၩ့တၭ, ခၫ့စိၩဝ့ၫလၧဝါလခီၫလီၫ.",
			"14": "<sup>14</sup> အထံၩအဖျဲလဖၪနီၪၥၭနၪ့လ့ၩဆိၬကိၪတၭ, အကိၪ",
			"15": "<sup>15</sup> အီၪလၧချံၫဖၧၩ့န့ၫလလီၪ့လီၫ.- အဝ့ၫဒၪမၪလူၬဆၧ နီၪ,စံၭဝ့ၫ, ထီးလၩ့နၥံၪအၥၭလၧၦဖၫရစံၫအမံၪ,ဒဲ",
			"16": "<sup>16</sup> စဟ့ရၧၭအမံၪတၭ,ထီးလၩ့နၥံၪအၥၭဆံၭ.- အဝ့ၫ ၥံၪကၩ့ကၩလိၬအၥၭတၭ, စံၭဝ့ၫ,ဆၧယီၩမွဲပကိၪလ",
			"17": "<sup>17</sup> အီၪဘၪအဂဲးလီၫ.- ထီးယ့ၫၡုၬၥ့ၪယၫတၭ, စံၭအဝ့ၫ ၥံၪ,မွဲဘၪနီၫလၧနၥံၪကၩ့ကၩလိၬ နၥံၪအၥၭလၧကိၪ လအီၪဘၪအဂဲးလဲၪ. မွဲနၥံၪလၥ့ၪယၫဘၪဧၪ, မွဲန",
			"18": "<sup>18</sup> ၥံၪနၪလၥ့ၪဒံၭဘၪဧၪ. မွဲနၥံၪအၥၭနီၩ့ဒံၭဧၪ.- နၥံၪ အမ့ၬၥၪအီၪတၭ, မွဲနၥံၪလဒၪဘၪဧၪ. နၥံၪအနါ",
			"19": "<sup>19</sup> အီၪတၭ,မွဲနၥံၪလနါဂၧၫ့ဘၪဧၪ.- နၥံၪနၪ့ထၪ့ထဲၩ့ အ့ၬဧၪ.လၧယကံၪ့ဘျ့ၭကိၪယဲလီၪ့ လၧၦယဲထီၫ့ အဂးနီၪ,မွဲနၥံၪအၪ့ထုၫ့ကီၪ့ထဲၩ့ အဘျဲၪအဆဲဎွ့ၩ ဒၩ့ဎွ့ဖျိၪ့လဲၪ. အဝ့ၫၥံၪစံၭဆၧၫ့ဝ့ၫ, လဆံၫနံၫဖျိၪ့လီၫ.",
			"20": "<sup>20</sup> လၧယကံၪ့ဘျ့ၭနွ့ၫလီၪ့ လၧၦလံထီၫ့အဂးနီၪ, မွဲန ၥံၪအၪ့ထုၫ့ကီၪ့ထဲၩ့ အဘျဲၪအဆဲဎွ့ၩဒၩ့ဎွ့ဖျိၪ့လဲၪ.",
			"21": "<sup>21</sup> အဝ့ၫၥံၪစံၭဝ့ၫ,နွ့ၫဖျိၪ့လီၫ.- အဝ့ၫဒၪစံၭၦလဖၪနီၪ, နၥံၪနၪလၥ့ၪဘၪနီၪ မွဲဘဲၫၥ့ၪလဲၪ.",
			"22": "<sup>22</sup> အဝ့ၫၥံၪလ့ၩထီၩ့လၧဘ့ၭၥစ့ဒၫတၭ, ၦဂဲၫဆိၬၦမ့ၬ ဘျီၪလဂၩလၧအအီၪတၭ, အၪ့ကံၩ့အၪ့ယၫဝ့ၫဘဲၫၥိၭ",
			"23": "<sup>23</sup> အမိထိၭဘၪဝ့ၫလီၫ.- အဝ့ၫဒၪဖီၪ့ထၬၦမ့ၬဘျီၪအ စူၪတၭ,လ့ၩၥိၫ့ထၪ့ဝ့ၫ လၧတဝၫ့အချိၫ့တၭ, ထိၪဖျံၭ ဝ့ၫအမ့ၬၥၪဖၧၩ့တၭ, အီၪက့ၪထၪ့အစူၪလၧအလီၩ့ တၭ,မွဲအဒၪဘၪဆၧလမံၩ့မံၩ့ လဒၪဘၪလဲၪနီၪ, အၪ့",
			"24": "<sup>24</sup> စၪ့ဝ့ၫဒၪလီၫ.- အဝ့ၫနီၪယိထၪ့ဆၧတၭ, စံၭဝ့ၫ,ယဒၪ",
			"25": "<sup>25</sup> ဘၪၦၡၩဘဲၫၥံၪ့ၥံၪအၥိၭ စဲၪ့ဝ့ၫလီၫ.- ထီးနီၪလဖၧၫ့, အီၪက့ၪထၪ့ဒီၭအစူၪလၧအမ့ၬၥၪအလီၩ့တၭ, အၪ့မၧၫ့ အယိထၪ့ဆၧတၭ, အဝ့ၫနီၪဘျၪထဲၩ့ဝ့ၫတၭ, ဒၪထၪ့",
			"26": "<sup>26</sup> ထဲၩ့ဆၧကိၭမံၩ့ဒ့ၭလၩ့ထံးလၩ့ဆ့ၭလီၫ.- အဝ့ၫဒၪ အၪ့မၧၫ့အထဲၩ့လၧ အဂံၪ့တၭ,စံၭဝ့ၫ, လ့ၩနုၬလၧတဝၫ့ ဖၧၩ့လဂ့ၩ, လီၩဘၪၦအီၪ လၧတဝၫ့ဖၧၩ့နးဂၩလဂ့ၩ.",
			"27": "<sup>27</sup> ယ့ၫၡုၬဒဲအထံၩအဖျဲၥံၪ စဲၪ့ထၪ့ဝ့ၫထဲၩ့လၧစ့ၭစရံ အၫဖံလံၭအတဝၫ့လဖၪတၭ, အီၪလၧဖၧၩ့ၥၭအဘိၩ့ ဘၭနီၪ,ချဲၩ့ဒုၪ့အထံၩအဖျဲၥံၪတၭ,အၪ့စၪ့ဝ့ၫ, ၦၡၩလ",
			"28": "<sup>28</sup> ဖၪနီၪ,မွဲအစံၭလၧယမွဲပလၫလဂၩလဲၪ.- အဝ့ၫၥံၪချဲၩ့ ဆၧၫ့ဝ့ၫ, ၦလနၩ့နၩ့စံၭဝ့ၫ, ၦဘၭတံၫဇၫ့ဆၧစယီ ဟၫ့တၭ,အဂူၫဂၩစံၭဝ့ၫ, စအံၫလဲယၫတၭ,အဂူၫဂၩ",
			"29": "<sup>29</sup> စံၭဝ့ၫမီၪလဂၩဂၩလီၫ.- အဝ့ၫဒၪအၪ့စၪ့ဝ့ၫ,အ့ၪမွဲနၥံၪ ဝ့ၫဒၪယီၩ, မွဲနၥံၪစံၭယၧၩ, လၧယမွဲပလၫလဂၩလဲၪ. စပံတၧၫချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ,နမွဲဎရံၬလီၫ.",
			"30": "<sup>30</sup> အဝ့ၫဒၪမၪလူၬဝ့ၫ ဘဲၫၥိၭအထီးလီၩဘၪအဂဲးအကၠီၪ့ လၧၦနးဂၩလဂ့ၩ.",
			"31": "<sup>31</sup> အဝ့ၫဒၪၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဆိၫဝ့ၫ လၧၦၡၩအဖိၪခွၫမိ ဘၪထိးဆၧအၪမံၩ့တၭ, မိဘၪဆၧခွံၬၡိၭလၧၦၥုၪ့က့ၭ ၥၭၡါၥံၪ,ဒဲၦလုဆၧအဒိၪၥံၪ, ဒဲၦကွ့ၭလံၬၥံၪတၭ, မိ ဘၪဆၧမၩၥံၫဝ့ၫတၭ, ထီးအဘၪၥၧၫ့နံၩလနံၩနီၪ, မိ",
			"32": "<sup>32</sup> ဂဲထုၪ့ထဲၩ့ဝ့ၫလီၫ.- ချဲၩ့ဖျီၪထၪ့ဆၧချဲၩ့လထံၪနီၪ,စပံ",
			"33": "<sup>33</sup> တၧၫမၩန့ဝ့ၫဒၪတၭ, အၪ့လၬၥၫ့ဝ့ၫလီၫ.- အဝ့ၫဒၪကၠၪ စိၩအၥၭဒၪဘၪအထံၩအဖျဲၥံၪနီၪ,အၪ့လၬစပံတၧၫ တၭ,စံၭဝ့ၫဒၪ,ဒုၪဒၩဧ့, ထဲၩ့ကဒၩထဲၩ့နဝ့ၫလၧယလး ခဲၫ့ဆံၭ.အဂဲးဘဲၫယီၩနၥၭအီၪယွၩအဆၧအ့ၬ. မွဲ နၥၭအီၪလၧၦၡၩ အဆၧလခီၫလီၫ.",
			"34": "<sup>34</sup> ထီးအကိၭန့ၦခမျၧး ဒဲအထံၩအဖျဲၥံၪ လၧအအီၪ တၭ, စံၭအဝ့ၫၥံၪ, ထီးဒၪၦလၧဆၧမိဖိၬဘၪအၥၭလၧ ယခဲၫ့လဂၩဂၩနီၪ, မွဲအခွံၬၡိၭခွံၬအၥၭဒၪဝ့ၫ, မၩန့",
			"35": "<sup>35</sup> အထုၪ့စူၪယၫတၭ,ဖိၬယခဲၫ့ဆံၭ.- အဂဲးဘဲၫယီၩထီး ဒၪၦလၧအမိထိးထဲၩ့ဘၪအၥၭ လၧအၥၭမၧၫ့လဂၩ ဂၩနီၪ,အၥၭမၧၫ့မိလၩ့မါဝ့ၫဒၪလီၫ. ထီးဒၪၦလၧအ ၥၭမၧၫ့လၩ့မါခွံၬဝ့ၫလၧယကၠီၩ့, ဒဲလၧဆၧၥၭထိၬအ ပရၧၫ့အကၠီၩ့လဂၩဂၩနီၪ, မွဲအမိထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫ",
			"36": "<sup>36</sup> လခီၫလီၫ.- အဂဲးဘဲၫယီၩၦအ့ၪန့ဘၪဂၪ့ခိၪထၧၫ့ဖျိၪ့ ယၫတၭ, အၥၭၡီၩ့အ့ၪလၩ့မါခွံၬဝ့ၫနီၪ, မွဲအန့ကၩ",
			"37": "<sup>37</sup> ဆၧနီၪလဲၪ.- လၧအၥၭၡီၩ့အဂးနီၪ, မွဲၦမိဖ့ၪလၫ့အ",
			"38": "<sup>38</sup> ဎွ့ၩလၧဆၧနီၪလမံၩ့လဲၪ.- အဂဲးဘဲၫယီၩထီးဒၪၦအီၪ လၧၦအဲၪဘိၩ့ဆၧ ဒဲဆၧဒဲၩဘၭဖိၪအဆိၩယီၩအကျၩ တၭ,လၧအမ့ၬမဲလၧယကၠီၩ့ ဒဲလၧယဆၧချဲၩ့အကၠီၩ့ လဂၩဂၩနီၪ, ထီးၦၡၩအဖိၪခွၫဂဲၫလၩ့ဝ့ၫ လၧအဖါ အလၩအဖၩ့အဖၧၩ့ ဒဲလၧအၥီၫ့ဆံၫ့ဎံၪလဖၪ အၥိၭ တၭ,အမ့ၬမိမဲဝ့ၫလၧအဝ့ၫၥံၪအကၠီၩ့ဆ့လီၫ."
		},
		"9": {
			"1": "<sup>1</sup> အဝ့ၫဒၪစံၭၦလဖၪနီၪ, ယလီၩဘၪနၥံၪတီၩတီၩ, ၦဆၧၫ့ထုၪ့ထီးယီၩလနၩ့နၩ့ လချႃၭဒၪဒံၭဘၪယွၩ အ ဘၩ့အမုးဂဲၫထဲၩ့လၧအစီၩ့အမၩ့နီၪ မွဲအထဲးယိဘၪ ဆၧၥံၫအ့ၬ.",
			"2": "<sup>2</sup> လၧခဲၫ့ထဲၩ့ဎူၫနံၩတၭ, ယ့ၫၡုၬကိၭန့စပံတၧၫ,ဒဲ စယ့မံၭဒဲစယီဟၫ့တၭ, လ့ၩၥိၫ့ထၪ့ဝ့ၫလၧခိၪလီၩ့ဖၭ ထီၫလဖျိၪ့အလီၩ့, လၧဆၧကဒုၩအလးလီၫ.အခံးအ ဂၩ့ဘၪဆၧအၪ့လဲၩခွံၬအၥၭ လၧအဝ့ၫၥံၪအမ့ၬယၫ",
			"3": "<sup>3</sup> တၭ,- အကီၩ့အၥိၭယုၩ့ယဲဒိၪမၬတၭ,ဘွၩထၪ့ဒိၪမၬ ဘဲၫမူၭခိၪဖီၫအၥိၭထီးၦအၪ့ဆူၫဝၭ ဆၧလၧဂၪ့ခိၪချိၫ့",
			"4": "<sup>4</sup> မၩဘွၩထၪ့လၥ့ၪဘၪလီၫ.- စအံၫလဲယၫ,ဒဲစမိစ့ၭနဲၪ ဖျီၪထၪ့အၥၭလၧအဝ့ၫၥံၪတၭ, ချဲၩ့ဒုၪ့လိၬအၥၭလၧ",
			"5": "<sup>5</sup> ယ့ၫၡုၬလီၫ.- စပံတၧၫချဲၩ့ထၪ့ဝ့ၫတၭ, စံၭယ့ၫၡုၬ, ရၭဘံၫဧ့,ပအီၪထီးယီၩမုၬကၨ. ပမိမၩတဲၩနးၥၧၫ့ ဖျိၪ့,လၧနဂးနးဖျိၪ့,လၧစမိစ့ၭအဂးနးဖျိၪ့, လၧစအံၫ",
			"6": "<sup>6</sup> လဲယၫအဂးနးဖျိၪ့လီၫ.- အဂဲးဘဲၫယီၩချဲၩ့ဆၧဘဲၫၥ့ၪ လဲၪဘဲၫၥ့ၪလဲၪနီၪ, ၥ့ၪယၫလၩ့အၥၭအ့ၬ. မွဲအဝ့ၫၥံၪ",
			"7": "<sup>7</sup> ၥၭမဲၪၥၭဖျဲၩ့ ဆၧဒိၪမၬအဂဲးလီၫ.- ဆၧအုၪ့လၩ့ကဒုၩ အဝ့ၫၥံၪတၭ, ဆၧအလူၥီၫလၩ့လၧဆၧအုၪ့အကျၩစံၭ ဝ့ၫဒၪ, အယီၩမွဲယဖိၪခွၫၥၭဘီၩ့လဂၩတၭ, ခိၭနၪအ",
			"8": "<sup>8</sup> လူဆံၭ.- အဝ့ၫၥံၪယိဝၬဝၬချဲၫ့မၬတၭ, အ့ၪလမွဲဘၪ န့ၫယ့ၫၡုၬ ဒဲအဝ့ၫၥံၪအနၫ့ဆါလဖၪနီၪဒၪဘၪၦနးဂၩ အ့ၬ.",
			"9": "<sup>9</sup> အဝ့ၫၥံၪဂဲၫထဲၩ့လၩ့ဝ့ၫ လၧခိၪလီၩ့ခိၪအဘိၩ့ဘၭ တၭ,ယ့ၫၡုၬမၪလူၬဝ့ၫ ဘဲၫၥိၭၦၡၩအဖိၪခွၫယီၩလ ချႃၭဂဲထုၪ့ထဲၩ့ဒံၭဘၪ လၧဆၧၥံၫအဖၧၩ့နီၪ, ထီးလီၩ",
			"10": "<sup>10</sup> ဘၪဆၧလၧအဒၪဘၪနီၪ လၧၦနးဂၩလဂ့ၩ,- ဆၧချဲၩ့ လထံၪနီၪ, အဝ့ၫၥံၪထီးန့ဝ့ၫတၭ,စံၭလိၬအၥၭ,ဆၧဂဲ",
			"11": "<sup>11</sup> ထုၪ့ထဲၩ့လၧဆၧၥံၫနီၪ,မွဲဆၧနီၪလဲၪ.- အဝ့ၫၥံၪအၪ့ စၪ့ဝ့ၫတၭ, စံၭဝ့ၫ, မွဲဘၪနီၫလၧၦကွ့ၭလံၬၥံၪ, စံၭဝ့ၫ,",
			"12": "<sup>12</sup> စအံၫလဲယၫဘၪဂဲၫဆိၫလဲၪ.- အဝ့ၫဒၪချဲၩ့ဆၧၫ့အ ဝ့ၫၥံၪတၭ, လီၩဘၪဝ့ၫ, စအံၫလဲယၫဂဲၫဆိၫတၡါဝ့ၫ တၭ,မၩထဲၩ့ဆၧထီးအလူၬလီၫ. ဘဲၫဆၧကွ့ၭအၥၭ အၥိၭနီၪ, ၦၡၩအဖိၪခွၫမိဘၪထိးဆၧအၪ လၧၦမၩ",
			"13": "<sup>13</sup> ကြၩ့ထမးဝ့ၫလီၫ.- အ့ၪမွဲယၧၩယီၩ, ယလီၩဘၪ နၥံၪစအံၫလဲယၫဂဲၫထီၩ့ယူၭဝ့ၫယူၭ, ဘဲၫဆၧကွ့ၭ အၥၭအဂဲးအၥိၭနီၪ, ထီးဒၪၦၡၩအၥၭအီၪဝ့ၫလမံၩ့ လါလါနီၪ,မၩယူၭအဝ့ၫယူၭ.",
			"14": "<sup>14</sup> ထီးအလ့ၩထီၩ့ လၧအထံၩအဖျဲၥံၪအအီၪနီၪ,ဒၪဘၪ ၦခမျၧးဖၭဒိၪ အီၪဖီၩ့ဝ့ၫတၭ, ၦကွ့ၭလံၬၥံၪတ့ၭလိၬအ",
			"15": "<sup>15</sup> ၥၭလၧအဝ့ၫၥံၪလီၫ.- ၦခမျၧးထီးအလူၬဒၪဘၪဝ့ၫနီၪ ထီၫမံၫထီၫမၪချဲၫ့မၬတၭ, ဂဲၫစဲၪ့တလဲးစိၩဝ့ၫလၧ",
			"16": "<sup>16</sup> အအီၪနီၪ, ချဲၩ့ဒုၪ့ဝ့ၫလီၫ.- အဝ့ၫဒၪအၪ့စၪ့အဝ့ၫၥံၪ, မွဲနၥံၪတ့ၭလိၬ နၥံၪအၥၭလၧၦလဖၪနီၪလၧဆၧနီၪလၫ အဂဲးလဲၪ.",
			"17": "<sup>17</sup> ၦအီၪထီးၦခမျၧးအကျၩလဂၩချဲၩ့ထၪ့ဝ့ၫတၭ, စံၭ ဝ့ၫ, ဆရၫဧ့, ယဖိၪခွၫလၧဆၧနၪချဲၩ့လၥ့ၪဘၪအီၪလၧ",
			"18": "<sup>18</sup> အလီၩ့လဂၩ, ယဂဲၫဆိၬယူၭလၧနအီၪယူၭ.- ထီး ဒၪအလးလၧအဖီၪ့ထၬဝ့ၫလစီၪ့စီၪ့နီၪ, မၩလၩ့ထံၩဖါ ဝ့ၫတၭ, အနိၭပၠူၭလၩ့တၭ, အဲၪ့ဂံၬအၥွၫတၭ, ဎွ့ လၩ့ဝ့ၫလီၫ.ယအၪ့မၧၫ့နထံၩနဖျဲၥံၪ နၫ့ထၪ့ခွံၬဝ့ၫတၭ,",
			"19": "<sup>19</sup> မၩဝ့ၫၥ့ၪအ့ၬ.- အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧတၭ,စံၭဝ့ၫ,ၦလ နဲၩဘၪဆၧအဆၨၩဧ့, မွဲယမိဘၪအီၪလၧနၥံၪအၥိၭ ဆံၭယံၬလဲၪး ယမိဘၪအွံၪၥၭဆၧၩ့နၥံၪဆံၭယံၬလဲၪး",
			"20": "<sup>20</sup> ဂဲၫဆိၬအဝ့ၫနီၪလၧယအီၪဆံၭ.- ၦလ့ၩဆိၬဝ့ၫလၧအ အီၪလီၫ. ထီးအဒၪဘၪဝ့ၫတၭ, ဆၧနၪဒုၭကဲၩ့ထၪ့ဝ့ၫ နၭနၭလ့ၬချဲၫ့မၬတၭ, လၩ့ထံၩဖါဝ့ၫလၧဂၪ့ခိၪလီၩ့",
			"21": "<sup>21</sup> တၭ,အနိၭပၠူၭလၩ့ဝ့ၫချံးအၥၭလီၫ.- အဝ့ၫဒၪအၪ့စၪ့ အဖါ,ဆၧမၩယူၭအၥၭဘဲၫယီၩ, မွဲအဆံၭယံၬယူၭ လဲၪ.အဝ့ၫနီၪစံၭဝ့ၫ, လၧအဖိၪၥၪလံၩလံၩလီၫ.",
			"22": "<sup>22</sup> ဘဲၫၥိၭအမိမၩၥံၫအဝ့ၫနီၪ, ခွံၬလၩ့ခွံၬဝ့ၫလၧမ့ၪဖၧၩ့, ဒဲလၧထံၫကျၩအၪဘျၩ့လီၫ. အ့ၪမွဲနဝ့ၫဒၪယီၩ, နမၩ အ့ၪၥ့ၪလမံၩ့မံၩ့တၭ, ယၫ့ၥုၪ့ယၫ့ၥၭတၭ, မၩဘိၭမၩ",
			"23": "<sup>23</sup> ဆၧၩ့ပၧၩဆံၭ.- ယ့ၫၡုၬစံၭဝ့ၫ,နဝ့ၫဒၪယီၩနနဲၩဆၧ အ့ၪၥ့ၪတၭ,ဆၧၥ့ၪဆၧလူၬ လၧၦလၧအနဲၩဆၧအဂး",
			"24": "<sup>24</sup> လီၫ.- ဖိၪၥၪအဖါနီၪကိၭၡၭထၪ့ဆၧချဲၫ့မၬတၭ, စံၭ ဝ့ၫ, ယနဲၩဆၧ,ကဆါဧ့,ယလနဲၩဘၪဆၧယီၩမၩ",
			"25": "<sup>25</sup> ဆၧၩ့နဝ့ၫဆံၭ.- ထီးယ့ၫၡုၬဒၪဘၪ ၦခမျၧးဂဲၫစဲၪ့တ လဲးဎုၬလၧအအီၪတၭ, မၪလူၬဆၧနၪအၧၩ့, စံၭအဝ့ၫ, ဆၧနၪချဲၩ့ဆၧလၥ့ၪဘၪ, ဒဲအနါအၧၩ့လဒုၩဧ့, ယအၪ့ မၧၫ့နၧၩစဲၪ့ထၪ့ခွံၬလၧအလီၩ့တၭ, စူၩယၫခိၬထီးဂဲၫ",
			"26": "<sup>26</sup> အီၪလၧအဖၧၩ့နးဆိၭလဂ့ၩ.- အဝ့ၫနီၪကိၭၡၭထၪ့ဆၧ တၭ,ဒုၭကဲၩ့ထၪ့ဝ့ၫနၭနၭလ့ၬတၭ, စဲၪ့ထၪ့ခွံၬဝ့ၫ လီၫ.အဝ့ၫဒၪမၩအၥၭဘဲၫၦၥံၫအၥိၭ ထီးၦအၪဂၩ",
			"27": "<sup>27</sup> စံၭဝ့ၫ, မွဲအၥံၫလီၫ.- ယ့ၫၡုၬဖီၪ့အစူၪတၭ, ဘိၭထၪ့",
			"28": "<sup>28</sup> ဝ့ၫဒၪနီၪ,အဆၧဂဲထုၪ့ထဲၩ့ဝ့ၫလီၫ.- ထီးအလ့ၩနုၬဝ့ၫ လၧဂံၪ့ဖၧၩ့တၭ, အထံၩအဖျဲၥံၪအၪ့စၪ့ဝ့ၫ လၧဆၧ ကဒုၩအလး, မွဲဘၪနီၫလၧပနၫ့ထၪ့ခွံၬပဝ့ၫလၥ့ၪဘၪ",
			"29": "<sup>29</sup> လဲၪ.- အဝ့ၫဒၪလီၩဘၪအဝ့ၫၥံၪး အ့ၪလမွဲဘၪလၧဆၧ ဘၩဆိၪဖၪ, ဒဲဒုၪဆၧအၪ့ဆၧအီၩအကၠီၩ့နီၪ, ဆၧနၫ့ ထၪ့ခွံၬဆၧလမံၩ့ယီၩၥ့ၪအ့ၬ.",
			"30": "<sup>30</sup> အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬထီးနီၪ, လ့ၩခၫ့ဂၬခွံၬဂၫလလံၫ",
			"31": "<sup>31</sup> တၭ,မိဒုၭၥ့ၪယၫဘၪအၥၭ လၧၦနးဂၩအ့ၬ.- အဂဲး ဘဲၫယီၩၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ အထံၩအဖျဲၥံၪတၭ, လီၩဘၪ ဝ့ၫလၧၦၡၩအဖိၪခွၫ မိဘၪဆၧဖ့ၪလၫ့ခွံၬဝ့ၫလၧၦၡၩ အစူၪဖၧၩ့တၭ, အဝ့ၫၥံၪမိမၩၥံၫအဝ့ၫလီၫ. ဘၪဆၧမၩ ၥံၫဝ့ၫအလးခဲၫ့ၥၧၫ့နံၩလနံၩတၭ မိဂဲထုၪ့ထဲၩ့ဝ့ၫလီၫ.",
			"32": "<sup>32</sup> အဆၧချဲၩ့လထံၪနီၪ အဝ့ၫၥံၪနၪဝ့ၫလၥ့ၪဘၪလါနၫ့, အၪ့စၪ့ဝ့ၫဘုၪ့အ့ၬ.",
			"33": "<sup>33</sup> အဝ့ၫၥံၪလ့ၩထီၩ့လၧကပၧနအၫ့နီၪ,အီၪလၧဂံၪ့ ဖၧၩ့တၭ, အၪ့စၪ့ၦလဖၪနီၪ, နၥံၪအီၪလၧဖၧၩ့ၥၭတၭ, မွဲနၥံၪတ့ၭလိၬ နၥံၪအၥၭလၧဆၧနီၪအဂဲးလမံၩ့လဲၪ.",
			"34": "<sup>34</sup> အဝ့ၫၥံၪအီၪလၩ့မါပံၭလီၫ. အဂဲးဘဲၫယီၩမွဲပလၫမိ ကဲၪအဒိၪထုၬနးဂၩအဂဲးနီၪ, တ့ၭလိၬအၥၭလၧ",
			"35": "<sup>35</sup> ဖၧၩ့ၥၭနီၪလီၫ.- အဝ့ၫဒၪဆၧၫ့နၩ့ဝ့ၫတၭ,ကိၭန့ၦလဆံၫ နံၫဂၩတၭ, စံၭအဝ့ၫၥံၪ, ၦအ့ၪမိကဲၪဘၪအၥၭလၧအ ခိၪလဂၩဂၩနီၪ, မိဘၪကဲၪ ဝ့ၫလၧၦအဆံၭထုၬလၧ ၦထီးအလူၬအကျၩ, ဒဲၦထီးအလူၬအခ့ၫအၡၩလီၫ.",
			"36": "<sup>36</sup> မၩန့ဖိၪၥၪလဂၩတၭ, အီၪက့ၪလၩ့ဝ့ၫလၧအၥၭကျၩ",
			"37": "<sup>37</sup> တၭ,ဖိၭဂိၫ့ထၪ့ဝ့ၫလၧအစူၪတၭ,စံၭအဝ့ၫၥံၪ,- ထီးဒၪ ၦလၧအထိးဆၧၫ့ဖိၪၥၪ ဘဲၫယီၩလဂၩလၧယမံၩ့ အကၠီၩ့လဂၩဂၩနီၪ, မွဲအထိးဆၧၫ့ယၧၩလီၫ. ထီးဒၪ ၦလၧအထိးဆၧၫ့ယၧၩလဂၩဂၩနီၪ, မွဲလထိးဆၧၫ့ဘၪ ယၧၩ, အ့ၪမွဲထိးဆၧၫ့ ၦလၧအအၪ့မၧၫ့လၩ့န့ယၧၩလ ဂၩနီၪလီၫ.",
			"38": "<sup>38</sup> စယီဟၫ့ချဲၩ့ထၪ့ဆၧ, စံၭဝ့ၫ,ဆရၫဧ့,ပဒၪဘၪၦလ ဂၩ,လၧအလဖိၬဘၪပခဲၫ့တၭ, နၫ့ထၪ့ခွံၬဆၧနၪလၧ နမံၩ့နီၪ,ပပဒၩ့ထၬအဝ့ၫနီၪလီၫ. အဂဲးဘဲၫယီၩလဖိၬ",
			"39": "<sup>39</sup> ဘၪပခဲၫ့လီၫ.- ယ့ၫၡုၬစံၭဝ့ၫ, ထီးပဒၩ့ထၬ အဝ့ၫလ ဂ့ၩးအဂဲးဘဲၫယီၩ ၦလၧအမၩလၩ့လၭဆၧလၧယ",
			"40": "<sup>40</sup> မံၩ့နီၪ,စံၭအၧၩ့ယၧၩယီၫခိၬၥ့ၪနးဂၩအ့ၬ.- အဂဲးဘဲၫ ယီၩၦလၧအလထၫ့ဒုၪဒၩဘၪပၧၩနီၪ, မွဲအအီၪလၧ",
			"41": "<sup>41</sup> ပဂးလီၫ.- နၥံၪဘၪဆဲၫ့လၧဎရံၬအကၠီၩ့တၭ, ထီးဒၪ ၦလၧအဒုၭအီၩ နၥံၪလၧထံၫအချံၪ့နးဘျႃၪ့လၧယ မံၩ့အကၠီၩ့လဂၩဂၩနီၪ, ယလီၩဘၪနၥံၪတီၩတီၩယီၩ, အခိးအတၩလၩ့မါဘၪဝ့ၫအ့ၬ.",
			"42": "<sup>42</sup> ထီးဒၪၦလဂၩဂၩလၧအမၩလၩ့ထံၩဖါၦလၧအ ဆံၭလၧအနဲၩထဲၩ့ယၧၩလဂၩနီၪ အခိၬအ့ၪဘၪဆၧစၧၩ့ ထၬလၧဆုၪ့ဂူၬလိးတၭ, ဘၪဆၧခွံၬလၩ့ခွံၬဝ့ၫလၧမၫဆ မံၭအဖၧၩ့နီၪ, မွဲအဂ့ၩဒၪအဆၧဒံၭလီၫ.",
			"43": "<sup>43</sup> နစူၪအ့ၪမၩလၩ့ထံၩဖါနၧၩတၭ,ဒၪ့ထ့ၬခွံၬဆံၭ. နအ့ၪလ့ၩနုၬအီၪဘၪလၧဆၧမၧၫ့အဖၧၩ့ လၧနစူၪထူၬ နီၪ,ဂ့ၩနဲၪ့ဒံၭနလ့ၩနုၬလၩ့လၧလရၬ, လၧမ့ၪလၧအ လၩ့ဖံၬခွံၬလၥ့ၪဘၪအဖၧၩ့ လၧနစူၪနံၫခီၫလူၬဒံၭလီၫ.",
			"44": "<sup>44</sup> ဆၧထီးနီၪလိၪ့လၥံၫဘၪတၭ, မ့ၪလလၩ့ဖံၬဘၪ",
			"45": "<sup>45</sup> လီၫ.- နခၪ့အ့ၪမၩလၩ့ထံၩဖါနၧၩတၭ, ဒၪ့ထ့ၬခွံၬဝ့ၫ ဆံၭ.နအ့ၪလ့ၩနုၬဘၪ လၧဆၧမၧၫ့အဖၧၩ့ လၧနခၪ့ ထူၬနီၪ,ဂ့ၩနဲၪ့ဒံၭနဘၪဆၧခွံၬ လၩ့နၧၩလၧလရၬ, လၧ မ့ၪလၧအလၩ့ဖံၬလၥ့ၪဘၪအဖၧၩ့ လၧနခၪ့နံၫခီၫလူၬ",
			"46": "<sup>46</sup> ဒံၭလီၫ.- ထီးနီၪလိၪ့လၥံၫဘၪတၭး မ့ၪလလၩ့ဖံၬဘၪ",
			"47": "<sup>47</sup> လီၫ.- နမ့ၬၥၪအ့ၪမၩလၩ့ထံၩဖါနၧၩတၭ,အီၩ့ခွ့ၭထၪ့ ခွံၬဝ့ၫဆံၭ. နအ့ၪလ့ၩနုၬဘၪ လၧယွၩအဘၩ့အမုး အဖၧၩ့လၧနမ့ၬၥၪလတီၪ့နီၪ, ဂ့ၩနဲၪ့ဒံၭနဘၪ ဆၧခွံၬ လၩ့ခွံၬနၧၩလၧလရၬမ့ၪဖၧၩ့ လၧနမ့ၬၥၪနံၫတီၪ့လူၬ",
			"48": "<sup>48</sup> ဒံၭလီၫ.- ဆၧထီးနီၪလိၪ့လၥံၫဘၪဝ့ၫတၭ, မ့ၪလလၩ့ ဖံၬဘၪလီၫ.",
			"49": "<sup>49</sup> အဂဲးဘဲၫယီၩကယဲၦထီးအလူၬနီၪ, မိဘၪဆၧလဲၩ ဎုၬဝ့ၫလၧမ့ၪတၭ, ကယဲဆၧလုထီးအလူၬနီၪ,မိဘၪ",
			"50": "<sup>50</sup> ဆၧလဲၩဎုၬဝ့ၫလၧထံၫလၪလီၫ.- ထံၫလၪနီၪမွဲဆၧအ ဂ့ၩလီၫ. အ့ၪမွဲဆၧလၧထံၫလၪယီၩ, အဂၫ့အ့ၪဘျိၪ ခွံၬဝ့ၫတၭ,မွဲအမိဂၫ့ထဲၩ့ဝ့ၫ လၧဆၧနီၪလမံၩ့လဲၪ. နၥံၪဝ့ၫဒၪယီၩ, အီၪလၧထံၫလၪလၧနၥံၪအဖၧၩ့ဆံၭ. အီၪဘၪလိၬအိၭလိၬ နၥံၪအၥၭဆုၬဆုၬဆံၭ."
		},
		"10": {
			"1": "<sup>1</sup> အဝ့ၫဒၪဂဲထုၪ့လၧအလးထီးနီၪတၭ,လ့ၩဝ့ၫထီၩ့ လၧယီၫဒၫ့ဝါလခီၫနီၪ အီၪလၧခးယုဒၫအနဲၩ့ထံၭလီၫ. ၦခမျၧးဂဲၫအီၪကီၪ့ဒီၭလၧအအီၪတၭ, အဆၧၥီၪ့ထဲၩ့ ၥၫ့ထဲၩ့ဒီၭအဝ့ၫၥံၪ ဘဲၫအထူၫအရူၫအၥိၭနီၪလီၫ.",
			"2": "<sup>2</sup> ၦဖၫရစံၫလဖၪဂဲၫလၧအအီၪနီၪ, ကျဲၩ့ဖစီၩ့ဝ့ၫတၭ,",
			"3": "<sup>3</sup> အၪ့စၪ့ဝ့ၫလၧၦခွံၬၡိၭအမၫနီၪ,မွဲအဂ့ၩဆ့ဧၪ.- အဝ့ၫ ဒၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫၥံၪ, မွဲစမိစ့ၭမၪလူၬနၥံၪ",
			"4": "<sup>4</sup> ဘဲၫၥ့ၪလဲၪ.- အဝ့ၫၥံၪစံၭ, စမိစ့ၭဒုၭကွ့ၭလံၬလၩ့ၡၪ",
			"5": "<sup>5</sup> တၭ, ခွံၬၡိၭဝ့ၫလီၫ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭ ဝ့ၫ,မွဲအကွ့ၭန့နၥံၪအဆၧၥီၪ့ဆၧၥၫ့လထံၪယီၩ, လၧန",
			"6": "<sup>6</sup> ၥံၪအၥုၪ့နီၩ့အၥၭနီၩ့အကၠီၩ့လီၫ.- မွဲလါနၫ့တၭ, လၧ အမၩကဲၪထၪ့ဆၧလၧအၥၫ့နီၪ, ယွၩမၩကဲၪထၪ့န့ၦ",
			"7": "<sup>7</sup> မုၪဒဲၦခွၫလီၫ.- မၩ အ ၥၭ ဘဲၫ နီၪ တၭ, ၦ ခွၫ ဘၪ စဲၪ့ ဒၪ  အ မိ အ ဖါ, ဘၪ ၥုၭ ဘူၭ အ ၥၭ လၧ",
			"8": "<sup>8</sup> အ မၫ လီၫ.- အ ဝ့ၫ ၥံၪ နံၫ ဂၩ နီၪ မိ ကဲၪ ထၪ့ ဆၧ လ ၥွံၪ ဎး လ ယၪ ဎး လီၫ. အနီၪတၭ, မွဲ",
			"9": "<sup>9</sup> လၧၩ့ၦနံၫဂၩအ့ၬ,မွဲလၥွံၪဎးလယၪဎးလီၫ.- မၩအ ၥၭဘဲၫနီၪတၭ, ဆၧလၧယွၩအီၪက့ၪဎုၬဝ့ၫနီၪ, မွဲၦၡၩ ထီးထုၭလၩ့ၡၪလဂ့ၩ.",
			"10": "<sup>10</sup> လၧဂံၪ့ဖၧၩ့နီၪ, အထံၩအဖျဲၥံၪအၪ့စၪ့ဒီၭဝ့ၫ လၧဆၧ",
			"11": "<sup>11</sup> နီၪအဂဲးအကၠီၪ့လီၫ.- အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ,ထီးဒၪၦ လၧအခွံၬၡိၭခွံၬအမၫတၭ, အီၪဎုၬလၧအဂူၫဂၩလဂၩ",
			"12": "<sup>12</sup> ဂၩနီၪမွဲအအဲၪဘိၩ့အမၫလီၫ.- ၦမုၪအ့ၪခွံၬၡိၭခွံၬအ ဝၩတၭ,အီၪဎုၬလၧအဂူၫဂၩလဂၩဂၩနီၪ မွဲအအဲၪဘိၩ့ အဝၩလီၫ.",
			"13": "<sup>13</sup> ၦဂဲၫဆိၬဖိၪၥၪဆံၭၥံၪလၧအအီၪဘဲၫၥိၭအမိထိၭ ဘၪအဝ့ၫၥံၪတၭ, အထံၩအဖျဲၥံၪအၪ့လၬ ၦလၧအဂဲၫ",
			"14": "<sup>14</sup> ဆိၬဝ့ၫလဖၪနီၪလီၫ.- ထီးယ့ၫၡုၬဒၪဘၪနီၪအၥၭဆၫ တၭ,စံၭဝ့ၫဒၪ, ဖိၪၥၪဆံၭလဖၪနီၪဖ့ၪလၫ့အဂဲၫလၧယ အီၪတၭ,ထီးပဒၩ့အဝ့ၫၥံၪလဂ့ၩ. အဂဲးဘဲၫယီၩယွၩ",
			"15": "<sup>15</sup> အဘၩ့ဖိၪမုးဖိၪမွဲၦဘဲၫနီၪၥိၭလဖၪလီၫ.- ယလီၩဘၪ နၥံၪတီၩတီၩယီၩ, ထီးဒၪၦလၧအလဒိၭန့ဘၪယွၩအ ဘၩ့အမုး ဘဲၫဖိၪၥၪဆံၭအၥိၭလဂၩဂၩနီၪ, မွဲအနုၬ",
			"16": "<sup>16</sup> ဘၪလၧအဖၧၩ့အ့ၬ.- အဝ့ၫဒၪဆိၬထၪ့အဝ့ၫၥံၪ လၧအ စူၪဒူၪလီၩ့နီၪ အီၪက့ၪထၪ့အစူၪလၧအလီၩ့တၭ, ဆိၪ ဂ့ၩအဝ့ၫၥံၪလီၫ.",
			"17": "<sup>17</sup> ထီးအစဲၪ့ထၪ့လ့ၩဝ့ၫလၧဖၧၩ့ၥၭအဘိၩ့ဘၭနီၪ, ၦလဂၩဂဲၫစဲၪ့တလဲး လၧအအီၪတၭ, ထွံၩလၩ့အခၪ့ အၪ့စၪ့ဝ့ၫ,ဆရၫလၧအဂ့ၩလဂၩဧ့, ဘဲၫၥိၭယမိန့ဘၪ ဆၧမၧၫ့အဆိၩအကၠၪနီၪ, မွဲယမိဘၪမၩဆၧနီၪလမံၩ့",
			"18": "<sup>18</sup> လဲၪ.- ယ့ၫၡုၬစံၭဝ့ၫ, မွဲဘၪနီၫနကိၭယၧၩ လၧၦအဂ့ၩ လဲၪ,အ့ၪလမွဲဘၪယွၩလဂၩနီၪ, ၦအဂ့ၩအီၪနးဂၩ",
			"19": "<sup>19</sup> အ့ၬ.- ဆၧမၪလူၬလဖၪနီၪနၥ့ၪယၫယူၭ.ထီးအဲၪ ဘိၩ့ မၫ အဲၪ ဘိၩ့ ဝၩ လ ဂ့ၩ, ထီး မၩ ၥံၫ ၦ ၡၩ လ ဂ့ၩ. ထီး အၪ့ ဂူၫ ဆၧ လ ဂ့ၩ, ထီး ထိး န ၥၭ လၧ ဆၧ ဘျံၭ ဆၧ ဘျၪ လ ဂ့ၩ, ထီး အၪ့ လီၫ အၪ့ ဂူၫ ဂၩ အ ဆၧ လ ဂ့ၩ, ယူၭ ယၪ့ န မိ န ဖါ ဆံၭ.",
			"20": "<sup>20</sup> အဝ့ၫလဂၩချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ,ဆရၫဧ့, ဆၧ နီၪလဖၪထီးအလူၬလၧယဖိၪၥၪလံၩလံၩနီၪ, ယထီး",
			"21": "<sup>21</sup> န့ယူၭယဝ့ၫယူၭ.- ယ့ၫၡုၬယိအဝ့ၫနီၪအဲၪဝ့ၫတၭ, စံၭ ဝ့ၫဒၪ,နန့ဘၪဆၧအလးနီၪ, အီၪဒံၭလမံၩ့ဒံၭ,ထီး ဒၪနဆၧအီၪလဖၪနီၪ, လ့ၩအၪ့ဆၫလၩ့ခွံၬတၭ, ဖ့ၪလၫ့ ၦၡၪ့ဖိၪယၬဖိၪဆံၭ. နမိအီၪဘၪလၧနစူၪလးနခၪ့ ခိၪလၧမူၭခိၪအဖၧၩ့လီၫ. မၩန့နထုၪ့စူၪယၫတၭ, ဂဲၫ",
			"22": "<sup>22</sup> ဖိၬယခဲၫ့ဆံၭ.- အမ့ၬလၩ့ၡါလၧဆၧချဲၩ့လထံၪနီၪ အကၠီၩ့တၭ, အၥုၪ့အုၭအၥၭအုၭ, ထဲၩ့ထဲၩ့ဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ အစူၪလးအခၪ့ခိၪ အီၪဝ့ၫအၪမၬလီၫ.",
			"23": "<sup>23</sup> ယ့ၫၡုၬယိဝၬဝၬဆၧနီၪ, စံၭအထံၩအဖျဲၥံၪ,ၦၥထံၫ လဖၪနီၪ, လ့ၩနုၬဝ့ၫလၧယွၩအဘၩ့အမုး အဖၧၩ့ကၪ",
			"24": "<sup>24</sup> မၬလီၫ.- အထံၩအဖျဲၥံၪမၩအၥၭ ထီၫမံၫထီၫမၪလၧ ဆၧချဲၩ့လထံၪနီၪ အကၠီၩ့လီၫ. ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဒီၭ ဆၧတၭ,စံၭအဝ့ၫၥံၪ, ဖိၪၥံၪလံၩၥံၪဧ့, ၦလၧအဒိၭနဲၩ့ အၥၭလၧအစူၪလး အခၪ့ခိၪအဖၧၩ့လဖၪနီၪ, လ့ၩ",
			"25": "<sup>25</sup> နုၬဝ့ၫလၧယွၩအဘၩ့အမုးအဖၧၩ့ ကၪမၬကလဲၪ.- က လအူၭနုၬဖျီၫ့ထၭမ့ခဲၫ့နီၪ, ယီၫနဲၪ့ဒံၭၦၥထံၫလဂၩ",
			"26": "<sup>26</sup> လ့ၩနုၬဝ့ၫလၧယွၩအဘၩ့မုးအဖၧၩ့ဒံၭလီၫ.- အဝ့ၫ ၥံၪထီၫမံၫထီၫမၪဒိၪဒိၪလ့ၬနီၪ, စံၭလိၬအၥၭအ့ၪမွဲဘဲၫ နီၪတၭ,မွဲပလၫထီၩ့လၧ ဆၧထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫနီၪ,",
			"27": "<sup>27</sup> မိၥ့ၪနးဂၩလဲၪ.- ယ့ၫၡုၬယိအဝ့ၫၥံၪထံၫထံၫဆၭဆၭ တၭ,စံၭဝ့ၫဒၪ, အယီၩၦၡၩမၩၥ့ၪအ့ၬ. အ့ၪမွဲယွၩမၩ ၥ့ၪ,အဂဲးဘဲၫယီၩ ယွၩနီၪၥ့ၪဆၧထီးအလူၬလီၫ.",
			"28": "<sup>28</sup> ထီးနီၪလဖၧၫ့, စပံတၧၫလီၩဘၪဝ့ၫ, ယိခွါ,ပဝ့ၫဒၪ ယီၩ, ပစဲၪ့ဒၪဆၧထီးအလူၬတၭ,ပဖိၬယူၭနခဲၫ့ယူၭ.",
			"29": "<sup>29</sup> ယ့ၫၡုၬစံၭဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ, ယလီၩဘၪနၥံၪ တီၩတီၩယီၩ, ၦလၧအစဲၪ့ဒၪအဂံၪ့အဎၫ့မွဲဂ့ၩ,အထၧၫ့ ဖုဝဲမုၪမွဲဂ့ၩ, အထၧၫ့ဖုဝဲခွၫမွဲဂ့ၩ, အမိမွဲဂ့ၩ,အဖါမွဲ ဂ့ၩ,အဖိၪအမၫမွဲဂ့ၩ, အဖိၪအလံၩမွဲဂ့ၩ, အဆံၬအ နၩအဎံၪအဎုၭမွဲဂ့ၩ, လၧယကၠီၩ့, ဒဲလၧဆၧၥၭထိၬ",
			"30": "<sup>30</sup> အပရၧၫ့အကၠီၩ့နီၪ, - အ့ၪလန့ထဲၩ့ဘၪဝ့ၫအၪနဲၪ့အလး လယၩ, လၧအဆၧၫ့အထီထီးယီၩ,အဂံၪ့အဎၫ့ဒဲအ ထၧၫ့ဖုဝဲမုၪ, ဒဲအထၧၫ့ဖုဝဲခွၫ, ဒဲအမိၥံၪ,ဒဲအဖိၪအလံၩ ၥံၪ, ဒဲအဆံၬအနၩအဎံၪအဎုၭၥံၪ, ဒဲလခီၫဆၧမၩအၧၩ့ မၩနၭဝ့ၫဆ့, ဒဲဆၧမၧၫ့လၩ့ဆိၩလၩ့ကၠၪလၧကဲၪခိၬနး",
			"31": "<sup>31</sup> ကၠၪနီၪ အီၪနးဂၩအ့ၬ.- မွဲလါနၫ့ဘိၩ, ၦအီၪလၧယၫ အၪဂၩမိအီၪဘၪထဲၩ့ဝ့ၫ လၧခဲၫ့တၭ, ၦအီၪလၧခဲၫ့ မိအီၪဘၪထဲၩ့ဝ့ၫလၧယၫလီၫ.",
			"32": "<sup>32</sup> အဝ့ၫၥံၪအီၪဝ့ၫလၧဖၧၩ့ၥၭ ထီးအလ့ၩထၪ့ဝ့ၫလၧ ယရုစလံၫ့နီၪ, ယ့ၫၡုၬလ့ၩလၧယၫတၭ, အထံၩအ ဖျဲၥံၪထီၫမံၫထီၫမၪတၭ,ဖိၬဝ့ၫအခဲၫ့အဘိၩ့ဘၭနီၪ, ၥၭ မဲၪၥၭဖျဲၩ့ဝ့ၫဒၪလီၫ. အဝ့ၫဒၪကိၭန့ဒီၭ ၦလဆံၫနံၫဂၩ လီၩဘၪဆိၫအဝ့ၫၥံၪလၧဆၧမိမၩအၥၭ လၧအလီၩ့အ",
			"33": "<sup>33</sup> ဂဲးလီၫ.- အဂဲးဘဲၫယီၩ, ယိခွါ,ပလ့ၩထၪ့လၧယရုစ လံၫ့တၭ,ၦၡၩအဖိၪခွၫဘၪဆၧဖ့ၪလၫ့ခွံၬဝ့ၫ လၧၦ လုဆၧအဒိၪၥံၪ, ဒဲၦကွ့ၭလံၬၥံၪအစူၪဖၧၩ့တၭ, အဝ့ၫ ၥံၪမိစ့ၩရၫ့ၥံၫအဝ့ၫဒၪနီၪ, မိဖ့ၪလၫ့ဝ့ၫလၧၦဆၨၩလဖၪ",
			"34": "<sup>34</sup> အစူၪဖၧၩ့လီၫ.- အဝ့ၫၥံၪမိဒုၪဒွ့ၪဝ့ၫမိဒိၪဝ့ၫထးဝ့ၫ, မိထိၪဖျံၭဝ့ၫတၭ, မိမၩၥံၫအဝ့ၫဒၪလီၫ.ထီးအဘၪၥၧၫ့ နံၩလနံၩနီၪ, မိဂဲထုၪ့ထဲၩ့ဝ့ၫဒၪလီၫ.",
			"35": "<sup>35</sup> စဇ့ၭဘဒံၫအဖိၪခွၫစယ့မံၭ, ဒဲစယီဟၫ့ဂဲၫလၧ အအီၪတၭ, စံၭဝ့ၫဒၪ, ဆရၫဧ့, ထီးဒၪပအၪ့ကံၩ့အၪ့ယၫ",
			"36": "<sup>36</sup> ဆၧနီၪ, ဘၪပၥၭလၧနမိမၩလၧပဂးလီၫ.- အဝ့ၫဒၪစံၭ အဝ့ၫၥံၪ, မွဲအဘၪနၥံၪအၥၭလၧယမိမၩ ဆၧနီၫလၫ",
			"37": "<sup>37</sup> လၧနၥံၪအဂးလမံၩ့လဲၪ.- အဝ့ၫၥံၪစံၭအဝ့ၫဒၪ,ဖ့ၪလၫ့ ပၧၩလၧ ပမိဆၧၫ့နၩ့လၧနစူၪထွ့ၪနးဂၩ, ဒဲလၧနစူၪစ့ၪ",
			"38": "<sup>38</sup> နးဂၩလၧနလၩနဖၩ့အကျၩဘီၪ.- ယ့ၫၡုၬစံၭအဝ့ၫ ၥံၪ,မွဲနၥံၪအၪ့ကံၩ့ဆၧနီၫလဲၪနီၫလဲၪနီၪးနၥံၪၥ့ၪယၫ အ့ၬ.လိၫ့လၧယအီၩနီၪမွဲနၥံၪအီၩမိကဲၪဧၪ. ဘၭတံၫ ဇၫ့ဆၧလၧယထိးဘၭတံၫဇၫ့ယၥၭနီၪ, မွဲနၥံၪထိး",
			"39": "<sup>39</sup> ဘၭတံၫဇၫ့မိကဲၪဧၪ.- အဝ့ၫၥံၪစံၭဆၧၫ့ဝ့ၫ, ကဲၪဝ့ၫတ ကၨ.ယ့ၫၡုၫစံၭအဝ့ၫၥံၪ, မွဲမၬ, လိၫ့လၧယအီၩနီၪ,န ၥံၪမိအီၩတၭ, ဆၧဘၭတံၫဇၫ့လၧယထိးဘၭတံၫ",
			"40": "<sup>40</sup> ဇၫ့နီၪ,နၥံၪမိထိးဘၭတံၫဇၫ့ဆ့လီၫ.- မွဲလါနၫ့ဘိၩဆၧ ဆၧၫ့နၩ့လၧယစူၪထွ့ၪဒဲလၧယစူၪစ့ၪနီၪ, မွဲယဆၧဘဲၫ ယမိဖ့ၪလၫ့ဝ့ၫအၥိၭ န့ၫလၧၦလၧဆၧတဲၩ့ဝဲၩ အၥၭ လၧအဂးလဖၪနီၪလီၫ.",
			"41": "<sup>41</sup> ထီးၦဆံၫဂၩနါဂၧၫ့ဝ့ၫတၭ, အၥၭထၪ့စယ့မံၭဒဲစ",
			"42": "<sup>42</sup> ယီဟၫ့လီၫ.- ယ့ၫၡုၬကိၭန့အဝ့ၫၥံၪလၧအအီၪတၭ, စံၭဝ့ၫ,နၥံၪၥ့ၪယၫလၧၦလၧအပၧၩ့ဘၪ ၦဆၨၩလ ဖၪနီၪ,ကဲၪထၪ့ဝ့ၫလၧအကဆါလီၫ. အၦဒိၪၦၡါနီၪ",
			"43": "<sup>43</sup> စ့ၩရၫ့ထဲၩ့ဝ့ၫဒၪလီၫ.- မွဲလါနၫ့ဘိၩ,လၧနၥံၪအကျၩ နီၪဆၧမၩဘၪအၥၭဘဲၫနီၪအ့ၬ. အ့ၪမွဲထီးဒၪၦလၧအ မိကဲၪဘၪ အၥၭလၧအဒိၪလဂၩဂၩလၧနၥံၪအကျၩ",
			"44": "<sup>44</sup> နီၪ,မွဲအကဲၪဒၪဝ့ၫလၧနၥံၪအခ့ၫအၡၩဆံၭ.- ထီးဒၪၦ လၧအမိကဲၪဘၪအၥၭလၧ အခိၪလၧနၥံၪအကျၩလ ဂၩဂၩနီၪ, မွဲအကဲၪဒၪဝ့ၫလၧၦထီးအလူၬအခ့ၫအၡၩ",
			"45": "<sup>45</sup> ဆံၭ.- အဂဲးဘဲၫယီၩ ဆၧလၧၦၡၩအဖိၪခွၫယီၩ,ဂဲၫ အၪ့မၧၫ့ၦၡၩအ့ၬ. မွဲအဂဲၫဒိၭန့ဆၧအၪ့မၧၫ့ဝ့ၫဒၪ, ဒဲဖ့ၪလၫ့အၥၭ လၧၦၡၩအၪဂၩအဎွ့ၩလီၫ.",
			"46": "<sup>46</sup> အဝ့ၫၥံၪလ့ၩထီၩ့လၧယ့ၫရခိၫလီၫ. ထီးအစဲၪ့ ထၪ့ခွံၬလၧယ့ၫရခိၫနီၪ, အထံၩအဖျဲၥံၪ ဒဲၦခမျၧးဖၭ ဒိၪဖိၬထၪ့အခဲၫ့ဆ့တၭ, စတမံအၧၭအဖိၪခွၫၦအမ့ၬ ဘျီၪစဘၫတမံအၧၭလဂၩ, ဆၧၫ့နၩ့အၪ့ကံၩ့ဆၧလၧ",
			"47": "<sup>47</sup> ဖၧၩ့ၥၭအနဲၩ့ထံၭလီၫ.- ထီးအနါဂၧၫ့လၧအမွဲၦနၭဇ ရ့ၭဖိၪယ့ၫၡုၬနီၪ, ကိၭၡၭထၪ့ဆၧတၭ, စံၭဝ့ၫဒၪ, စဒၫ ဝံၭအဖိၪခွၫယ့ၫၡုၬဧ့, ယၫ့ၥုၪ့ယၫ့ၥၭလါယၧၩဆံၭ.",
			"48": "<sup>48</sup> ၦအၪဂၩအၪ့လၬလါနၫ့အဝ့ၫနီၪ ဘဲၫၥိၭအမိအီၪလၩ့ မါပံၭတၭ, မွဲအကိၭၡၭထၪ့ဆၧဒိၪနဲၪ့အလးဒံၭအၪ အၪလ့ၬ,စဒၫဝံၭအဖိၪခွၫဧ့,ယၫ့ၥၭလါယၧၩဆံၭ.",
			"49": "<sup>49</sup> ယ့ၫၡုၬအီၪထီဝ့ၫတၭ, အၪ့မၧၫ့ၦကိၭန့အဝ့ၫလီၫ. ၦ လဖၪကိၭစိၩ ၦမ့ၬဘျီၪလဂၩနီၪစံၭဝ့ၫ, မွဲနၥၭဎွံၫထၪ့",
			"50": "<sup>50</sup> တၭ,ဂဲထုၪ့ထဲၩ့ဘီၪ,အဝ့ၫဒၪကိၭနၧၩလီၫ.- အဝ့ၫ ခွံၬလၩ့ခွံၬအဖၭဘဲၩ့လုၬနီၪ, ဂဲထုၪ့လ့ၩစိၩဝ့ၫလၧ",
			"51": "<sup>51</sup> အအီၪလီၫ.- ယ့ၫၡုၬချဲၩ့ထၪ့ဆၧတၭ, စံၭအဝ့ၫနီၪ, မွဲ နၥၭအီၪလၧယမိမၩနၧၩ လၧဆၧနီၪလမံၩ့လဲၪ. ၦမ့ၬ ဘျီၪစံၭဆၧၫ့ဝ့ၫရၫဘိနံၫဧ့, ဘဲၫယမ့ၬၥၪယီၩ မိဖၩ့ထၪ့",
			"52": "<sup>52</sup> ထဲၩ့ဝ့ၫအၥိၭလီၫ.- ယ့ၫၡုၬစံၭအဝ့ၫ, ထဲၩ့ထဲၩ့ဘီၪ. နဆၧနဲၩနီၪ ထိးထဲၩ့တၩ့ထဲၩ့နၧၩယူၭလီၫ. အမ့ၬၥၪ ဖၩ့ထၪ့ထဲၩ့ဝ့ၫချဲၫ့မၬတၭ, ဖိၬထၪ့အခဲၫ့လၧဖၧၩ့ၥၭလီၫ."
		},
		"11": {
			"1": "<sup>1</sup> ထီးအဝ့ၫၥံၪလ့ၩထီၩ့ဘူၭလၧယရုစလံၫ့လၧဘ့ၭ ၥဖ့ၭ,ဒဲဘ့ၭၥနံၫလၧခိၪလီၩ့ အလဲအိၫ့အခၪ့ထံၭတၭ,",
			"2": "<sup>2</sup> အဝ့ၫဒၪအၪ့မၧၫ့လၩ့အထံၩအဖျဲ နံၫဂၩတၭ,- စံၭအ ဝ့ၫၥံၪ,လ့ၩလၧတဝၫ့အီၪတီၩ လၧနၥံၪအမ့ၬယၫဘီၪ. နၥံၪအ့ၪလ့ၩနုၬလၧအဖၧၩ့တၭ, နၥံၪမိဒၪဘၪကၥ့ၪ ယီၩ့ဖိၪလၧၦလထူၬဘၪဝ့ၫနးဂၩ, အီၪစၧၩ့ထၬအၥၭ ထီးနီၪလဒုၩလီၫ. ကွဲၪလၩ့ခွံၬတၭ, ဂဲၫထဲၩ့မီၩ့ဆံၭ.",
			"3": "<sup>3</sup> ၦလဂၩဂၩအ့ၪစံၭနၥံၪ, မွဲဘၪနီၫ လၧနၥံၪမၩဆၧဘဲၫ ယီၩလဲၪ.တၭစံၭနၥံၪဝ့ၫ, ကဆါန့ဘၪဝ့ၫနီၪအလး",
			"4": "<sup>4</sup> အီၪတၭ,ဆၧမိအၪ့မၧၫ့အဂဲၫချဲၫ့မၬလီၫ.- အဝ့ၫၥံၪ လ့ၩဝ့ၫတၭ, ဒၪဘၪလၧကၥ့ၪယီၩ့ အဖိၪဘၪစၧၩ့ထၬ အၥၭလၧ တရၫ့လၧခီၫ့ ထီးဖၧၩ့ၥၭထဲၩ့ဖၭအခၪ့ထံၭ",
			"5": "<sup>5</sup> တၭ,ကွဲၪလၩ့ဝ့ၫလီၫ.- ၦလၧအဆၧၫ့ထုၪ့ထီးနီၪလနၩ့ နၩ့စံၭအဝ့ၫၥံၪ, မွဲဘၪနီၫလၧနၥံၪကွဲၪလၩ့ခွံၬ ကၥ့ၪယီၩ့",
			"6": "<sup>6</sup> အဖိၪနီၪလဲၪ.- အဝ့ၫၥံၪစံၭဝ့ၫ, ဘဲၫယ့ၫၡုၬမၪလူၬဝ့ၫ",
			"7": "<sup>7</sup> အၥိၭနီၪတၭ,ၦဖ့ၪလၫ့ဝ့ၫလီၫ.- အဝ့ၫၥံၪဂဲၫထဲၩ့မီၩ့က ၥ့ၪယီၩ့အဖိၪ လၧယ့ၫၡုၬအအီၪတၭ, ဒၩလၩ့အကီၩ့",
			"8": "<sup>8</sup> အၥိၭလၧအလီၩ့တၭ, အဝ့ၫဒၪထူၬဝ့ၫလီၫ.- ၦအၪ ဂၩဒၩလၩ့အကီၩ့အၥိၭ, လၧဖၧၩ့ၥၭတၭ, အဂူၫဂၩလ ဖၪဖ့ၬလၩ့ၥံၪ့ထဲၩ့တၭ, လုလဲလၩ့ဝ့ၫလၧဖၧၩ့ၥၭလီၫ.",
			"9": "<sup>9</sup> ၦလ့ၩလၧယၫ, ဒဲၦလ့ၩလၧခဲၫ့လဖၪနီၪ, ကိၭၡၭထၪ့ ဆၧတၭး စံၭဝ့ၫ, ထိးထဲၩ့တၩ့ထဲၩ့ဘိၩ့နဲၪ့ယီၩဆံၭ. ၦလၧအဂဲၫလၧယွၩအမံၩ့လဂၩနီၪ, မွဲအဘၪဆၧဆိၪ",
			"10": "<sup>10</sup> ဂ့ၩဆံၭ.- ပဖါစဒၫဝံၭအဘၩ့အမုးလၧအဂဲၫဎလၧယွၩ အမံၩ့ၭနီၪ, မွဲအဘၪဆၧဆိၪဂ့ၩဆံၭ.ထိးထဲၩ့တၩ့ထဲၩ့",
			"11": "<sup>11</sup> ဘိၩ့နဲၪ့ယီၩလၧဆၧထီၫထုၬဆံၭ.- ယ့ၫၡုၬလ့ၩနုၬ ဝ့ၫလၧယရုစလံၫ့, ဒဲလၧဆၧလုအဂံၪ့ဖၧၩ့တၭ,ယိဝၬ ဝၬဆၧထီးအလူၬလီၫ. နၩရံၩထီးနီၪမွဲမုဂၪလၩ့တၭ, အဝ့ၫဒၪစဲၪ့ထၪ့ဝ့ၫလၧၦလဆံၫနံၫဂၩ အၥိၭလၧခီၫ့နီၪ နုၬလၧဘ့ၭၥနံၫအဖၧၩ့လီၫ.",
			"12": "<sup>12</sup> ကဲဂီၩလနံၩ,လၧအဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧဘ့ၭ",
			"13": "<sup>13</sup> ၥနံၫအဖၧၩ့နီၪ, အဝ့ၫဒၪၥၭဝံအၥၭလီၫ.- ဒၪစိၩချိၪ့ဒိၩ့ လထံၭအီၪလၧအလၪတၭ, ဘၪလဘၪမိဒၪဆၧအီၪ လၧအလီၩ့လမံၩ့မံၩ့တၭ, လ့ၩယိဝ့ၫ,အ့ၪလမွဲဘၪအ လၪနီၪဒၪဘၪဆၧနးမံၩ့အ့ၬ. အဂဲးဘဲၫယီၩ ချိၪ့ဒိၩ့",
			"14": "<sup>14</sup> ၥၪအမုအလၩလဘၪဒံၭဘၪလီၫ.- ယ့ၫၡုၬချဲၩ့ထၪ့ဆၧ တၭ,စံၭဝ့ၫ, ထီးယီၩလၧယၫလခီၫ မွဲပထီးအၪ့ဘၪ လၧၩ့နၥၪ နးဂၩနးဆိၭလဂ့ၩ. အထံၩအဖျဲၥံၪနါဂၧၫ့ ဝ့ၫလီၫ.",
			"15": "<sup>15</sup> အဝ့ၫၥံၪလ့ၩထီၩ့လၧယရုစလံၫ့တၭ,ယ့ၫၡုၬနုၬ ဝ့ၫလၧဆၧလုအဂံၪ့ဖၧၩ့တၭ, နၫ့ထၪ့ခွံၬၦဎွ့ၩဆၧ,ဒဲၦ အၪ့ဆၫဆၧလၧဆၧလုအဂံၪ့အဖၧၩ့တၭ, ချႃၬလၩ့ခွံၬ ၦအၪ့လဲၩစ့ၩအစပွဲၥံၪ, ဒဲၦအၪ့ဆၫထိၪလွံအလးဆၧၫ့",
			"16": "<sup>16</sup> နၩ့လဖၪလီၫ.- မွဲအဖ့ၪလၫ့ၦဆိၬဖၬဖၧၩ့ၥံၪ လၧဆၧ",
			"17": "<sup>17</sup> လုအဂံၪ့နီၪနးဂၩအ့ၬ.- ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဆၧတၭ, စံၭ အဝ့ၫၥံၪ,ဆၧကွ့ၭအၥၭး ယ ဂံၪ့ မိ ဘၪ ဆၧ ကိၭ ဝ့ၫ လၧ ဆၧ ဘၩ ဆိၪ ဖၪ အ ဂံၪ့ လၧ က ယဲ ၦ ကိၭ ဆၨၩ ဒ့ၭ အ ဂး မွဲ အ့ၬ ဧၪ. အ့ၪ မွဲ န ၥံၪ ဝ့ၫ ဒၪ ယီၩ, နၥံၪ မၩ ယူၭ ဝ့ၫ လၧ ၦ ထ မျၬ",
			"18": "<sup>18</sup> အဖၧၩ့ယူၭမၬကၨ.- ၦကွ့ၭလံၬဒဲၦလုဆၧအဒိၪၥံၪ နါဂၧၫ့ဝ့ၫတၭ, မိမၩၥံၫဘၪဝ့ၫဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ အၪ့ဎၬဝ့ၫလီၫ. အဝ့ၫၥံၪၥၭမဲၪအဝ့ၫဒၪတၭ,အဂဲးဘဲၫ ယီၩၦခမျၧးထီးအလူၬထီၫမံၫထီၫမၪလၧအဆၧၥီၪ့",
			"19": "<sup>19</sup> ဆၧၥၫ့အဂဲးလီၫ.- ထီးမုဂၪလၩ့နီၪ, အဝ့ၫဒၪစဲၪ့ထၪ့ ခွံၬဝ့ၫလၧဒိၩ့ဖၧၩ့လီၫ.",
			"20": "<sup>20</sup> ဆၧဖၩ့ထၪ့နီၪ အဝ့ၫၥံၪလ့ၩဖီၩ့ခွံၬအဘိၩ့ဘၭတၭ, ဒၪဘၪလၧချိၪ့ဒိၩ့လထံၭဎဲၫ့ထၬလူၬဝ့ၫ လၧအဝံလီၫ.",
			"21": "<sup>21</sup> စပံတၧၫနၪ့ထၪ့ထဲၩ့အၥၭတၭ, စံၭဝ့ၫ, ရၭဘံၫဧ့, ယိခွါ, ချိၪ့ဒိၩ့လၧနဆိၪအၧၩ့လထံၭနီၪ, ဎဲၫ့ထၬယူၭဝ့ၫယူၭ.",
			"22": "<sup>22</sup> ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧ, စံၭအဝ့ၫၥံၪ အီၪလၧဆၧနဲၩ လၧ",
			"23": "<sup>23</sup> ယွၩအဖၧၩ့ဆံၭ.- အဂဲးဘဲၫယီၩယလီၩဘၪနၥံၪတီၩ တီၩ ထီးဒၪၦလၧအစံၭခိၪလီၩ့ယီၩ, ၥုၭခွံၬနၥၭ တၭ, ခွံၬၡိၭခွံၬနၥၭလၧမၫဆမံၭအဖၧၩ့ဆံၭ. အၥၭ အ့ၪလဂံၩ့ဂၩ့ဘၪတၭ, အ့ၪနဲၩဝ့ၫလၧဆၧမိမၩအၥၭ ဘဲၫအစံၭဆၧအၥိၭနီၪ,ထီးဒၪအစံၭဆၧနီၪ, မိမၩအ",
			"24": "<sup>24</sup> ၥၭလၧအဂးလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယစံၭနၥံၪ ထီးဒၪနၥံၪအၪ့ကံၩ့ ဆၧလၧနၥံၪဘၩဆိၪဖၪဆၧအ ဖၧၩ့ထီးအလူၬနီၪ, နဲၩလၧနၥံၪမိန့ဘၪဝ့ၫတၭ, မွဲန ၥံၪမိန့ဘၪဆ့လီၫ.",
			"25": "<sup>25</sup> ထီးနၥံၪဆၧၫ့ထုၪ့ဘၩဆိၪဖၪဆၧနီၪ, ဘဲၫၥိၭနၥံၪ အဖါအီၪလၧမူၭခိၪ မိကွဲၪဖျါခွံၬနၥံၪအဆၧမၪတၭ, နၥံၪအ့ၪအီၪက့ၪဆၧအမၪ လၧၦလဂၩဂၩအလီၩ့လ",
			"26": "<sup>26</sup> မံၩ့မံၩ့နီၪ, ကွဲၪဖျါထဲၩ့အဝ့ၫဆံၭ.- နၥံၪအ့ၪလကွဲၪ ဖျါခွံၬဘၪတၭ, နၥံၪအဖါအီၪလၧမူၭခိၪနီၪ ကွဲၪဖျါခွံၬ နၥံၪအဆၧမၪဆ့အ့ၬ.",
			"27": "<sup>27</sup> အဝ့ၫၥံၪဂဲၫထီၩ့ဒီၭဝ့ၫလၧယရုစလံၫ့လီၫ. အဝ့ၫဒၪ စဲၪ့လဲးလီၩ့ဝ့ၫလၧဆၧလုအဂံၪ့ဖၧၩ့အဘိၩ့ဘၭနီၪ, ၦလုဆၧအဒိၪၥံၪ ဒဲၦကွ့ၭလံၬၥံၪဒဲၦၥုၪ့က့ၭၥၭၡါၥံၪ",
			"28": "<sup>28</sup> ဂဲၫလၧအအီၪတၭ,- အၪ့စၪ့ဝ့ၫ,မွဲနမၩဆၧယီၩလဖၪ လၧပလၫအစီၩ့အမၩ့လဂၩလဲၪ. ဘဲၫၥိၭနမိမၩဆၧ ယီၩလဖၪတၭ, မွဲပလၫဖ့ၪလၫ့ နစီၩ့နမၩ့ယီၩလဂၩ",
			"29": "<sup>29</sup> လဲၪ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫ, ယမိအၪ့စၪ့ နၥံၪဆၧနးမံၩ့ဆ့လီၫ. လီၩဘၪယၧၩတၭ, ယမၩဆၧ ယီၩလဖၪ လၧပလၫအစီၩ့အမၩ့လဂၩလဲၪနီၪ, ယမိ",
			"30": "<sup>30</sup> လီၩဘၪနၥံၪဆ့လီၫ.- စယီဟၫ့အဘၭတံၫဇၫ့နီၪ, မွဲ အဂဲၫလၧမူၭခိၪလခီၫ, မွဲအဂဲၫလၧၦၡၩလခီၫလဲၪ.",
			"31": "<sup>31</sup> လီၩဘၪယၧၩနးထံၪဆံၭ.- အဝ့ၫၥံၪကိၪ့ထၪ့လိၬအၥၭ တၭ,စံၭဝ့ၫဒၪ, ပအ့ၪစံၭလၧမူၭခိၪနီၪ, အဝ့ၫမိစံၭပၧၩ, အ့ၪမွဲဘဲၫနီၪတၭ, မွဲဘၪနီၫလၧနၥံၪလနဲၩဘၪလဲၪ.",
			"32": "<sup>32</sup> မွဲလါနၫ့တၭ, ပအ့ၪစံၭလၧၦၡၩနီၪ ပၥၭမဲၪၦခမျၧးလီၫ. အဂဲးဘဲၫယီၩၦထီးအလူၬအီၪက့ၪစယီဟၫ့လၧ",
			"33": "<sup>33</sup> မီၪလၩ့ထံးလၩ့ဆ့ၭလီၫ.- အဝ့ၫၥံၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭယ့ၫၡုၬ,ပၥ့ၪယၫအ့ၬ. ယ့ၫၡုၬ ချဲၩ့ဆၧၫ့ဆၧ တၭ,စံၭအဝ့ၫၥံၪ,ယဝ့ၫဒၪယီၩ, ယမၩဆၧလဖၪယီၩ လၧပလၫအစီၩ့အမၩ့လဂၩလဲၪနီၪ, ယလီၩဘၪနၥံၪ ဆ့အ့ၬ."
		},
		"12": {
			"1": "<sup>1</sup> အဝ့ၫဒၪလီၩဘၪအဝ့ၫၥံၪ လၧဆၧချဲၩ့အဒီၩ့တၭး ၦလဂၩၥုၪ့လၩ့စဘံၭမု အလးလလး, မၩဖီၩ့ထၬဝ့ၫ တၭ,ခုၪ့လၩ့ဆၧဖၧၩ့လၧစဘံၭထံၫအဂးတၭ, မၩထၪ့ တၨၭခိၭဆၧလဖျိၪ့တၭ, ဖ့ၪလၫ့ဝ့ၫလၧၦမၩကၩအစူၪ",
			"2": "<sup>2</sup> ဖၧၩ့နီၪ,စဲၪ့ထၪ့ဝ့ၫလၧထံၫယဲၩ့ခးယဲၩ့လီၫ.- ထီးအ ဆၧၫ့အထီဘၪတၭ, ဘဲၫၥိၭအမိန့ဘၪစဘံၭအၥၪလၧ ၦမၩကၩအစူၪဖၧၩ့နီၪ, အၪ့မၧၫ့အဎီးအၡၩလဂၩ",
			"3": "<sup>3</sup> လ့ၩလၧၦမၩကၩအအီၪလီၫ.- အဝ့ၫၥံၪဖီၪ့န့ဝ့ၫ,ဒိၪဝ့ၫ",
			"4": "<sup>4</sup> တၭ,ကွဲၪဖျါထဲၩ့ဝ့ၫန့ၫအနၫ့ဆါပျီၩပျီၩလီၫ.- အဝ့ၫဒၪ အၪ့မၧၫ့လၩ့ဒီၭ အဎီးအၡၩလၧအဂူၫဂၩလဂၩ လၧအ ဝ့ၫၥံၪအအီၪတၭ, အဝ့ၫၥံၪခွံၬဝ့ၫလၧလိးထီးအနုၬလၩ့ လၧအခိၪဎွံၪတၭ, မၩကြၩ့ထမးဝ့ၫနီၪ, ကွဲၪဖျါထဲၩ့ဝ့ၫ",
			"5": "<sup>5</sup> လီၫ.- အဝ့ၫဒၪအၪ့မၧၫ့လၩ့ဒီၭ လၧအဂူၫဂၩလဂၩ တၭ,အဝ့ၫၥံၪမၩၥံၫအဝ့ၫနီၪ, ဒဲအဂူၫဂၩအၪဂၩ,ဒိၪဝ့ၫ",
			"6": "<sup>6</sup> ထးဝ့ၫလနၩ့, မၩၥံၫဝ့ၫလနၩ့လီၫ.- မၩအၥၭဘဲၫနီၪ တၭ,အဖိၪခွၫၥၭဘီၩ့လဂၩဎးအီၪဒံၭတၭ, အၪ့မၧၫ့ လၩ့အဝ့ၫနီၪလၧခဲၫ့ထုၬလဖၧၫ့ လၧအဝ့ၫၥံၪအအီၪ တၭ,စံၭဝ့ၫဒၪ, အဝ့ၫၥံၪမိယူၭမိယၪ့ယဖိၪခွၫလီၫ.",
			"7": "<sup>7</sup> မွဲလါနၫ့တၭ, ၦမၩကၩလဖၪနီၪစံၭလိၬအၥၭ,အယီၩ မွဲၦလၧအမိန့ၥၫဆၧလဂၩနီၪ, ဂဲၫမၩၥံၫၡီၩ့အဝ့ၫနီၪ ဘီၪ.ဆၧဖ့ၪၥၫနီၪမိကဲၪထဲၩ့ပဆၧလီၫ.-",
			"8": "<sup>8</sup> အဝ့ၫၥံၪဖီၪ့ ထၬမၩၥံၫအဝ့ၫနီၪတၭ, ခွံၬၡိၭခွံၬဝ့ၫလၧစဘံၭလး",
			"9": "<sup>9</sup> အချိၫ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ,စဘံၭလးအကဆါ မိမၩဝ့ၫဘဲၫၥ့ၪလဲၪ. မွဲအမိဂဲၫမၩဂၭဂီၩ့ခွံၬၦမၩကၩ လဖၪနီၪတၭ, မိဖ့ၪလၫ့စဘံၭအလးလၧၦဂူၫဂၩလီၫ.",
			"10": "<sup>10</sup> ဆၧကွ့ၭအၥၭယီၩ မွဲနၥံၪလဖီဘၪဒံၭဘၪဧၪ. လိးလၧၦမၩထၪ့ဂံၪ့လဖၪခွံၬၡိၭဝ့ၫလဖျိၪ့နီၪ, ကဲၪထၪ့ယူၭဝ့ၫဆၧအနိၪ့အခိၪစီၪ့ယူၭ.",
			"11": "<sup>11</sup> ဆၧယီၩကဲၪထၪ့ဝ့ၫမွဲလၧယွၩ ဒဲလၩ့လၭလၧပမ့ၬ ယၫလီၫ.",
			"12": "<sup>12</sup> အဝ့ၫၥံၪအၪ့ဎၬဖီၪ့ထၬဝ့ၫတၭ, ၥၭမဲၪၦခမျၧးလီၫ. အဂဲးဘဲၫယီၩ မွဲအၥ့ၪယၫဝ့ၫ လၧအချဲၩ့ဒီၩ့လၩ့ဆၧ ယီၩထၫ့ဒုၪဒၩအဝ့ၫၥံၪတၭ, မွဲအစဲၪ့ထၪ့ခွံၬဝ့ၫလၧအ အီၪတၭ, အဝ့ၫၥံၪထဲၩ့ထဲၩ့ဝ့ၫလီၫ.",
			"13": "<sup>13</sup> အဝ့ၫၥံၪနီၪ, ဘဲၫၥိၭအမိမၩဘံၪဘူၪအဆၧချဲၩ့တၭ, အၪ့မၧၫ့လၩ့ၦဖၫရစံၫ, ဒဲၦဟရိဒအၫ့လနၩ့နၩ့ လ့ၩ",
			"14": "<sup>14</sup> လၧအအီၪလီၫ.- ထီးအဝ့ၫၥံၪထီၩ့ဝ့ၫနီၪ, စံၭဝ့ၫ,ဆရၫ ဧ့,ၦၥ့ၪယၫလၧနမွဲဆၧအမွဲအတီၩတၭ, နလီၩ့ၦၡၩအ ၥၭနးဂၩအ့ၬ. အဂဲးဘဲၫယီၩနယိမ့ၬၦၡၩအ့ၬ. နၥီၪ့ လိၪဆၧလၧယွၩအဖၧၩ့ၥၭတီၩတီၩလီၫ. ဆၧဖ့ၪလၫ့",
			"15": "<sup>15</sup> အခီၫ့လၧစံစၧၫနီၪ, မွဲအဂ့ၩ,မွဲလဂ့ၩဘၪလဲၪ.- မွဲပ ကြၨၭဖ့ၪလၫ့, ပလကြၨၭဖ့ၪလၫ့ဘၪလဲၪ. ယ့ၫၡုၬၥ့ၪ ယၫလၧအဝ့ၫၥံၪ အၪ့လီၫဆၧတၭ, စံၭဝ့ၫ, မွဲဘၪနီၫ လၧနၥံၪကျဲၩ့ဖစီၩ့ယၧၩလဲၪ. ဂဲၫဆိၬန့ယၧၩ လၧဒန့",
			"16": "<sup>16</sup> ရံၫနးဘံၪ့ဘဲၫၥိၭယမိဒၪဘၪဘီၪ.- အဝ့ၫၥံၪဂဲၫဆိၬစိၩ ဝ့ၫတၭ, အဝ့ၫဒၪအၪ့စၪ့ဝ့ၫမွဲပလၫအခံးအဂၩ့, ဒဲမွဲပ လၫအဆၧကွ့ၭအၥၭအီၪ လၧအလီၩ့ယီၩလဂၩလဲၪ.",
			"17": "<sup>17</sup> အဝ့ၫၥံၪစံၭဆၧၫ့ဝ့ၫဒၪ, မွဲစံစၧၫအဆၧလီၫ.- ယ့ၫၡုၬ ချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫၥံၪ,ဖ့ၪလၫ့ထဲၩ့စံစၧၫလၧ စံစၧၫအဆၧတၭ, ဒဲယွၩလၧယွၩအဆၧဆံၭ.အဝ့ၫ ၥံၪထီၫမံၫထီၫမၪလၧအဂဲးလီၫ.",
			"18": "<sup>18</sup> ၦစၭဒုၫစံၫလၧအစံၭဝ့ၫ ဆၧဂဲထုၪ့ထဲၩ့လၥ့ၪဘၪနီၪ",
			"19": "<sup>19</sup> ဂဲၫလၧအအီၪတၭ,အၪ့စၪ့ဝ့ၫ,စံၭဝ့ၫဒၪ,- ဆရၫဧ့, စမိစ့ၭကွ့ၭန့ပၧၩ,လၧၦလဂၩဂၩအထၧၫ့ဖုဝဲ အ့ၪ ၥံၫဒၪအမၫတၭ, အဖိၪလအီၪလၩ့ထးဘၪနီၪ, မွဲအ ထၧၫ့ဖုဝဲဘၪမၩန့အမၫတၭ, မၩအီၪထၪ့န့အထၧၫ့ဖုဝဲ",
			"20": "<sup>20</sup> အချံၫအၥၪလီၫ.- အနီၪတၭ, ၦထၧၫ့ဖုဝဲခွၫအီၪဝ့ၫနွ့ၫ ဂၩလီၫ.အခၪ့ထံၭလဂၩန့အမၫနီၪ, ၥံၫဝ့ၫတၭ,",
			"21": "<sup>21</sup> အချံၫအၥၪအီၪလၩ့ထးဝ့ၫအ့ၬ.- ၦနံၫဂၩ,လဂၩနီၪ, မၩန့အမၫနီၪၥံၫဝ့ၫတၭ, အချံၫအၥၪအီၪလၩ့ထးဝ့ၫဆ့",
			"22": "<sup>22</sup> အ့ၬ.ဘဲၫနီၪအၥိၭ,ၥၧၫ့ဂၩလဂၩဆ့လီၫ.- ၦနွ့ၫဂၩ မၩန့ၦမုၪနီၪတၭ, အချံၫအၥၪအီၪလၩ့ထးဝ့ၫအ့ၬ.လၧ",
			"23": "<sup>23</sup> ခဲၫ့ထုၬနီၪ, ၦမုၪၥံၫဝ့ၫဆ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, လၧဆၧဂဲထုၪ့ထဲၩ့အဖၧၩ့ထီးအဝ့ၫၥံၪဂဲထုၪ့နီၪ, မွဲအမိ ကဲၪဝ့ၫၦလဖၪနီၪ,အမၫဂၩဂၩလဲၪ. အဂဲးဘဲၫယီၩၦ",
			"24": "<sup>24</sup> နွ့ၫဂၩန့အမၫလၧအဝ့ၫနီၪလီၫ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧ တၭ,စံၭဝ့ၫ, နၥံၪလၥ့ၪယၫဘၪ ဆၧကွ့ၭအၥၭမွဲဂ့ၩ, ယွၩအစီၩ့အမၩ့မွဲဂ့ၩတၭ, နၥံၪနဲၩမၪဆၧမွဲအ့ၬဧၪ.",
			"25": "<sup>25</sup> အဂဲးဘဲၫယီၩ ထီးအဂဲထုၪ့ထဲၩ့လၧဆၧၥံၫအဖၧၩ့နီၪ, အီၪဎုၬလိၬအၥၭမွဲဂ့ၩ, ဘၪဆၧဒုၭအီၪဎုၬလိၬအၥၭမွဲ ဂ့ၩ,အီၪလၧၩ့အ့ၬ. မွဲအမၩအၥၭဘဲၫအၥီၫ့လၧမူၭ",
			"26": "<sup>26</sup> ခိၪအၥိၭနီၪလီၫ.- ဆၧလၧၦၥံၫမိဂဲထုၪ့ထဲၩ့အဂဲးနီၪ, လၧစမိစ့ၭအလံၬဖၧၩ့ ထီးယွၩလီၩဘၪဝ့ၫလၧဆၧၡိၬ ကျၩနီၪမွဲနၥံၪလဖီဘၪဧၪ. ဆၧလၧယၧၩယီၩ,ယမွဲ စ အၫ ဘြ ဟၫ့ အ ယွၩ, ဒဲ စ အံ စၭ အ ယွၩ,",
			"27": "<sup>27</sup> ဒဲ စ ယၫ ကူၭ အ ယွၩ လီၫ.- ယွၩနီၪလမွဲဘၪၦၥံၫ အယွၩတၭ,မွဲၦမၧၫ့အယွၩလီၫ. မၩအၥၭဘဲၫနီၪတၭ, နၥံၪနဲၩမၪဆၧယိၬမၬလီၫ.",
			"28": "<sup>28</sup> အဝ့ၫၥံၪချဲၩ့လိၬအၥၭနီၪ, ၦကွ့ၭလံၬလဂၩ နါဂၧၫ့ အဝ့ၫၥံၪ ကၩ့ကၩလိၬအၥၭတၭ, ၥ့ၪယၫဝ့ၫလၧအချဲၩ့ ဆၧၫ့ဆၧလၧအဘၪတၭ, လ့ၩစိၩဝ့ၫလၧအအီၪနီၪ, အၪ့စၪ့ဝ့ၫ, လၧဆၧမၪလူၬထီးအလူၬအကျၩနီၪအ",
			"29": "<sup>29</sup> ခၪ့ထံၭမွဲထံၪထံၪလဲၪ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဝ့ၫ,လၧဆၧ မၪလူၬထီးအလူၬအကျၩနီၪ, အခၪ့ထံၭ စံၭဝ့ၫဒၪ, ၦ အံၫ စ ရ့ လၭ ဖိၪ ၥံၪ ဧ့, ခိၭ နၪ ဆံၭ.ယွၩပကဆါ",
			"30": "<sup>30</sup> နီၪ, မွဲကဆါလဂၩဎးလီၫ.- အဲၪယွၩနကဆါလၧ နၥၭထၧၫ့ဖျိၪ့ယၫ, ဒဲလၧနၥၭၡီၩ့ထီးအလူၬ,ဒဲလၧ နၥၭကိၪ့ၥ့ၪထီးအလူၬ, ဒဲလၧနဂဲးနဘၭထီးအလူၬဆံၭ.",
			"31": "<sup>31</sup> ဆၧယီၩမွဲဆၧမၪလူၬအခၪ့ထံၭလထံၪလီၫ.- နံၫထံၪလ ထံၪနီၪ, မွဲအလၩ့ဂၬအဝ့ၫနီၪလီၫ. အဲၪ ၦ လၧ န နဲၩ့ထံၭ ဘဲၫ န နၫ့ ဆါ ဒၪ န ဝ့ၫ အ ၥိၭ ဆံၭ. ဆၧမၪလူၬအဂူၫဂၩ ဒိၪနဲၪ့အဝ့ၫၥံၪနီၪ, အီၪအ့ၬ.",
			"32": "<sup>32</sup> ၦကွ့ၭလံၬလဂၩ, စံၭဝ့ၫ,ဂ့ၩမၬလီၫ. ဆရၫဧ့,နစံၭ ယူၭဆၧမွဲဆၧတီၩယူၭလီၫ. အဂဲးဘဲၫယီၩယွၩအီၪ လဂၩဎးလီၫ. လၧအဝ့ၫနီၪအမ့ၬယၫ အဂူၫဂၩအီၪ",
			"33": "<sup>33</sup> အ့ၬ.-ဆၧအဲၪဝ့ၫလၧၥၭထၧၫ့ဖျိၪ့ယၫ, ဒဲလၧၥၭကိၪ့ ၥ့ၪထီးအလူၬ,ဒဲလၧၥၭၡီၩ့ထီးအလူၬ, ဒဲလၧအဂဲးအ ဘၭထီးအလူၬတၭ,ဆၧအဲၪၦလၧအနဲၩ့ထံၭနီၪ ဘဲၫအ နၫ့ဆါဒၪဝ့ၫအၥိၭ, မွဲဂ့ၩနဲၪ့ဒံၭအဆၧလုဆူၭခဲၩ,ဒဲ",
			"34": "<sup>34</sup> ဆၧလုထီးအလူၬဒံၭလီၫ.- ယ့ၫၡုၬၥ့ၪယၫလၧအဝ့ၫ နီၪချဲၩ့ဆၧလၧအကိၪ့ၥ့ၪကိၪ့ဘၪတၭ, လီၩဘၪဝ့ၫ,န ဝ့ၫဒၪယီၩ, နယဲၩ့လၧယွၩအဘၩ့အမုးအ့ၬ. လၧခဲၫ့ ထဲၩ့တၭ,ၦအၪ့စၪ့အဆၧဘုၪ့လၧၩ့နးဂၩအ့ၬ.",
			"35": "<sup>35</sup> ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧတၭ, ထီးအၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဆၧ လၧဆၧလုအဂံၪ့ဖၧၩ့နီၪစံၭဝ့ၫဒၪ, ၦကွ့ၭလံၬၥံၪစံၭဝ့ၫ,",
			"36": "<sup>36</sup> ဎရံၬနီၪ, မွဲစဒၫဝံၭအဖိၪခွၫဘဲၫၥ့ၪလဲၪ.- အဂဲးဘဲၫ ယီၩစဒၫဝံၭအနၫ့ဆါဒၪဝ့ၫ လၧၥၭမုဆံၫ့ဎံၪအဖၧၩ့ စံၭဝ့ၫဒၪ, ကဆါစံၭယကဆါလဂၩ, ဆၧၫ့နၩ့လၧယစူၪထွ့ၪ, ထီးယအီၪက့ၪနဒုၪနဒၩၥံၪ လၧယခၪ့ယဲးလၩ့အ လးဆံၭ.",
			"37": "<sup>37</sup> မၩအၥၭဘဲၫနီၪတၭ, စဒၫဝံၭအနၫ့ဆါဒၪဝ့ၫနီၪ,ကိၭ ဝ့ၫလၧကဆါတၭ, မိမွဲအဖိၪခွၫဘဲၫၥ့ၪလဲၪ. ၦခမျၧး ဖၭဒိၪခိၭနၪဝ့ၫမုၬမၬလီၫ.",
			"38": "<sup>38</sup> အဝ့ၫဒၪစံၭၦလဖၪနီၪ လၧအဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့, ထီးလၩ့နၥံၪအၥၭလၧၦကွ့ၭလံၬၥံၪဆံၭ.ၦလဖၪ နီၪ,အဲၪဒိၭဝ့ၫလၧအလ့ၩဆၧနီၪ ၥိၭဆဲၫ့ထီၫထီၫလ့ၬ,",
			"39": "<sup>39</sup> ဒဲလၧၦချဲၩ့ဒုၪ့ဝ့ၫလၧဖၠၫဖၧၩ့း- ဒဲလးဆၧၫ့နၩ့လၧအ ဂ့ၩထုၬလၧၥရိၬဖၧၩ့, ဒဲလးအဂ့ၩလၧဆၧဘိၪ့ဖၧၩ့",
			"40": "<sup>40</sup> နီၪး- မွဲၦလၧအအၪ့ယုလၩ့ခွံၬၦမုၪမဲၫအဂံၪ့ၥံၪတၭ, ဘဲၫဆၧမိဖျီၪထၪ့လၧအဂးနီၪ, အဝ့ၫၥံၪဘၩဆိၪဖၪ ဆၧထီၫထီၫလ့ၬလီၫ. အခိးမွဲအဝ့ၫၥံၪ မိဘၪဆၧစ့ၩရၫ့ နၭထၪ့လခီၫဒံၭလီၫ.",
			"41": "<sup>41</sup> ယ့ၫၡုၬဆၧၫ့နၩ့လၧစ့ၩအီၪကီၪ့အလး အမ့ၬ ယၫတၭ,ယိဝ့ၫလၧၦခမျၧးခွံၬလၩ့ဆၧ လၧစ့ၩအီၪကီၪ့ အလးအဖၧၩ့လီၫ. ၦၥထံၫအၪဂၩခွံၬလၩ့အၪအၪလ့ၬ",
			"42": "<sup>42</sup> လီၫ.- ၦမုၪမဲၪအၡၪ့လဂၩဂဲၫတၭ, ခွံၬလၩ့ကၭနံၫ",
			"43": "<sup>43</sup> ဘံၪ့လၧအကဲၪထၪ့ဝ့ၫထီးလဘံၪ့လီၫ.- အဝ့ၫဒၪကိၭ န့အထံၩအဖျဲၥံၪတၭ, စံၭဝ့ၫ, ယလီၩဘၪနၥံၪတီၩ တီၩယီၩ,ၦလၧအခွံၬလၩ့ဆၧ လၧဆၧအီၪက့ၪကီၪ့ အလးနီၪ, ၦမုၪမဲၪအၡၪ့လဂၩယီၩ ခွံၬလၩ့ယူၭ ဆၧ",
			"44": "<sup>44</sup> အၪနဲၪ့အဝ့ၫၥံၪကိၭဂၩဒ့ၭယူၭ.- အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪနီၪ,ကိၭဂၩဒ့ၭခွံၬလၩ့ဝ့ၫ လၧအဆၧဎွ့ၩလၨၪ ခွံၬလၩ့ဘျဲၪလီၫ. အ့ၪမွဲၦမုၪ လဂၩယီၩ, လၧအဆၧ လလၧၫ့လဎွ့ၩဘၪအဖၧၩ့ လၧအဘုၪအၪ့ဘုၪအီၩ အ ၥၭထီးအလူၬနီၪ, ခွံၬလၩ့ဝ့ၫ ကယဲအဆၧအီၪကိၭအ မံၩ့ဒ့ၭလီၫ."
		},
		"13": {
			"1": "<sup>1</sup> ထီးအစဲၪ့ထၪ့ခွံၬလၧဆၧလုအဂံၪ့ဖၧၩ့တၭ, အထံၩ အဖျဲလဂၩစံၭဝ့ၫ, ဆရၫဧ့,ဆၧလၧလိးအဖျိၪ့လဖၪ, မွဲ လိးဘဲၫၥ့ၪလဲၪနီၪ, ယိခွါဘီၪ, ဒဲဂံၪ့အဖျိၪ့လဖၪမွဲ ဂံၪ့",
			"2": "<sup>2</sup> ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪၬ- ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧတၭ, လီၩဘၪဝ့ၫ, ဆၧလၧဂံၪ့အဖျိၪ့ဖၭဒိၪလဖၪနီၪ, မွဲနၥံၪ ဒၪဘၪဆ့ဧၪ. လိးလၧအဒၩ့ဒိၭလိၬအၥၭလဖၪယီၩ, ဆၧလမၩလၩ့ဎီးဘၪနီၪ, မိအီၪလၩ့ထးဘၪနးဖျိၪ့ အ့ၬ.",
			"3": "<sup>3</sup> ထီးအဆၧၫ့နၩ့ဝ့ၫ လၧခိၪလီၩ့အလဲအိၫ့အလီၩ့အီၪ တီၩလၧဆၧလုအဂံၪ့တၭ, စပံတၧၫဒဲစယ့မံၭ,ဒဲစယီ ဟၫ့, ဒဲစအၫ့ဒူၫၥံၪအၪ့စၪ့ဝ့ၫ လၧဆၧအီၪၥူၪအလး",
			"4": "<sup>4</sup> လီၫ.- ဆၧနီၪလဖၪဆံၭယံၬခိၬမိမၩအၥၭလဲၪ. ဆၧနီၪ လဖၪထီးအလူၬ ထီးအမိလၧၫ့ထၪ့ဎွ့ၩထၪ့နီၪမွဲဆၧနီၪ လၩ့လၭမိအီၪလမံၩ့လဲၪ, လီၩဘၪပၧၩနးထံၪဘီၪ.",
			"5": "<sup>5</sup> ယ့ၫၡုၬချဲၩ့ထၪ့ၥၫ့ဝ့ၫတၭ, စံၭအဝ့ၫၥံၪ, ထီးလၩ့နၥံၪ",
			"6": "<sup>6</sup> အၥၭဘဲၫၥိၭ ၦထီးအၪ့လီၫန့နၥံၪနးဂၩလဂ့ၩ.- အ ဂဲးဘဲၫယီၩၦအၪဂၩမိဂဲၫလၧယမံၩ့တၭ, မိစံၭဝ့ၫလၧ ယဝ့ၫဒၪယီၩ ယမွဲအဝ့ၫတၭ, မိအၪ့လီၫန့ၦအၪဂၩ",
			"7": "<sup>7</sup> လီၫ.- ထီးနၥံၪအ့ၪနါဂၧၫ့ဘၪဆၧဒုၭၥုၭဒုၭၥ့ၪအဂဲး, ဒဲ ဆၧဒုၭၥုၭဒုၭၥ့ၪအပရၧၫ့နီၪ, ထီးၥုၪ့ခိၥၭဝီၩလဂ့ၩ. အဂဲးဘဲၫယီၩဆၧနီၪလဖၪ ဘၪမၩအၥၭလီၫ. မွဲလါ",
			"8": "<sup>8</sup> နၫ့ဘိၩ,မွဲဆၧအထုၬဒံၭအ့ၬ.- အဂဲးဘဲၫယီၩၦၡၩလ ဆၨၩလၧလဆၨၩ ဘၩ့မုးလၧလဘၩ့မုး, မိထၫ့ဒုၪဒၩ လိၬအၥၭလီၫ. ဂၪ့ခိၪမိဝၭဝ့ၫလၧအံၩလစီၪ့ လၧအိၩ လစီၪ့တၭ, ဆၧၥၭဝံလၩ့ဒိၩ, ဒဲဆၧခိဆၧဝီၩလဖၪမိ အီၪထၪ့လီၫ. ဆၧနီၪလဖၪ မွဲဆၧၡၪ့ဆၧနၭအခၪ့ထံၭ လီၫ.",
			"9": "<sup>9</sup> အ့ၪမွဲနၥံၪဝ့ၫဒၪယီၩ ထီးလၩ့နၥံၪအၥၭဆံၭ. အဂဲး ဘဲၫယီၩအဝ့ၫၥံၪမိဖ့ၪလၫ့နၥံၪလၧၦအီၪကီၪ့စ့ၩရၫ့ခွး အစူၪဖၧၩ့တၭ, နၥံၪမိဘၪဆၧထးနၥံၪလၧၥရိၬဖၧၩ့ တၭ,ဘဲၫၥိၭနၥံၪမိကဲၪလၧၦထိးအၥၭ လၧအမ့ၬယၫ နီၪ,နၥံၪမိဆၧၫ့ထုၪ့ လၧၦဒိၪဖၭဒိၪ, ဒဲၦဘိၪ့ၦဎွၩလ",
			"10": "<sup>10</sup> ဖၪအမ့ၬယၫလၧယကၠီၩ့လီၫ.- ဆၧၥၭထိၬအပရၧၫ့နီၪ, မိဘၪဆၧလီၩလၩ့လၬလၩ့ဆိၫဝ့ၫလၧ ၦၡၩကိၭဆၨၩ",
			"11": "<sup>11</sup> ဒ့ၭလီၫ.- ထီးၦမီၩ့ဖ့ၪလၫ့ခွံၬနၥံၪတၭ, မွဲနၥံၪမိချဲၩ့ ဆၧၫ့ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, ထီးကိၪ့ဝဲၩလဂ့ၩ,ထီး ဆီၫ့မီၪ့လဂ့ၩး အ့ၪမွဲထီးအနၩရံၩနီၪ,ဘဲၫဆၧမိဖ့ၪချဲၩ့ နၥံၪအၥိၭတၭ,ချဲၩ့ဆၧနီၪဆံၭ. အဂဲးဘဲၫယီၩ မွဲနၥံၪ",
			"12": "<sup>12</sup> ချဲၩ့အ့ၬ,မွဲၥၭမုဆံၫ့ဎံၪလီၫ.- ၦထၧၫ့ဖုဝဲခွၫ မိဖ့ၪလၫ့ ခွံၬထၧၫ့ဖုဝဲခွၫလၧဆၧၥံၫ, ဒဲဖါအဖိၪဆ့တၭ, ဖိၪလ ဖၪမိထၫ့ဒုၪဒၩအမိအဖါတၭ, မိဒုၭၥံၫအဝ့ၫၥံၪလီၫ.",
			"13": "<sup>13</sup> နၥံၪမိဘၪဆၧမ့ၬလဲၩၥၭဂဲၫ့ လၧၦၡၩထီးအလူၬလၧ ယမံၩ့အကၠီၩ့လီၫ. အ့ၪမွဲၦလၧအဂုးအခၧၫ့ဝ့ၫထီးအ ထုၬနီၪ, မိထီၩ့လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫလီၫ.",
			"14": "<sup>14</sup> ထီးနၥံၪဒၪဘၪဆၧစံၪစၪဘၪဆဲၫ့ လၧဆၧမၩယူဎလၧ မီၪစဒၫ့နအ့လၭ ချဲၩ့ဝ့ၫလၧအဂဲးၭ ဆၧၫ့ထုၪ့ထီးအ လကြၨၭဘၪအလးတၭ, (ၦလၧအဖီဆၧနီၪမွဲအနၪၥ့ၪ ဆံၭ.) ထီးနီၪလဖၧၫ့ၦအီၪဝ့ၫ လၧခးယုဒၫလဖၪနီၪ,",
			"15": "<sup>15</sup> မွဲအစဲၪ့ထၪ့လၧခိၪလီၩ့ထိၩ့ချိၬဆံၭ.- ၦအီၪလၧဂံၪ့ ခိၪနီၪ,မွဲအထီးစဲၪ့လၩ့လၧဂံၪ့ဖၧၩ့လဂ့ၩ, မွဲအထီးထဲၩ့ နုၬလၧအဒူၭဖၧၩ့ ဘဲၫၥိၭအမိမၩန့ဘၪအဆၧဖိၪဆၧ",
			"16": "<sup>16</sup> လံၩလမံၩ့မံၩ့လဂ့ၩ.- ၦအီၪဝ့ၫ, လၧဆံၬဖၧၩ့ဎုၭဖၧၩ့ နီၪ,ဘဲၫၥိၭအမိမၩန့ဘၪအကီၩ့အၥိၭတၭ, မွဲအထီး",
			"17": "<sup>17</sup> ထဲၩ့ကဒၩထဲၩ့လၧအလးခဲၫ့လဂ့ၩ,- ၦလၧအဒၧၩ့ဒဲၦ လၧအဖိၪအၪ့နုဝ့ၫလဖၪလၧမုနံၩလဖၪနီၪ, ဘၪဆၧအ",
			"18": "<sup>18</sup> ၡၪ့လီၫ.- ဘဲၫၥိၭနၥံၪစဲၪ့ဆၧနီၪ,ထီးဘၪလၧဆၧဂီးအ",
			"19": "<sup>19</sup> ထီလဂ့ၩတၭ, ဘၩဆိၪဖၪဆၧဆံၭ.-အဂဲးဘဲၫယီၩ ဆၧလၧမုနံၩလဖၪနီၪ, ဆၧနၭဆၧၡၪ့မိမၩအၥၭလီၫ. လၧဆၧကဲၪထၪ့ခီၫ လၧယွၩမၩကဲၪထၪ့ဝ့ၫ အခၪ့ထံၭ ခီးဘိၩ့နဲၪ့ယီၩ, ဆၧနၭဆၧၡၪ့မၩအၥၭဘဲၫနီၪနးဆိၭ အ့ၬ.လၧယၫလခီၫ ဆၧမိမၩလၧၩ့အၥၭ နးဆိၭဆ့",
			"20": "<sup>20</sup> အ့ၬ.- ဆၧလၧမုနံၩလဖၪနီၪ, ယွၩအ့ၪလမၩၡၩလၩ့ ဘၪတၭ, ဆၧဖံၭဆၧယၪထီၩ့လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့ နးမံၩ့အ့ၬ. မွဲလါနၫ့တၭ, ယွၩမၩၡၩလၩ့ဆၧအမုနံၩ",
			"21": "<sup>21</sup> နီၪလၧၦဘၪဆၧရွံန့ဝ့ၫလဖၪအကၠီၩ့လီၫ.- ထီးနီၪလ ဖၧၫ့ၦလဂၩဂၩ အ့ၪစံၭနၥံၪ, ယိခွါ,ဎရံၬအီၪထီး ယီၩမွဲဂ့ၩ, ယိခွါ,အီၪထီးနီၪမွဲဂ့ၩ, ထီးနဲၩလဂ့ၩ,",
			"22": "<sup>22</sup> အဂဲးဘဲၫယီၩ ဎရံၬအဘျၪ,ဒဲမီၪအဘျၪလဖၪမိအီၪထၪ့ ဝ့ၫတၭ, မၩအ့ၪၥ့ၪတၭ, မိဒုၭနဲၪဆၧလၩ့လိလၩ့လၭ လဖၪထီးအအၪ့လီၫန့ ၦလၧအဘၪဆၧရွံန့ဝ့ၫလဖၪ",
			"23": "<sup>23</sup> ဒၪလ့ၬလီၫ.- အ့ၪမွဲနၥံၪဝ့ၫဒၪယီၩ, ထီးလၩ့နၥံၪအၥၭ ဆံၭ.ယိခွါ, ဆၧနီၪလဖၪယလီၩဘၪဝဲၩနၥံၪထီး အလူၬလီၫ.",
			"24": "<sup>24</sup> မွဲလါနၫ့ဘိၩ,ဆၧလၧမုနံၩလဖၪနီၪ, လၧဆၧၡၪ့ဆၧ နၭဖီၩ့ခွံၬအလးခဲၫ့တၭ,မုမိခံၭဝ့ၫတၭ,လၩမိဖ့ၪလၫ့",
			"25": "<sup>25</sup> အဆၧဖၩ့ဆ့အ့ၬ.- ၡၪလၧမူၭခိၪမိလၩ့ထ့ၬခွံၬဝ့ၫ",
			"26": "<sup>26</sup> တၭ,မူၭခိၪအစီၩ့အမၩ့လဖၪ မိဝၭဝ့ၫဒၪလီၫ.- ထီး နီၪလဖၧၫ့ၦမိဒၪဘၪ လၧၦၡၩအဖိၪခွၫဂဲၫလၩ့ လၧအစီၩ့ဒိၪအမၩ့ဒိၪ, အကယးဒိၪကဖးဒိၪလၧဆၧ",
			"27": "<sup>27</sup> အုၪ့အလီၩ့လီၫ.- ထီးနီၪလဖၧၫ့မိအၪ့မၧၫ့အၥီၫ့ လ ဖၪလ့ၩဒုၭအီၪကီၪ့ ၦလၧအဘၪဆၧရွံန့ဝ့ၫဒၪအီၪလၧ လံၩလံဖျီၩ့,လၧမူၭထံၭလခီၫ ဖိးလၧမူၭထံၭလခီၫဒၪ နီၪလီၫ.",
			"28": "<sup>28</sup> အယီၩတၭ မၩလိၪအဒီၩ့လၧချိၪ့ဒိၩ့ အထံၭဆံၭ. ထီးအထဲၩ့အဖၫ့ ဘၪ့ထၪ့တၭ, အလၪၥံၪဒိၭထၪ့နီၪ,",
			"29": "<sup>29</sup> နၥံၪၥ့ၪယၫလၧဆၧခိအထီဘူၭထၪ့ဝ့ၫလီၫ.- ဘဲၫနီၪအ ၥိၭ, ထီးနၥံၪဒၪဆၧနီၪလဖၪမၩအၥၭတၭ, ၥ့ၪယၫနၥံၪ",
			"30": "<sup>30</sup> ဝ့ၫလၧအဘူၭယူၭ လၧတရၫ့အဂၩ့ထံၭဆံၭ.- ယစံၭ နၥံၪတီၩတီၩလၧၦလဆိၩယီၩ, လချႃၭဖီၩ့ခွံၬဒံၭဘၪ",
			"31": "<sup>31</sup> တၭ,ဆၧနီၪလဖၪမိမၩအၥၭထီးအလူၬလီၫ.- မူၭခိၪ, ဒဲဂၪ့ခိၪ မိဒံၩခွံၬဒံၩဖျိၭဝ့ၫလီၫ. အ့ၪမွဲယလူယထၫ လဖၪနီၪ,ဒံၩခွံၬဝ့ၫအ့ၬ.",
			"32": "<sup>32</sup> မွဲလါနၫ့တၭ,ဆၧလၧမုနံၩ,ဒဲနၩရံၩနီၪ, အ့ၪလမွဲဘၪ ဖါတၭ, ၦၡၩမွဲဂ့ၩ, အၥီၫ့လဖၪအီၪဝ့ၫလၧမူၭခိၪမွဲဂ့ၩ,",
			"33": "<sup>33</sup> ဖိၪခွၫမွဲဂ့ၩ, ၥ့ၪယၫဝ့ၫနးဂၩအ့ၬ.- ထီးလၩ့နၥံၪအၥၭ အီၪခိၭဘၩဆိၪဖၪဆၧဆံၭ. အဂဲးဘဲၫယီၩအမုအ လၩမိဘၪဝ့ၫဆံၭယံၬလဲၪနီၪ, နၥံၪၥ့ၪယၫအ့ၬ.",
			"34": "<sup>34</sup> ဆၧမၩအၥၭဘဲၫ ၦလဂၩလ့ၩဆၧလၧထံၫယဲၩ့ခး ယဲၩ့တၭ, အီၪက့ၪလၩ့ထးအဂံၪ့အဎၫ့တၭ, ဖ့ၪလၫ့အ ခ့ၫအၡၩပၧၩ့ဆၧတၭ, လဂၩဆၧမၩလၧအဂးဒၪဝ့ၫ, လဂၩဆၧမၩလၧအဂးဒၪဝ့ၫတၭ, စံၭၦခိၭတရၫ့လဂၩ",
			"35": "<sup>35</sup> လၧအဘၪအီၪခိၭဆံၭ.- မၩအၥၭဘဲၫနီၪတၭ,အီၪခိၭ နၥံၪဝ့ၫဆံၭ. အဂဲးဘဲၫယီၩဂံၪ့ကဆါမိဂဲၫထဲၩ့နီၪ, အ ဆၧၫ့အထီလၧမုဂၪလၩ့မွဲဂ့ၩ, လၧဖိၭဖၫ့မုမွဲဂ့ၩ, လၧ ဆၫ့ဖၫအီၩ့အိၪထၪ့မွဲဂ့ၩ, လၧဆၧဖၩ့ဘွၩထၪ့မွဲဂ့ၩ,",
			"36": "<sup>36</sup> နၥံၪၥ့ၪယၫအ့ၬ.- ဘၪလဘၪမိဂဲၫထဲၩ့ဘၪၡုၭတၭ, မိ",
			"37": "<sup>37</sup> ဒၪဘၪနၥံၪမံၫမၪလီၫ.- ဆၧလၧယစံၭနၥံၪတၭ,ယ စံၭၦထီးအ လူၬ,အီၪခိၭဆၧဆံၭ."
		},
		"14": {
			"1": "<sup>1</sup> နံၫနံၩအလးခဲၫ့နီၪ, ဘၪဘိၪ့လ့ၩဖၬ, ဒဲဘိၪ့ကိၪလ ဘၪဘၪလၧမံၪတၭ, ၦလုဆၧအဒိၪၥံၪ, ဒဲၦကွ့ၭလံၬၥံၪ အၪ့ဎၬကိၪ့ဝ့ၫဒၪဘဲၫၥိၭ အမိဖီၪ့ထၬအဝ့ၫဒၪ လၧဆၧ",
			"2": "<sup>2</sup> အၪ့လံၬအၪ့လီၫ, ဒဲမၩၥံၫဝ့ၫဒၪလီၫ.- မွဲလါနၫ့တၭ,အ ဝ့ၫၥံၪစံၭဝ့ၫ, မၩလၧဘိၪ့ဖၧၩ့လဂ့ၩ.ဘၪလဘၪၦခမျၧး ၥံၪမိတုၩ့ထၪ့တုၩ့လၩ့ဘၪခိၬလီၫ.",
			"3": "<sup>3</sup> အဝ့ၫဒၪအီၪဝ့ၫလၧဘ့ၭၥနံၫအဖၧၩ့လၧၦခံၫထူၬ ဆၫအၧၩ့စစဲမၧၫ့လဂၩ အဂံၪ့ဖၧၩ့နီၪ, ဆၧၫ့နၩ့ဒံၩ့ခံၫ့ လၧစပွဲထံၭအဘိၩ့ဘၭတၭ, ၦမုၪလဂၩအီၪလၧနၫဒုၫ ၥိၪနၧၫ့မၧၫ့လၧအလူဒိၪဎွ့ၩဒိၪ လၧကီၩ့လိးဘွၩအ ဖၧၩ့တၭ,မၩထ့ဖၭကီၩ့နီၪ, လူၫလၩ့ဝ့ၫလၧအခိၪဎွံၪ",
			"4": "<sup>4</sup> လီၩ့လီၫ.- ၦလနၩ့နၩ့အၥၭထၪ့လၧအၥၭခံဖၧၩ့တၭ, စံၭဝ့ၫဒၪ,မွဲဘၪနီၫလၫဆၧမၩလူၬဂီၩ့ ၥိၪနၧၫ့မၧၫ့ပျီၩ",
			"5": "<sup>5</sup> ပျီၩယီၩလဲၪ.- အဂဲးဘဲၫယီၩ ၥိၪနၧၫ့မၧၫ့ယီၩအ့ၪအၪ့ ဆၫဝ့ၫတၭ, မိန့အဎွ့ၩလၧဒန့ရံၫၥၧၫ့ယၩ အဘျဲၪတၭ, ဖ့ၪလၫ့ဝ့ၫလၧၦၡၪ့ဖိၪၥ့ၪလီၫ. အဝ့ၫၥံၪအီၪက့ၪဆၧမၪ",
			"6": "<sup>6</sup> လၧၦမုၪအလီၩ့လီၫ.- ယ့ၫၡုၬစံၭဝ့ၫဒၪ, မၩလဂ့ၩ, မွဲ ဘၪနီၫနၥံၪမၩထံၬထၬၦမုၪယီၩလဲၪ. မွဲအမၩယူၭ",
			"7": "<sup>7</sup> ယၧၩလၧဆၧမၩဂ့ၩအဖၧၩ့လီၫ.- အဂဲးဘဲၫယီၩၦၡၪ့ ဖိၪယၬဖိၪလဖၪနီၪ, အီၪလၧနၥံၪအၥိၭထံၪဎးတၭ, ထီးဒၪမိမၩဂ့ၩဘၪနၥံၪအၥၭ လၧအဝ့ၫၥံၪနီၪ, နၥံၪမၩ ၥ့ၪလီၫ.အ့ၪမွဲယၧၩယီၩ, ယအီၪလၧနၥံၪအၥိၭထံၪ",
			"8": "<sup>8</sup> ဎးအ့ၬ.- ၦမုၪယီၩထီးဒၪ အမၩၥ့ၪတၭ, မၩယူၭဝ့ၫ ယူၭ,ဂဲၫလူၫလၩ့ဝဲၩၥိၪနၧၫ့မၧၫ့ လၧယမိၡါအလီၩ့",
			"9": "<sup>9</sup> ယီၩ,မွဲလၧဆၧခုၪ့လၩ့ဘၧၩ့ယၧၩအဂးလီၫ.- ယလီၩ ဘၪနၥံၪတီၩတီၩယီၩ, ထီးဒၪအလး လၧဆၧၥၭထိၬ အပရၧၫ့ယီၩ, ဘၪဆၧလီၩလၩ့လၬလၩ့ဝ့ၫ လၧဂၪ့ခိၪ ချိၫ့ထၧၫ့ဖျိၪ့ယၫလစီၪ့လါလါတၭ, ဆၧလၧၦမုၪမၩဝ့ၫ ယီၩ,မိဘၪဆၧလီၩ လၩ့လၬလၩ့ဝ့ၫလၧ ဆၧနၪ့ထၪ့ ထဲၩ့အဂဲးလီၫ.",
			"10": "<sup>10</sup> ၦလၧလဆံၫနံၫဂၩအကျၩ စယုဒၭအံၭစကၫရ အၧၭလဂၩ, လ့ၩဝ့ၫလၧၦလုဆၧအဒိၪၥံၪအအီၪဘဲၫၥိၭ အမိဖ့ၪလၫ့ခွံၬအဝ့ၪဒၪလၧအဝ့ၫၥံၪအစူၪဖၧၩ့လီၫ.",
			"11": "<sup>11</sup> အဝ့ၫၥံၪနါဂၧၫ့တၭ, အၥုၪ့ထိၬၥၭထိၬဝ့ၫနီၪ, အုၩ့ လၩ့လၧအမိဖ့ၪလၫ့စ့ၩလီၫ. အဝ့ၫဒၪမိဖ့ၪလၫ့ခွံၬဝ့ၫ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, အၪ့ဎၬဝ့ၫဒၪအဆၧၫ့အထီ လၧအဂ့ၩလီၫ.",
			"12": "<sup>12</sup> ဘိၪ့ကိၪလဘၪဘၪ လၧမံၪအနံၩအခၪ့ထံၭလၧအ ဝ့ၫၥံၪမၩၥံၫဘိၪ့လ့ၩဖၬနီၪ, အထံၩအဖျဲၥံၪအၪ့စၪ့ဝ့ၫ, ဘဲၫၥိၭနမိအၪ့ဘၪဘိၪ့လ့ၩဖၬနီၪ, မွဲအဘၪနၥၭလၧ",
			"13": "<sup>13</sup> ပလ့ၩတဲၩ့ဝဲၩအလးခီၫခီၫလဲၪ.- အဝ့ၫဒၪအၪ့မၧၫ့အ ထံၩအဖျဲ နံၫဂၩတၭ, စံၭအဝ့ၫၥံၪလ့ၩလၧဒိၩ့ဖၧၩ့တၭ, နၥံၪမိဒၪၦၡၩလ့ၩယိၭထံၫလဂၩတၭး ဖိၬအခဲၫ့ဆံၭ.",
			"14": "<sup>14</sup> ထီးအလ့ၩနုၬဝ့ၫလစီၪ့စီၪ့နီၪ, လီၩဘၪဂံၪ့ကဆါ,ဆရၫ စံၭဝ့ၫ,ၦမွံၩအဒူၭလၧယမိအၪ့ဘၪဘိၪ့လ့ၩဖၬလၧ",
			"15": "<sup>15</sup> ယထံၩယဖျဲအၥိၭနီၪမွဲအအီၪခီၫခီၫလဲၪ.- အဝ့ၫမိဒုၭ နဲၪနၥံၪလၧဒူၭဖၭဒိၪ လၧထၭလဆၫ့အီၪဝဲၩဝ့ၫ, ဒဲတဲၩ့",
			"16": "<sup>16</sup> ဝဲၩအၥၭတၭ, တဲၩ့ဝဲၩဆၧလၧပဂးထီးနီၪဆံၭ.- အ ထံၩအဖျဲစဲၪ့ထၪ့တၭ, လ့ၩဝ့ၫလၧဒိၩ့ဖၧၩ့နီၪ, ဒၪန့ဆၧ ဘဲၫယ့ၫၡုၬစံၭဝ့ၫအၥိၭတၭ, တဲၩ့ဝဲၩဘိၪ့လ့ၩဖၬ",
			"17": "<sup>17</sup> လီၫ.- ထီးမုဂၪလၩ့အဝ့ၫဒၪဂဲၫဝ့ၫလၧအထံၩအဖျဲလ",
			"18": "<sup>18</sup> ဆံၫနံၫဂၩအၥိၭလီၫ.- အဝ့ၫၥံၪဆၧၫ့နၩ့ဒံၩ့ခံၫ့လၧစပွဲ ထံၭအၪ့ဆၧအဘိၩ့ဘၭတၭ, ယ့ၫၡုၬစံၭဝ့ၫ,ယလီၩ ဘၪနၥံၪတီၩတီၩယီၩ ၦလၧနၥံၪအကျၩလၧအအၪ့ဎုၬ",
			"19": "<sup>19</sup> ဆၧလၧယၧၩလဂၩ,မိဖ့ၪလၫ့ခွံၬယၧၩလီၫ.- အဝ့ၫ ၥံၪအၥုၪ့အုၭအၥၭအုၭတၭ, စံၭဝ့ၫလဂၩဘၪလဂၩ,",
			"20": "<sup>20</sup> မွဲယၧၩဧၪ. လဂၩဒၪမွဲယၧၩဧၪ.- မွဲအချဲၩ့ဆၧၫ့ဆၧ, လီၩဘၪအဝ့ၫၥံၪ, မွဲၦလၧလဆံၫနံၫဂၩအကျၩလၧအ ဘၧၩ့လၩ့ဎုၬဆၧ လၧထွ့ၫဖၧၩ့လၧယၧၩလဂၩနီၪလီၫ.",
			"21": "<sup>21</sup> ဘဲၫဆၧကွ့ၭအၥၭ လၧအဂဲးအၥိၭနီၪ, ၦၡၩအဖိၪခွၫ လ့ၩတၡါလီၫ. မွဲလါနၫ့ဘိၩ, ၦလၧအဖ့ၪလၫ့ခွံၬၦၡၩ အဖိၪခွၫလဂၩယီၩ, ဘၪဆၧအၡၪ့လီၫ. အဝ့ၫလဂၩ အ့ၪလအီၪဖျဲၪဘၪတၭ, မွဲအဂ့ၩဒၪအဆၧဒံၭလီၫ.",
			"22": "<sup>22</sup> အဝ့ၫၥံၪအၪ့ဆၧအဘိၩ့ဘၭနီၪ,ယ့ၫၡုၬမၩန့စိၩ ကိၪလလီၪ့ဆိၪဂ့ၩဝ့ၫကံၪ့ဘျ့ၭဝ့ၫတၭ, ဖ့ၪလၫ့အဝ့ၫ",
			"23": "<sup>23</sup> ၥံၪစံၭဝ့ၫဒၪ,မၩန့အၪ့ဆံၭ. အယီၩမွဲယမိၡါလီၫ.- မၩ န့စိၩလိၫ့နီၪ, စံၭထၪ့အၪ့အူၭဆၧအခိးအတၩဖ့ၪလၫ့ အဝ့ၫၥံၪတၭ, ဆၧအီၪလၧအဖၧၩ့နီၪ, အဝ့ၫၥံၪအီၩ",
			"24": "<sup>24</sup> ဝ့ၫကိၭဂၩဒ့ၭလီၫ.- အဝ့ၫဒၪလီၩဘၪအဝ့ၫၥံၪ, ဆၧ ယီၩမွဲယၥွံၪလၧအလူၫလၩ့အၥၭ လၧၦအၪဂၩအဂး",
			"25": "<sup>25</sup> တၭ,ဘၪဆဲၫ့လၧဆၧအုၩ့လၩ့အၥၫ့လီၫ.- ယစံၭနၥံၪ တီၩတီၩလၧယလအီၩလၧၩ့ဘၪ စဘံၭၥၪအထံၫယီၩ, ထီးမုနံၩလၧယမိအီၩအၥၫ့လၧယွၩအဘၩ့အမုး",
			"26": "<sup>26</sup> အဖၧၩ့လီၫ.- ထီးအဝ့ၫၥံၪၥံၫကျံၩဆၧဂီၩ့နီၪ,လ့ၩထၪ့ဝ့ၫ လၧခိၪလီၩ့အလဲအိၫ့အလီၩ့လီၫ.",
			"27": "<sup>27</sup> ယ့ၫၡုၬစံၭအဝ့ၫၥံၪ,မုလနၩဎးယီၩ, နၥံၪအၥၭမိ ဂၭဂီၩ့လၧယကၠီၩ့ကိၭဂၩဒ့ၭလီၫ. အဂဲးဘဲၫယီၩဆၧ ကွ့ၭအၥၭ, ယ မိ ဖ့ၬ ခွံၬ ၦ ယူၬ ၥိၪ တၭ, ၥိၪ လ ဖၪ",
			"28": "<sup>28</sup> မိ လၩ့ မု လၩ့ ဖၭ ခွံၬ ဝ့ၫ ဒၪ လီၫ.- မွဲလါနၫ့တၭ, ယဂဲထုၪ့ထဲၩ့အလးခဲၫ့နီၪယမိလ့ၩဝဲၩ လၧနၥံၪအ",
			"29": "<sup>29</sup> မ့ၬယၫလၧဂၫလလံၫအဖၧၩ့လီၫ.- စပံတၧၫစံၭဝ့ၫ,ၦထီးအလူၬအၥၭအ့ၪဂၭဂီၩ့လါနၫ့နီၪ, ယဝ့ၫဒၪယီၩ",
			"30": "<sup>30</sup> ယၥၭဂၭဂီၩ့အ့ၬ.- ယ့ၫၡုၬစံၭဝ့ၫ,ယလီၩဘၪနၧၩတီၩတီၩ လနံၩယီၩကဲမုနၩခိၬယီၩ, ဆၫ့ဖၫလချႃၭအီၩ့အိၪထၪ့ ဒံၭဘၪနံၫဖၧၫ့တၭ, နမိမီၪ့ဘံၭယၧၩနးၥၧၫ့ဖၧၫ့လီၫ.",
			"31": "<sup>31</sup> အဝ့ၫဒၪချဲၩ့ထၪ့ ဆီၪ့နဲၪ့အနီၪဒံၭ, ယအ့ၪဘၪၥံၫဎုၬ လါနၫ့လၧနၧၩနီၪ, ယမီၪ့ဘံၭနၧၩအ့ၬ. အထံၩအဖျဲ ထီးအလူၬနီၪ, စံၭဝ့ၫဘဲၫနီၪၥိၭဆ့လီၫ.",
			"32": "<sup>32</sup> အဝ့ၫၥံၪလ့ၩထီၩ့လၧအလးကိၭဝ့ၫဂ့ၭၥစ့မနံၫ တၭ,အဝ့ၫဒၪစံၭအထံၩအဖျဲၥံၪ, ဆၧၫ့နၩ့နၥံၪဝ့ၫထီး",
			"33": "<sup>33</sup> ယီၩလၧယဘၩဆိၪဖၪအဘိၩ့ဘၭနီၪဆံၭ.- အဝ့ၫဒၪ ကိၭန့စပံတၧၫ,ဒဲစယ့မံၭ, ဒဲစယီဟၫ့,လၧအၥိၭတၭ, ထီၫမံၫထီၫမၪဝ့ၫတၭ, အၥုၪ့အုၭအၥၭအုၭဒိၪမၬ,",
			"34": "<sup>34</sup> စံၭအဝ့ၫၥံၪ,ဆၧၥၭအုၭအီၪဝၬဖီၩ့ယၧၩထီးယမိၥံၫ",
			"35": "<sup>35</sup> လီၫ.အီၪထီးယီၩတၭ,အီၪခိၭဆံၭ.- လ့ၩလၧယၫ လဆံၭဖိၪတၭ, ထွံၩလၩ့လၧဂၪ့ခိၪတၭ, ဘၩဆိၪ",
			"36": "<sup>36</sup> ဖၪဘဲၫၥိၭအ့ၪၥ့ၪတၭ,နၩရံၩနီၪမိဖီၩ့ခွံၬဝ့ၫဒၪလီၫ.- စံၭ ဝ့ၫ,အၭဘၫ,ဖါဧ့,နၥ့ၪဒၪဆၧလူၬလီၫ. မၩဖီၩ့ခွံၬ လါလိၫ့ယီၩလၧယၧၩဆံၭ. မွဲလါနၫ့တၭ,ထီးဒၪယၥၭ",
			"37": "<sup>37</sup> ဒၪယဝ့ၫမွဲအ့ၬ.မွဲထီးဒၪနၥၭဒၪနဝ့ၫလီၫ.- ဂဲၫထဲၩ့တၭ, ဒၪဘၪအဝ့ၫၥံၪမံၫမၪနီၪ, စံၭစပံတၧၫ,စစဲမၧၫ့ဧ့, မွဲနၥံၪ မံၫမၪဆ့ဧၪ,နအီၪခိၭန့ၫလနၩရံၩယီၩ ကဲၪအ့ၬဧၪ.",
			"38": "<sup>38</sup> ဘဲၫၥိၭနၥံၪထီးလ့ၩနုၬဘၪလၧ ဆၧကျဲၩ့ဖစီၩ့ အဖၧၩ့ လဂ့ၩ,အီၪခိၭဒဲဘၩဆိၪဖၪဆၧဆံၭ. မွဲၥၭလမံၩ့အၥၭ အီၪဝ့ၫ,အ့ၪမွဲဆၧဖံၭဆၧယၪလမံၩ့ အဂဲးဆါအဘၭ ဆါလီၫ.",
			"39": "<sup>39</sup> အဝ့ၫဒၪလ့ၩဒီၭဝ့ၫတၭ, ဘၩဆိၪဖၪဆၧနီၪ, စံၭဝ့ၫ,",
			"40": "<sup>40</sup> ဘဲၫအလးလးအၥိၭနီၪလီၫ.- ဂဲၫထဲၩ့ထဲၩ့ဒီၭဝ့ၫတၭ, ဒၪဘၪအဝ့ၫၥံၪမံၫမၪဒီၭတၭ, အဂဲးဘဲၫယီၩအမ့ၬဖံၭ ဎၧၫ့ဝ့ၫလီၫ. အဝ့ၫၥံၪမိစံၭဆၧၫ့ဝ့ၫ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪ",
			"41": "<sup>41</sup> လဲၪနီၪ,လၥ့ၪယၫဘၪဝ့ၫလီၫ.- မွဲအဂဲၫထဲၩ့ၥၧၫ့ဖၧၫ့ လဖၧၫ့နီၪ, စံၭအဝ့ၫၥံၪဘိၩ့နဲၪ့ယီၩ မွဲနၥံၪအီၪပွံၭဒဲမံၫ မိချႃၭဆ့ဧၪ.ဎွ့ၩနီၪလီၫ. နၩရံၩဘၪယူၭ.ယိခွါ,ၦၡၩ အဖိၪခွၫဘၪဆၧဖ့ၪလၫ့ခွံၬဝ့ၫ လၧၦဆၧဒဲၩဘၭဖိၪအ",
			"42": "<sup>42</sup> စူၪဖၧၩ့ယူၭ.- ဂဲထုၪ့တၭ,မွဲပလ့ၩၡီၩ့ဘီၪ.ယိခွါ,ၦလၧ အဖ့ၪလၫ့ခွံၬယၧၩလဂၩနီၪ, အီၪဘူၭထၪ့ယူၭလီၫ.",
			"43": "<sup>43</sup> အဝ့ၫဒၪချဲၩ့ဆၧအဘိၩ့ဘၭတၭ, ၦလၧလဆံၫ နံၫဂၩအကျၩစယုဒၭလဂၩဂဲၫဝ့ၫချဲၫ့မၬတၭ, ၦခမျၧး ဖိၬအခဲၫ့အီၪလၧနၭၥံၪဒဲနိၪထိၭလဖၪ, ဂဲၫစဲၪ့ထၪ့ခွံၬ လၧၦလုဆၧအဒိၪၥံၪ,ဒဲၦကွ့ၭလံၬၥံၪ, ဒဲၦၥုၪ့က့ၭၥၭ",
			"44": "<sup>44</sup> ၡါၥံၪအအီၪလီၫ.- ၦလၧအဖ့ၪလၫ့ခွံၬဝ့ၫလဂၩနီၪ,ဖ့ၪ လၫ့ဆၧနဲၪ့လမံၩ့ လၧၦလဖၪနီၪတၭ, စံၭဝ့ၫဒၪထီးဒၪ ၦလၧယအဲၪဂါဝ့ၫလဂၩနီၪ,မွဲအဝ့ၫနီၪးဖီၪ့ထၬအ့ၪ",
			"45": "<sup>45</sup> ခၧၫ့,ထဲၩ့ဆိၬခၧၫ့ခၧၫ့ဆံၭ.- ထီးအထီၩ့ဝ့ၫနီၪ,လ့ၩစိၩ ဝ့ၫလၧအအီၪချဲၫ့မၬ, စံၭဝ့ၫဒၪ, ရၭဘံၫဧ့,ရၭဘံၫ",
			"46": "<sup>46</sup> ဧ့,တၭအဲၪဂါဝ့ၫဒၪလီၫ.- အဝ့ၫၥံၪအီၪက့ၪအစူၪလၧ အလီၩ့တၭ, ဖီၪ့ထၬဝ့ၫဒၪလီၫ.",
			"47": "<sup>47</sup> ၦလၧအဆၧၫ့ထုၪ့ထီးနီၪလဂၩ, ထုၬထၪ့အနၭ, ဖ့ၬၦလုဆၧအခိၪအဎီးအၡၩတၭ, အနါထူၬခွံၬလခီၫ",
			"48": "<sup>48</sup> လီၫ.- ယ့ၫၡုၬချဲၩ့ထၪ့ဆၧတၭ, စံၭအဝ့ၫ,ဘဲၫၥိၭနၥံၪ မိဖီၪ့န့ယၧၩတၭ, နၥံၪဂဲၫယူၭလၧနၭၥံၪ ဒဲနိၪထိၭၥံၪ",
			"49": "<sup>49</sup> ဘဲၫၦဖီၪ့ထၬထမျၬအၥိၭမၬကၨ.- ယအီၪလၧနၥံၪအ ကျၩ,ယၥီၪ့ဆၧၥၫ့ဆၧလၧ ဆၧလုအဂံၪ့ဖၧၩ့ၥံၫ့ၥံၫ့နံၩ တၭ,နၥံၪလဖီၪ့ထၬမၬယၧၩကၨ. မွဲလါနၫ့ဘိၩ, ဆၧ မၩအၥၭယီၩ ဘဲၫၥိၭဆၧကွ့ၭအၥၭမိလၧၫ့ထၪ့ဎွ့ၩ",
			"50": "<sup>50</sup> ထၪ့ဝ့ၫလီၫ.- ၦစဲၪ့ဒၪခွံၬဝ့ၫကိၭဂၩဒ့ၭတၭ,စဲၪ့ဖျိၭဝ့ၫဒၪ",
			"51": "<sup>51</sup> လီၫ.-ၦဖိၪၥၪခွၫလဂၩဖိၬအခဲၫ့တၭ, ကီၩ့န့ၫဖၭ",
			"52": "<sup>52</sup> ဘဲၩ့လဘံၪ့လီၫ. ၦဖိၪၥၪခွၫၥံၪဖီၪ့ထၬဝ့ၫတၭ.- အဝ့ၫ ဒၪခွံၬၡိၭခွံၬအဖၭဘဲၩ့တၭ,စဲၪ့ထၪ့ဘိၪ့ခွံၬလၧအဝ့ၫ ၥံၪအအီၪလီၫ.",
			"53": "<sup>53</sup> ၦလ့ၩၥိၫ့ယ့ၫၡုၬ လၧၦလုဆၧအခိၪအအီၪလီၫ. ၦလုဆၧအဒိၪၥံၪထီးအလူၬ, ဒဲၦၥုၪ့က့ၭၥၭၡါ,ဒဲၦ",
			"54": "<sup>54</sup> ကွ့ၭလံၬၥံၪအီၪကီၪ့လၧအအီၪလီၫ.- စပံတၧၫလဂၩ ဖိၬအခဲၫ့ယဲၩ့ယိၬနီၪ, ထီၩ့လၧၦလုဆၧအခိၪ အဂံၪ့ တၭ,ဆၧၫ့နၩ့ဝ့ၫလၧဆၧအခ့ၫအၡၩအၥိၭတၭ, ဆူၭ ဆူၭမ့ၪလီၫ.",
			"55": "<sup>55</sup> ၦလုဆၧအဒိၪၥံၪ,ဒဲၦကိၪ့ထၪ့ဆၧထီးအလူၬ, ဘဲၫ ၥိၭအမိမၩၥံၫဘၪယ့ၫၡုၬနီၪ, အၪ့ဎၬၦထိးအၥၭထၫ့",
			"56": "<sup>56</sup> ဒုၪဒၩအဝ့ၫနီၪတၭ,ဒၪန့ဝ့ၫအ့ၬ.- အဂဲးဘဲၫယီၩၦထိး အၥၭလၧဆၧအဘျံၭအဘျၪလၧအဂဲးအၪဂၩလါ",
			"57": "<sup>57</sup> နၫ့နီၪ,အဆၧချဲၩ့မီၪ့ဎီၩ့အ့ၬ.- ၦလနၩ့နၩ့ဂဲထုၪ့တၭ, ထိးအၥၭလၧဆၧအဘျံၭအဘျၪလၧအဂဲးတၭ, စံၭဝ့ၫ",
			"58": "<sup>58</sup> ဒၪ,- ပနါဂၧၫ့ၦလဂၩယီၩ, စံၭဝ့ၫလၧအမိမၩလၩ့ဎီး ခွံၬဆၧလုအဂံၪ့လၧၦမၩဝ့ၫလၧအစူၪတၭ, ၥၧၫ့နံၩ အထးဖၧၩ့နီၪ, မိမၩထၪ့ဝ့ၫအဂူၫဂၩနးဖျိၪ့လၧၦလမၩ",
			"59": "<sup>59</sup> ဘၪလၧအစူၪလီၫ.- အဝ့ၫၥံၪအဆၧချဲၩ့လဘၪလိၬဘၪ",
			"60": "<sup>60</sup> ဘဲၫနီၪၥိၭဆ့လီၫ.- ၦလုဆၧအခိၪ,ဂဲထုၪ့လၧဆၧၥၭ ကျၩတၭ, အၪ့စၪ့ယ့ၫၡုၬနီၪ, စံၭဝ့ၫဒၪ,မွဲနချဲၩ့ဆၧၫ့ဆၧ နးထံၪအ့ၬဧၪ. အဝ့ၫၥံၪထိးအၥၭလၧနဂးဘဲၫၥ့ၪလဲၪ.",
			"61": "<sup>61</sup> အဝ့ၫဒၪအီၪဒၪအဆၧလၩ့မါပံၭတၭ, ချဲၩ့ဆၧၫ့ဆၧ နးထံၪအ့ၬ. ၦလုဆၧအခိၪအၪ့စၪ့ဒီၭ, စံၭဝ့ၫ, မွဲနမွဲ",
			"62": "<sup>62</sup> ၦလၧအဘၪဆၧဆိၪဂ့ၩအဖိၪခွၫ, ဎရံၬနီၪဆ့ဧၪ,- ယ့ၫ ၡုၬစံၭဝ့ၫ, မွဲယၧၩလီၫ. နၥံၪမိဒၪဘၪ ၦၡၩအဖိၪခွၫ ဆၧၫ့နၩ့လၧအစီၩ့အမၩ့အစူၪထွ့ၪလခီၫနီၪ, ဂဲၫလၩ့",
			"63": "<sup>63</sup> လၧမူၭခိၪအဆၧအုၪ့အလီၩ့လီၫ.- ၦလုဆၧအခိၪၡၫ့ ယၬအဆဲၫ့တၭ,စံၭဝ့ၫဒၪ, ပမိမၩဒံၭဆၧထိးအၥၭ",
			"64": "<sup>64</sup> လၧအဂူၫဂၩအလးအီၪဘဲၫၥ့ၪလဲၪ.- မွဲအဒုၪဒွ့ၪယွၩ နီၪနၥံၪနါဂၧၫ့ယူၭတၭ, မွဲနၥံၪဆီၫ့မီၪ့ဘဲၫၥ့ၪလဲၪ. ၦထီး",
			"65": "<sup>65</sup> အလူၬစ့ၩရၫ့ဝ့ၫလၧအကြၨၭဘၪၥံၫလီၫ.- ၦလနၩ့နၩ့ ထိၪဖျံၭဝ့ၫတၭ,မၩဘံၭအမ့ၬနီၪ,မ့ၭဝ့ၫတၭ, စံၭဝ့ၫ, ချဲၩ့ဆၧလၧမီၪအချိၬဘီၪ. ဆၧအခ့ၫအၡၩလဖၪဖီၪ့ ထၬဒဲၩဝ့ၫဒၪလီၫ.",
			"66": "<sup>66</sup> စပံတၧၫအီၪဝ့ၫလၧလၬလခီၫလၧဆၧဝၩ့ဖၧၩ့အ ဘိၩ့ဘၭနီၪ, ၦလုဆၧအခိၪအခ့ၫအၡၩမုၪလဂၩ ဂဲၫ",
			"67": "<sup>67</sup> ဝ့ၫတၭ,- ထီးအဒၪဘၪစပံတၧၫဆူၭဆူၭမ့ၪ,ယိဝ့ၫလၩ့ ထံးလၩ့ဆ့ၭနီၪ, စံၭဝ့ၫဒၪ,နဝ့ၫဒၪယီၩမွဲနအီၪယူၭလၧ",
			"68": "<sup>68</sup> ၦနၭဇရ့ၭဖိၪယ့ၫၡုၬအၥိၭလီၫ.- အ့ၪမွဲအဝ့ၫဒၪမီၪ့ ဘံၭဝ့ၫတၭ,စံၭဝ့ၫဒၪ,ယၥ့ၪယၫအ့ၬ. နချဲၩ့ဆၧနီၪ ယနၪၥ့ၪအ့ၬ. စဲၪ့ထၪ့ခွံၬဝ့ၫလၧဆၧဝၩ့ဖၧၩ့ အမ့ၬယၫ",
			"69": "<sup>69</sup> လၧခီၫ့တၭ, ဆၫ့ဖၫအီၩ့အိၪထၪ့ဝ့ၫဒၪလီၫ.- ဆၧအခ့ၫ အၡၩမုၪလဂၩဒၪဒီၭ, စံၭၦလၧအဆၧၫ့ထုၪ့အီၪဝ့ၫလၧ အနဲၩ့ထံၭလဖၪနီၪး အဝ့ၫလဂၩယီၩ, မွဲအအီၪယူၭ",
			"70": "<sup>70</sup> လၧၦလဖၪနီၪ အကျၩလီၫ.- စပံတၧၫမီၪ့ဘံၭဒီၭဝ့ၫ လီၫ.အီၪဝ့ၫမီခိၬတၭ, ၦဆၧၫ့ထုၪ့လၧအနဲၩ့ထံၭလဖၪ စံၭဒီၭစပံတၧၫ, နဝ့ၫဒၪယီၩနမွဲတၡါၦလၧအဝ့ၫၥံၪအ ကျၩလဂၩလီၫ. အဂဲးဘဲၫယီၩ,နမွဲၦဂၫလလံၫဖိၪဆ့",
			"71": "<sup>71</sup> တၭ,နလူလၩ့ဂၬအဝ့ၫနီၪလီၫ.- အဝ့ၫဒၪ ဆိၪဆၧစံၭ ဆၧတၭ, ဆိၪလၩ့အၥၭ, ၦလၧနၥံၪစံၭလဂၩနီၪယၥ့ၪ",
			"72": "<sup>72</sup> ယၫအ့ၬ.- ဆၫ့ဖၫအီၩ့အိၪထၪ့ဝ့ၫချဲၫ့မၬနံၫဖၧၫ့လဖၧၫ့ လီၫ.စပံတၧၫနၪ့ထၪ့ထဲၩ့လၧယ့ၫၡုၬစံၭဝ့ၫ, လၧဆၫ့ဖၫ လချႃၭအီၩ့အိၪထၪ့ဒံၭဘၪနံၫဖၧၫ့နီၪ, နမိမီၪ့ဘံၭယၧၩ နးၥၧၫ့ဖၧၫ့လီၫ. ဆီၫ့မီၪ့လၩ့အၥၭတၭ,ဂၪ့ဝ့ၫဒၪလီၫ."
		},
		"15": {
			"1": "<sup>1</sup> ဆၧဖၩ့ထၪ့တၭ, ၦလုဆၧအဒိၪၥံၪ,ဒဲၦၥုၪ့က့ၭၥၭၡါ ၥံၪ, ဒဲၦကွ့ၭလံၬၥံၪ, ဒဲၦကိၪ့ဆၧၥ့ၪ ထီးအလူၬလဖၪနီၪ, ကိၪ့လိၬအၥၭချဲၫ့မၬတၭ, စၧၩ့ထၬယ့ၫၡုၬနီၪ, လ့ၩ ၥိၫ့ဖ့ၪလၫ့ဝ့ၫလၧစပဲလၭလီၫ.",
			"2": "<sup>2</sup> စပဲလၭအၪ့စၪ့ဝ့ၫ, နဝ့ၫဒၪယီၩနမွဲၦယုဒၫဖိၪၥံၪ အစဎွၩဧၪ. အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫ, နစံၭယူၭ",
			"3": "<sup>3</sup> ဆၧယူၭ.- ၦလုဆၧအဒိၪလဖၪအီၪက့ၪဆၧမၪလၧအ",
			"4": "<sup>4</sup> လီၩ့အၪမံၩ့လီၫ.- စပဲလၭအၪ့စၪ့ဒီၭဝ့ၫတၭ, စံၭဝ့ၫဒၪ, မွဲနချဲၩ့ဆၧၫ့ဆၧနးမံၩ့အ့ၬဧၪ. အဝ့ၫၥံၪထိးအၥၭလၧ",
			"5": "<sup>5</sup> နဂဲးဆံၭအၪဆံၭအၪလဲၪနီၪ, ယိဆီၫ့မီၪ့ခွါဆံၭ.- ယ့ၫ ၡုၬချဲၩ့ဆၧၫ့လၧၩ့ဆၧနးထံၪအ့ၬ. မၩအၥၭဘဲၫနီၪ တၭ,စပဲလၭထီၫမံၫထီၫမၪဝ့ၫလီၫ.",
			"6": "<sup>6</sup> လၧဆၧဘိၪ့နီၪ,ထီးဒၪအဝ့ၫၥံၪအၪ့ကံၩ့ထဲၩ့ၦထီၫ့",
			"7": "<sup>7</sup> ဖိၪလဂၩဂၩတၭ,ၦဒိၪကွဲၪဖျါဝ့ၫလၧအဂးလီၫ.- ၦလ ဂၩကိၭဝ့ၫအမံၩ့ စဘရၭဘၭအီၪဝ့ၫ လၧထီၫ့ဖၧၩ့လၧ အထံၩအၥိၭလဖၪ လၧအမၩတုၩ့ထၪ့တုၩ့လၩ့ဆၧလၧ အၥိၭတၭ, မၩၥံၫၦၡၩလၧဆၧတုၩ့ထၪ့တုၩ့လၩ့အ",
			"8": "<sup>8</sup> ဖၧၩ့လီၫ.- ၦခမျၧးအၪ့ကံၩ့ကိၭၡၭထၪ့ဝ့ၫ ဘဲၫၥိၭအမိ",
			"9": "<sup>9</sup> မၩဝ့ၫဘဲၫအထူၫအရူၫအီၪဝ့ၫအၥိၭနီၪလီၫ.- စပဲလၭ ချဲၩ့ဆၧၫ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪ, မွဲအဘၪနၥံၪအၥၭလၧ ယ",
			"10": "<sup>10</sup> မိကွဲၪဖျါန့နၥံၪအဂးလၧၦယုဒၫအစဎွၩနီၪဆ့ဧၪ.- အ ဂဲးဘဲၫယီၩ ၥ့ၪယၫဝ့ၫလၧၦလုဆၧအဒိၪလဖၪနီၪ ဖ့ၪ",
			"11": "<sup>11</sup> လၫ့ဝ့ၫလၧဆၧၥၭခ့ၬအကၠီၩ့လီၫ.- ၦလုဆၧအဒိၪၥံၪ ပဂၨၪထၪ့ၦခမျၧးအခဲၫ့ ဘဲၫၥိၭၦဒိၪမိကွဲၪဖျါ စဘရၭ",
			"12": "<sup>12</sup> ဘၭလဂၩလၧအဝ့ၫၥံၪအဂးလီၫ.- စပဲလၭချဲၩ့ဆၧၫ့ ဆၧ,စံၭဒီၭအဝ့ၫၥံၪ, အ့ၪမွဲဘဲၫနီၪတၭ, မွဲအဘၪနၥံၪအ ၥၭလၧယမိမၩၦလၧနၥံၪကိၭၦယုဒၫဖိၪၥံၪအစဎွၩ",
			"13": "<sup>13</sup> လဂၩလၧဆၧနီၪလမံၩ့လဲၪ.- ၦကိၭၡၭထၪ့ဒီၭ, ဖျၩ",
			"14": "<sup>14</sup> ထၪ့ခွံၬအဝ့ၫလၧထုၪ့စူၪယၫအလီၩ့ဘီၪ.- စပဲလၭစံၭ အဝ့ၫၥံၪ, ဘၪနီၫလဲၪ. မွဲအမၩဆၧနီၫလၫအအၧၩ့လ မံၩ့လဲၪ.အဝ့ၫၥံၪကိၭထၪ့ဒီၭဝ့ၫနၭနဲၪ့ အလးဒံၭ, ဖျၩ",
			"15": "<sup>15</sup> ထၪ့ခွံၬအဝ့ၫလၧထုၪ့စူၪယၫအလီၩ့ဘီၪ.- စပဲလၭနီၪ အၥၭအီၪ လၧအမိမၩဝ့ၫဘဲၫအဘၪ ၦခမျၧးအၥၭအ ၥိၭတၭ, ကွဲၪဖျါစဘရၭဘၭလၧအဂးတၭး ယ့ၫၡုၬနီၪ မွဲအဒိၪဝ့ၫထးဝ့ၫဂီၩ့တၭ, ဖ့ၪလၫ့ခွံၬဝ့ၫ ဘဲၫၥိၭအမိ ဘၪဆၧဖျၩထၪ့ခွံၬဝ့ၫ လၧထုၪ့စူၪယၫအလီၩ့လီၫ.",
			"16": "<sup>16</sup> ၦၥုၭဖိၪလဖၪမီၩ့ဝ့ၫလၧဆၧစ့ၩရၫ့ခွးအလး, ဆၧ ကိၭဝ့ၫဖြံၫတိရအၫ့တၭ, အဝ့ၫၥံၪကိၭကီၪ့ၦၥုၭဖိၪထၧၫ့",
			"17": "<sup>17</sup> ဒီၪ့ယၫတၭ,- ဒုၭကီၩ့ဒုၭၥိၭထၪ့ဝ့ၫလၧ ဆၧကီၩ့ဆၧၥိၭ အဝီၩလုၭဖုၭတၭ, ထဲၫ့ၥရဖူၩလၧဆၧဆူၪနီၪ,ဒုၭချႃၬ",
			"18": "<sup>18</sup> ထၪ့ဝ့ၫလီၫ.- အဝ့ၫၥံၪချဲၩ့ဒုၪ့ဝ့ၫတၭ,စံၭဝ့ၫ,ၦယုဒၫဖိၪ",
			"19": "<sup>19</sup> ၥံၪအစဎွၩဧ့,- ဒိၪဝ့ၫထးဝ့ၫအခိၪဎွံၪလၧဖီးဘီၩ့တၭ, ထိၪဖျံၭဝ့ၫနီၪ,ထွံၩလၩ့အခၪ့လၧအမ့ၬယၫတၭ,ဘၩ ထၪ့ဝ့ၫဒၪလီၫ.",
			"20": "<sup>20</sup> ဒုၪဒွ့ၪဝ့ၫဂီၩ့နီၪ,ဘဲၪ့လၩ့ခွံၬ အကီၩ့အၥိၭအဝီၩ လုၭဖုၭတၭ, ဒုၭကီၩ့ဒုၭၥိၭထၪ့ထဲၩ့ဝ့ၫလၧအကီၩ့အ ၥိၭဒၪဝ့ၫတၭ, လ့ၩၥိၫ့ထၪ့ခွံၬဝ့ၫ ဘဲၫၥိၭအမိဖျၩထၪ့ဝ့ၫ လၧထုၪ့စူၪယၫအလီၩ့လီၫ.",
			"21": "<sup>21</sup> စအလ့ၭစၪ့ဒၧၫဒဲစရူဖၧၭအဖါ, ၦစဲၫရံနံၫဖိၪစစဲမၧၫ့ လဂၩအီၪဝ့ၫလၧခီၫ့နီၪ ဂဲၫလၧဖၧၩ့ၥၭအဘိၩ့ဘၭတၭ,",
			"22": "<sup>22</sup> အဝ့ၫၥံၪအၪ့မၧၫ့ဆီၪ့အဝ့ၫယိၭအထုၪ့စူၪယၫလီၫ.- အ ဝ့ၫၥံၪလ့ၩၥိၫ့ဝ့ၫထီၩ့လၧဂီၫလဂိၥၫအလး, ဘဲၫၦစံၭ",
			"23": "<sup>23</sup> ဆၧအၥိၭ,ဆၧခိၪဎွံၪလဲၫအလးတၭ,- ဒုၭအီၩဝ့ၫလၧ စဘံၭထံၫလဲၩဎုၬဝ့ၫ လၧမူၫရၫ့တၭ, အဝ့ၫဒၪအီၩဝ့ၫ",
			"24": "<sup>24</sup> အ့ၬ.- ထီးအဝ့ၫၥံၪဖျၩထၪ့ဝ့ၫ လၧထုၪ့စူၪယၫအလီၩ့ ဂီၩ့တၭ, အၪ့နၩ့ဖၭဝ့ၫအကီၩ့အၥိၭနီၪ,ၦလဂၩဂၩ မိန့ဘၪဝ့ၫဆံၭအၪလဲၪဆုၬဆုၬနီၪ, ဘဲၫၥိၭအမိၥ့ၪယၫ",
			"25": "<sup>25</sup> ဝ့ၫတၭ,ဖၭဝ့ၫဒၪလီၫ.- ဘၪၥၧၫ့နၩရံၩတၭ, အဝ့ၫၥံၪ",
			"26": "<sup>26</sup> ဖျၩထၪ့အဝ့ၫလီၫ.- လံၬလၧၦအီၪက့ၪဆၧမၪ လၧအ လီၩ့အီၪကွ့ၭအၥၭလၧအဖၫ့ခိၪ, ၦယုဒၫဖိၪၥံၪအစဎွၩလီၫ.",
			"27": "<sup>27</sup> အဝ့ၫၥံၪဖျၩထၪ့ဎုၬၦထမျၬနံၫဂၩလၧအၥိၭ, လၧ အစူၪထွ့ၪလခီၫလဂၩ, လၧအစူၪစ့ၪလခီၫလဂၩလီၫ.",
			"28": "<sup>28</sup> ဆၧကွ့ၭအၥၭလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫလၧအစံၭဝ့ၫဒၪ, အ ဝ့ၫ ဒၪ ယီၩ ဘၪ ဆၧ ဝံ ဎုၬ နၬ ဎုၬ အ ၥၭ လၧ ၦ မၩ မၪ ဆၧ လ ဖၪ အ ကျၩ လီၫ.",
			"29": "<sup>29</sup> ၦလဲးလီၩ့လဲးထၪ့လဖၪဖျၭလၩ့အခိၪတၭ, ဒုၪ ဒွ့ၪဝ့ၫနီၪ,စံၭဝ့ၫဒၪ, ဟဲၬ, ၦလၧအမၩလၩ့ဎီးခွံၬဆၧလု အဂံၪ့တၭ, မၩထဲၩ့ဝ့ၫလၧၥၧၫ့နံၩအထးဖၧၩ့လဂၩ",
			"30": "<sup>30</sup> ဧ့,- ထိးထဲၩ့တၩ့ထဲၩ့ဒၪနၥၭတၭ, ဂဲၫထဲၩ့လၩ့လၧထုၪ့",
			"31": "<sup>31</sup> စူၪယၫအလီၩ့ဆံၭ.- ဘဲၫနီၪအၥိၭၦလုဆၧအဒိၪၥံၪ, ဒဲၦကွ့ၭလံၬၥံၪဒုၪဒွ့ၪအဝ့ၫဆ့တၭ, စံၭလိၬအၥၭ, အ",
			"32": "<sup>32</sup> ဝ့ၫယီၩထိးထဲၩ့တၩ့ထဲၩ့ဒၪအၥၭၥ့ၪအ့ၬ.- ဘဲၫၥိၭပမိ ဒၪဘၪ,ဒဲနဲၩထဲၩ့ဆၧနီၪ, မွဲဎရံၬ, ၦအံၫစရ့လၭဖိၪၥံၪ အစဎွၩဂဲၫထဲၩ့လၩ့လၧထုၪ့စူၪယၫအလီၩ့ဘိၩ့နဲၪ့ယီၩဆံၭ. ၦလၧအဘၪဆၧဖျၩထၪ့ဎုၬဝ့ၫလၧအၥိၭနီၪ, ဒုၪဒွ့ၪဝ့ၫဆ့လီၫ.",
			"33": "<sup>33</sup> လၧဎူၫနၩရံၩနီၪဆၧခံၭဝ့ၫလၧခးဖၧၩ့ထၧၫ့ဘံၪ့ယၫ",
			"34": "<sup>34</sup> ထီၩ့လၩ့ခွံၫနၩရံၩလီၫ.- ထီးအဘၪခွံၫနၩရံၩနီၪ ယ့ၫ ၡုၬကိၭၡၭထၪ့ဆၧလၧအလူဖၭဒိၪတၭ, စံၭဝ့ၫဒၪ, :အ့လိအံၫ,အ့လိအံၫလ့မၫစဘၭၥနဲ:, ဘဲၫၦစံၭ ဆၧအၥိၭ,ယယွၩဧ့, ယယွၩဧ့, မွဲဘၪနီၫနစဲၪ့ဒၪ",
			"35": "<sup>35</sup> ယၧၩလဲၪ.- ၦဆၧၫ့ထုၪ့အီၪလၧအနဲၩ့ထံၭလနၩ့နၩ့နါ ဂၧၫ့ဝ့ၫတၭ,စံၭဝ့ၫ,ယိခွါ, မွဲအကိၭစအံၫလဲယၫလီၫ.",
			"36": "<sup>36</sup> ၦလဂၩထဲၩ့စဲၪ့စုၪလၩ့စီၪ ဎၧၩ့မၫဆမံၭလလီၪ့လၧ ဆၧဆဲၪ့ထံၫတၭ, ယူၬထၪ့ဝ့ၫလၧဖီးလဘီၩ့အခံၫထိၭ တၭ,ဒုၭအီၩဝ့ၫတၭ,စံၭဝ့ၫဒၪ,အီၪဒၪဝ့ၫဆံၭ. မွဲစအံၫ လဲယၫမိဂဲၫထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫ, လဂဲၫဘၪလဲၪနီၪ, မွဲပယိၡီၩ့ဘီၪ.",
			"37": "<sup>37</sup> ယ့ၫၡုၬကိၭၡၭထၪ့ဆၧလၧအလူဖၭဒိၪတၭ,အ",
			"38": "<sup>38</sup> ၥၭစဲၪ့ထၪ့ဝ့ၫဒၪလီၫ.- ဆၧလုဂံၪ့အကလကၫထ့ဖၭ",
			"39": "<sup>39</sup> လၧအခံၫထိၭဖိးလၩ့လၧအခၪ့ထံၭနံၫခီၫလီၫ.- ၦၥုၭ ဖိၪလယၩအခိၪလဂၩလၧအဆၧၫ့ထုၪ့ လၧအမ့ၬယၫ နီၪ,ဒၪဘၪလၧအကိၭၡၭထၪ့ဘဲၫနီၪ အၥၭစဲၪ့ထၪ့ဝ့ၫ တၭ,စံၭဝ့ၫဒၪ, အယီၩလဂၩမွဲတၡါယွၩအဖိၪခွၫလီၫ.",
			"40": "<sup>40</sup> ၦမုၪအီၪလနၩ့နၩ့လၧအယိစိၩဝ့ၫ,နးမၫရံၫမၭ ဂဒၫလံနံၫ, စယ့မံၭအဆံၭလဂၩ ဒဲစယိစ့ၭအမိနးမၫ",
			"41": "<sup>41</sup> ရံၫ,ဒဲနးစလိမံၫလဖၪအီၪဝ့ၫ လၧအကျၩနီၪလီၫ.- လၧ ယ့ၫၡုၬအီၪဝ့ၫလၧဂၫလလံၫနီၪ, အဝ့ၫၥံၪဖိၬအခဲၫ့တၭ, လုအၪ့လုအီၩဝ့ၫလီၫ. ၦမုၪအဂူၫဂၩလၧအဂဲၫဖိၬ အခဲၫ့ထီၩ့လၧယရုစလံၫ့ အီၪဝ့ၫအၪဂၩဆ့လီၫ.",
			"42": "<sup>42</sup> ထီးဘၪမုဂၪလၩ့အခံၫ့အခၫတၭ, ဘၪမုတဲၩ့ဝဲၩဆၧ အမုနံၩ, ဘဲၫၦစံၭဆၧအၥိၭ,မးၥံၫအနံၩလချႃၭဘၪ",
			"43": "<sup>43</sup> ဒံၭဘၪတၭ,- ၦကိၪ့လိၬဆၧအီၪလၧအလၩအဖၩ့ ၦအၫ ရမၥံအၫဖိၪစယိၥၭလၧအနၫ့ဆါ ယိလါယွၩအဘၩ့အ မုးအဖၧၩ့ၥၭလဂၩဂဲၫဝ့ၫတၭ, အီၪက့ၪဒူၩအၥၭ တၭ,လ့ၩဝ့ၫလၧစပဲလၭအအီၪနီၪ, အၪ့ကံၩ့ထဲၩ့ယ့ၫ",
			"44": "<sup>44</sup> ၡုၬအစွၪလီၫ.- မွဲအၥံၫယူၭနီၪစပဲလၭထီၫမံၫထီၫမၪ ဝ့ၫတၭ,ကိၭန့ၦၥုၭဖိၪလယၩအခိၪလဂၩတၭ, အၪ့စၪ့",
			"45": "<sup>45</sup> ဝ့ၫ,မွဲအၥံၫယူၭဧၪ.- ထီးၦၥုၭဖိၪလယၩအခိၪ ဒုၭၥ့ၪ",
			"46": "<sup>46</sup> ယၫဝ့ၫတၭ,ဖ့ၪလၫ့ဝ့ၫအစွၪလၧစယိၥၭလီၫ.- အဝ့ၫ ဒၪဎွ့ၩဆၧဘွၩဖျ့ၫလံၬကံၭ, ဆိၬလၩ့ထဲၩ့အစွၪတၭ, ဘီၪ့ထၪ့ထဲၩ့ဝ့ၫ လၧဆၧဘွၩဖျ့ၫလံၬကံၭနီၪ, အီၪက့ၪ လၩ့ဝ့ၫလၧ ဆၧၥွၪခိၪလၧအချိၬန့ဝ့ၫ လၧလိးအဖၧၩ့ လီၫ.ချံးစိၩလိးလဖျိၪ့လၧဆၧၥွၪခိၪအဖိးထိၭလီၫ.",
			"47": "<sup>47</sup> ဆၧအီၪက့ၪလၩ့ဝ့ၫအလးနီၪ, နးမၫရံၫမၭဂဒၫလံနံၫ ဒဲစယိစ့ၭအမိနးမၫရံၫဒၪဘၪဝ့ၫလီၫ."
		},
		"16": {
			"1": "<sup>1</sup> မးၥံၫအနံၩဖီၩ့ခွံၬတၭ, နးမၫရံၫမၭဂဒၫလံနံၫ,ဒဲ စယ့မံၭအမိနးမၫရံၫ, ဒဲနးစလိၫမံၥံၪ,ဎွ့ၩဆၧနၧၫ့မၧၫ့ ဘဲၫၥိၭအမိလ့ၩဂုၪဘၪအဝ့ၫနီၪလီၫ.",
			"2": "<sup>2</sup> နွ့ၫနံၩအကျၩမုခၪ့ထံၭလနံၩ ဂီၩဂီၩလ့ၬလၧမုဂဲၫ ထၪ့နီၪ, ၦမုၪလဖၪလ့ၩထီၩ့လၧဆၧၥွၪခိၪအအီၪလီၫ.",
			"3": "<sup>3</sup> စံၭလိၬအၥံၪအၥၭ, မွဲပလၫမိချံးခွံၬန့ပၧၩလၧလိးအီၪ",
			"4": "<sup>4</sup> လၧဆၧၥွၪခိၪအဖိးထိၭလဂၩလဲၪ.- အဂဲးဘဲၫယီၩ မွဲ အဒိၪမၬလီၫ. ယိထၪ့ဆၧတၭ,ဒၪဘၪလိးချံးခွံၬယူၭဝ့ၫ",
			"5": "<sup>5</sup> ယူၭ.- လ့ၩနုၬဝ့ၫလၧဆၧၥွၪခိၪအဖၧၩ့တၭ, အဝ့ၫၥံၪ ဒၪဘၪၦဖိၪၥၪ ခွၫလဂၩၥိၭဝိၬလိၫ့ဘွၩ, ဆၧၫ့နၩ့ဝ့ၫ, လၧအစူၪထွ့ၪလခီၫ့တၭ, အဝ့ၫၥံၪၥၭမဲၪၥၭဖျဲၩ့ဝ့ၫဒၪ",
			"6": "<sup>6</sup> လီၫ.- အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, ထီးၥၭမဲၪၥၭဖျဲၩ့လဂ့ၩ, နၥံၪအၪ့ဎၬၦနၭဇရ့ၭဖိၪယ့ၫၡုၬ လၧအဘၪၥံၫဝ့ၫလၧ ထုၪ့စူၪယၫအလီၩ့လီၫ. အဝ့ၫဒၪဂဲထုၪ့ထဲၩ့ယူၭ,အီၪ ထီးယီၩအ့ၬ. ယိခွါ, အလးထီးၦအီၪက့ၪလၩ့အဝ့ၫ",
			"7": "<sup>7</sup> ဒၪဘီၪ.- မွဲလါနၫ့တၭ,ထဲၩ့လီၩဘၪအထံၩအဖျဲၥံၪ,ဒဲ စပံတၧၫ,လၧအဝ့ၫလဂၩ မိလ့ၩဝဲၩ လၧနၥံၪအမ့ၬယၫ လၧဂၫလလံၫအဖၧၩ့ ဘဲၫအလီၩဘၪဝဲၩနၥံၪအၥိၭနီၪ,",
			"8": "<sup>8</sup> နၥံၪမိဒၪဘၪဝ့ၫထီးနီၪလီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ဝ့ၫချဲၫ့ချဲၫ့ လ့ၬတၭ, ထဲၩ့စဲၪ့ခွံၬဝ့ၫလၧဆၧၥွၪခိၪနီၪဝၭထိၬဝ့ၫ, ထီၫမံၫထီၫမၪတၭ, လီၩဘၪၦနးဂၩနးမံၩ့အ့ၬ. အဂဲး ဘဲၫယီၩၥၭမဲၪၥၭဖျဲၩ့ဝ့ၫဒၪလီၫ.",
			"9": "<sup>9</sup> နွ့ၫနံၩအကျၩ မုခၪ့ထံၭအနံၩဂီၩဂီၩလ့ၬအဝ့ၫဒၪဂဲ ထုၪ့ထဲၩ့တၭ, ဒုၭနဲၪဆိၫအၥၭ လၧနးမၫရံၫမၭဂဒၫ လံနံၫလၧအနၫ့ထၪ့ခွံၬယူၭ ဆၧနၪနွ့ၫဒုၩလၧအလီၩ့",
			"10": "<sup>10</sup> လဂၩနီၪလီၫ.- ၦအီၪဝဲၩဝ့ၫလၧယ့ၫၡုၬအၥိၭနီၪ,အၥုၪ့ ခါၥၭလၩ့တၭ, ဂၪ့ဆၧယၧၩ့ဆၧအဘိၩ့ဘၭနီၪ, နးမၫ",
			"11": "<sup>11</sup> ရံၫလ့ၩလီၩဘၪအဝ့ၫၥံၪလီၫ.- ထီးအဝ့ၫၥံၪနါဂၧၫ့လၧ အမၧၫ့ထၪ့ထဲၩ့,ဒဲနးမၫရံၫဒၪဘၪဝ့ၫနီၪနဲၩဝ့ၫအ့ၬ.",
			"12": "<sup>12</sup> ဆၧနီၪလဖၪအလးခဲၫ့တၭ, ၦလၧအဝ့ၫၥံၪအကျၩ နံၫဂၩစဲၪ့ဝ့ၫတၭ, လ့ၩထၪ့လၧခီၫ့နီၪ, အဝ့ၫဒၪနဲၪဖျီၪ ထၪ့အၥၭလၧအဝ့ၫၥံၪ လၧအခံးအဂၩ့လမံၩ့ဒၪလီၫ.",
			"13": "<sup>13</sup> ၦနံၫဂၩနီၪဂဲၫထဲၩ့လီၩဘၪ ၦအီၪလၩ့ထးလဖၪတၭ, အဝ့ၫၥံၪနဲၩဝ့ၫဒၪဆ့အ့ၬ.",
			"14": "<sup>14</sup> လၧခဲၫ့ထဲၩ့နီၪ, ၦဆံၫလဂၩဆၧၫ့နၩ့ဒံၩ့ခံၫ့လၧစ ပွဲထံၭအဘိၩ့ဘၭတၭ, အဝ့ၫဒၪနဲၪဖျီၪထၪ့အၥၭလၧ အဝ့ၫၥံၪနီၪ, အဝ့ၫၥံၪလနဲၩဘၪ ၦလၧအဒၪဘၪ ဝ့ၫ လၧအဂဲထုၪ့ထဲၩ့ယူၭတၭ, လၧအဝ့ၫၥံၪအဆၧလနဲၩ",
			"15": "<sup>15</sup> ဘၪဒဲအၥၭနီၩ့အကၠီၩ့တၭ,အၪ့လၬဝ့ၫဒၪလီၫ.- အဝ့ၫ ဒၪစံၭအဝ့ၫၥံၪ, လ့ၩလၧဂၪ့ခိၪချိၫ့ထၧၫ့ဖျိၪ့ယၫတၭ, လီၩလၩ့လၬလၩ့ဆၧၥၭထိၬအပရၧၫ့ လၧကယဲၦၡၩ",
			"16": "<sup>16</sup> ကိၭဂၩဒ့ၭဆံၭ.- ၦလၧအနဲၩ့ထဲၩ့ဆၧဒဲဒိၭဘၭတံၫဇၫ့ အၥၭလဂၩဂၩနီၪ,မိထီၩ့ဝ့ၫ လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့ လီၫ.အ့ၪမွဲၦလၧအလနဲၩဘၪဝ့ၫလဂၩဂၩနီၪ,မိဘၪ ဆၧစ့ၩရၫ့စၪလီၫ.",
			"17": "<sup>17</sup> ၦလၧအနဲၩဆၧလဖၪနီၪ, ဆၧမိမၩလၩ့လၭအၥၭ လၧအဝ့ၫၥံၪဘဲၫယီၩ, မွဲအမိနၫ့ထၪ့ခွံၬဆၧနၪလၧ ယမံၩ့, မိချဲၩ့ထၪ့ဆၧလၧ ၦဂူၫဂၩၥံၪအလၨလခီၫ.",
			"18": "<sup>18</sup> မိဖီၪ့ဂူတၭ,အ့ၪအီၩဆၧမၧၩ့ၥံၫနီၪ, မိဘၪဆၧနးမံၩ့ အ့ၬ. မိအီၪက့ၪထၪ့အစူၪလၧၦအဆၫလဖၪအလီၩ့ တၭ,အဝ့ၫၥံၪမိဘျၪထဲၩ့ဝ့ၫလီၫ.",
			"19": "<sup>19</sup> မၩအၥၭဘဲၫနီၪတၭ, ကဆါလီၩလၩ့လၬလၩ့ဆၧ လၧအဝ့ၫၥံၪနီၪအလးခဲၫ့,ဆၧအၪ့မၩန့ထၪ့ဝ့ၫလၧမူၭ ခိၪနီၪတၭ, ဆၧၫ့နၩ့ဝ့ၫလၧယွၩအစူၪထွ့ၪလခီၫလီၫ.",
			"20": "<sup>20</sup> အဝ့ၫၥံၪစဲၪ့လီၩလၩ့လၬလၩ့ဆၧ လၧအလးကိၭစီၪ့ ဒ့ၭတၭ, ကဆါမၩဎုၬဆၧလၧအဝ့ၫၥံၪအၥိၭနီၪမၩ ဂုးမၩခၧၫ့ဆၧအလူအထၫလၧဆၧလၩ့လၭလၧ အမၩ အၥၭနီၪလီၫ."
		}
	}
};
module.exports = book;